(1505, '10202337760285940', '<p>				Arkadaşlar League of Legends ta farklılık isteyenlere bu bilgiyi buldum.</p><div><h3>Teemo’yu Bul Nasıl Oynanır ?</h3><p><strong>Özel oyun kısmından kendinize bir oda kurun. Dominion haritasını seçin ve 5er kişilik</strong><br /><strong>iki takım kurun.</strong></p><p><strong>1-</strong>&nbsp;Her iki takımda da birer kişi Teemo şampiyonunu alsın.<br /><strong>2-</strong>&nbsp;Teemo lar saklansın. (Yalnızca orman içine saklanabilirler, lane lere girmek yasak)<br /><strong>3-</strong>&nbsp;Kahinin Özütü ve Hextech Tarayıcı kullanmak yasak<br /><strong>4-</strong>&nbsp;Teemolara ormanda saklanmaları için zaman verilir. Bu sürede diğer 8 takım üyesi<br />base de beklerler ve her iki takım da hazır diyince oyun başlar.<br /><strong>5-</strong>&nbsp;Teemo lardan en az biri görünür olana kadar takımların kendi aralarında savaşmaları<br />yasak.<br /><strong>6-</strong>&nbsp;Teemo lar hariç takımdaki diğer herkes istediği zaman base e gitmekte ve item almakta<br />serbesttir.<br /><strong>7-</strong>&nbsp;Teemolar dan biri öldüğünde kalan herkes base e döner ve kural 4 e dönerek oyun<br />yeniden başlar.<br /><strong>8-</strong>&nbsp;3 kere Teemo öldüren ilk takım kazanır. Diğer takım teslim olur.<br /><strong>9-</strong>&nbsp;Lee Sin, Katarina, Soraka, Morgana, Sona, TF, Evelynn, Tryndamere, Karthus, Ezreal<br />şampiyonlarını kullanmak yasak.<br />( Öneri: Oyun için alan vuran şampiyonlar seçmeniz teemo ya can kaybettirmek ve ortaya çıkarmak<br />açısından yararlı olabilir. Hedef odaklı skilleri olan şampiyonlar seçerseniz görünmez olan<br />hedefi vuramayacağınızdan takımınıza yararsız olursunuz.)</p><p>Bu oyunu Sihirdar Vadisi’nde oynayanlar da var fakat malum çok uzun sürdüğü<br />için Dominion daha çok tercih ediliyor. Bu video yabancı olsa da oyun hakkında<br />size yardımcı olacaktır.</p></div>', 'resimyok', 2, 0, 0, '22.03.2015 00:36:01', 20150322, NULL, 0),
