(1370, 'temizkanozan@gmail.com', '<div>-- HABER --</div><div><br /></div><div>Aile ve Sosyal Politikalar Bakanı Ayşenur İslam''a geçen günlerde TBMM kulislerinde gazetecilerle sohbet ederken, gazetecilerden bir tanesi Minecraft’la ilgili soru yöneltti. Gazeteci: “Minecraft diye bir oyun var, bu oyunda eşini öldüren oyuncuya puan veriliyor. Bu tür şiddet içeren oyunlarla ilgili bir yaptırımınız olacak mı?” şeklinde soru sordu. Soruyu cevaplayan İslam, “Şikayetlerle bizzat ilgileneceğim. Oyunu inceleyeceğiz ve şiddet unsuru olup olmadığına bakacağız. Çalışma sonrası oyunla ilgili hukuki bir yaptırım yapabiliriz” dedi.&nbsp;</div><div><br /></div><div>Bu haberi gören arkadaşların aklına hep "Minecraft yasaklanacak mı?" fikri geliyor fakat böyle bir şey söz konusu değil. Gazeteci Southpark''ın bir bölümünü izlemiş. Bu bölüme çocuk Minecraft oynarken babası annesini öldürüyormuş sanırım (tam olarak hatırlayamıyorum buna benzer bir şey) gazeteci arkadaşta bunu yanlış algılayıp Ayşenur İslam''a böyle aktarmış. Günümüz oyunları ile kıyaslayacak olursak bundan önce incelenecek çok oyun var :)</div>', 'resimyok', 0, 0, 0, '17.03.2015 16:27:36', 20150317, NULL, 0),
