(4648, '10206197037657579', 'Selamun Aleyküm arkadaşlar veya abilerim,<br>Şuanda Türkiye serverinde çocuklar ve küfürler gerçekten haddini aşmış vaziyette. Ben de 14 yaşındayım ve sizin çocuk sayabileceklerinizdenim. Çocuğum burda gelip size şov yapıcak halim yok ama ben elimden geldiğince nerdeyse hiç küfretmiyorum hatta chatı bana yazmadıkları sürece veya önemli olmadığı sürece kavgalara falan katılmıyorum bile. Hiç bir şekilde çocukça davranmıyorum. Evet çok iyi oynamıyorum bu sezon Bronz V başladım şuan Gümüş V im. Evet uzun bi süreçte çıktım ama beni çok mutlu etti. Sonra çevremdekiler bana yine bir noob Silver oldu gazamız mübarek olsun diyorlar. Sadece çevremdekiler değil benle nerde olursa olsun herkes ''veled'' , ''çocuk'' diye dalga geçiyor. Ben neden olduğunu anlamıyorum. Ne bu çocuk takıntısı sizde ? Herkes aynı olmayabilir ama yaşım küçük tamam yeri gelir benimde patladığım olur ama neden bu çocuk takıntısı ? Lol oynamaya yada konuşmaya çalıştığım ortamda veya bir oyun sırasındayken yaşım yüzünden anneme küfretmelerinin sebebi ne ? Bende herkes gibi annemi seviyorum ve kimsenin ona küfretmesini istemem. Lütfen bunun neden olduğunu söylerseniz sevinirim ve bundan sonra herkese tanımadan ön yargılı davranmamanızı dilerim. İyi oyunlar :)', 'resimyok', 0, 0, 0, '03.07.2015 05:11:46', 20150703, NULL, 2076),
