INSERT INTO `subs_gonderi` (`id`, `email`, `icerik`, `resim`, `begeni`, `yorum`, `sabit`, `tarih`, `tarihler`) VALUES
(44, '10153142923039443', '<p>NecoTeam Nedir?</p><p>NecoTeam Teamspeak adresimizin açılması ile kurulan, tamamı&nbsp;<a href="https://www.facebook.com/notes/bu%C4%9Fra-ko%C3%A7er/necoteam-nedir/10153121868796635#" role="button">Necati "zeoNNN" Akçay</a>''a destek vermek için bir araya gelmiş&nbsp;<br />250 kişilik bir ekiptir. Bu ekip çeşitli sosyal ağlarda zeoNNN''a destek vermek amacıyla yayın ile ilgili duyuru bağlantılarını<br />beğenir ve paylaşır. Bu sayede facebook üzerinde daha çok insana ulaşmamıza yardımcı olurlar.</p><p>Peki NecoTeam''in imtiyazları nelerdir?</p><div><p>1. NecoTeam''e üye olan herkes Teamspeak adresinde Rütbelendirilerek yetki sahibi olma hakkı kazanmaktadır.<br />2. NecoTeam üyeleri arasında çekilişler ve süpriz etkinlikler yapılmaktadır.<br />3. NecoTeam üyeleri rütbelerininde artmasıyla TeamSpeak adresinde yetkisini arttırarak zeoNNN ile görüşme fırsatı yakalacaktır.<br />4. NecoTeam zeoNNN Yönetim''in bir parçası ve 250 kişilik özel bir ekip olarak daima özel bir yere sahiptir.<br />5. NecoTeam''e Özel Gizli facebook Grubuna katılımınız sağlanacaktır.<br />6. Teamspeakte Sadece NecoTeam''e özel oda.<br />7. NecoTeam''de uzun süre görev yapıp destek olmuş arkadaşlar ilerde zeoNNN Yönetim''e terfi edilebilir.</p><p>NecoTeam''e Nasıl Katılabilirim?</p><p>1. Öncelikle Teamspeak adresimize girmelisiniz.<br />2. Teamspeak adresinde herhangi bir yöneticiyle irtibata geçerek NecoTeam bilgilendirmesi ve permi alabilirsiniz.</p><p>Nasıl Rütbe Atlarım?</p><p>Teamspeak adresinde aktif şekilde zaman geçirip, çeşitli destekleyeci etkinliklerde ön plana çıkabildiğiniz takdirde, NecoTeam&nbsp;<br />Yöneticileri sizleri farkedip gerekli yükseltmeyi sağlayacaklardır.</p></div>', 'photos/600/9808ffb344382753cd834f81cf68277a550.jpg', 0, 0, 0, '11.03.2015 21:25:00', 20150311),
(42, '10153142923039443', '<p>				SIRF PUAN KASMAK AMACIYLA BOŞ MESAJ VE SPAM ATAN KULLANICILAR BANLANMIŞTIR. LÜTFEN KAYDA DEĞER PAYLAŞIMLARDA BULUNALIM.&nbsp;</p><div><br /></div><div>DoraCamille</div>', 'resimyok', 0, 0, 0, '11.03.2015 11:10:30', 20150311),
(43, 'aytugilknur@hotmail.com', 'Yayın var mı?\r\nYayın ne zaman/saat kaçta?\r\n\r\nSorularınızın cevabı olarak sağ tarafta yayın sayacı bulunmaktadır. Oradan takip ediniz.\r\n\r\nYayın sayacı günceldir.', 'resimyok', 0, 0, 0, '11.03.2015 16:26:50', 20150311);
