lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1386:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 4.2.1 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda. Önemli bir güvenlik açığını kapatan bu güvenlik sürümünü web sitenize bir an önce uygulamanız önerilmektedir.</p>\n<p>Bu güvenlik dağıtımında yorum alanındaki bir açık kullanılarak sızma gerçekleştirilmesine olanak sağlayan kritik güvenlik açığı kapatıldı. Otomatik güncelleme özelliği aktif olan sitelerde güncelleme otomatik olarak uygulanacaktır. </p>\n<p>WordPress.org üzerindeki resmi 4.2.1 duyurusuna da <a href="https://wordpress.org/news/2015/04/wordpress-4-2-1/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/0ly-Y2K3WE0" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:49:"http://www.wp-tr.org/wordpress-turkce-4-2-1/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:44:"http://www.wp-tr.org/wordpress-turkce-4-2-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:22:"WordPress Türkçe 4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/4l9p0-ZaahM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:51:"http://www.wp-tr.org/wordpress-turkce-4-2/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 07:39:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:14:"Güncellemeler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:3:"4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"Türkçe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:14:"Türkçe Paket";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:22:"WordPress Türkçe 4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=20022";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:545:"Merhaba arkadaşlar, WordPress Türkçe 4.2 şu an indirilebilir durumda. WordPress 4.2 sürümü, caz pianisti Bud Powell onuruna &#8220;Powell&#8221; olarak isimlendirilmiştir. Yeni sürüm geliştirilirken hedef global olarak iletişimi ve paylaşımı artıracak özellikleri öne çıkarmaktı. Yeni sürüm videosuna aşağıdan erişebilirsiniz. Başlamadan önce &#8220;No subtitles&#8221; yazan alana tıklayıp, &#8220;Türkçe&#8221; seçeneğini seçerek, Türkçe altyazı ile izleyebilirsiniz. Bu sürümdeki yenilikler; [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3471:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 4.2 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda. WordPress 4.2 sürümü, caz pianisti <a href="https://en.wikipedia.org/wiki/Bud_Powell">Bud Powell</a> onuruna &#8220;Powell&#8221; olarak isimlendirilmiştir. Yeni sürüm geliştirilirken hedef global olarak iletişimi ve paylaşımı artıracak özellikleri öne çıkarmaktı.</p>\n<p>Yeni sürüm videosuna aşağıdan erişebilirsiniz. Başlamadan önce &#8220;<strong>No subtitles</strong>&#8221; yazan alana tıklayıp, &#8220;<strong>Türkçe</strong>&#8221; seçeneğini seçerek, Türkçe altyazı ile izleyebilirsiniz.</p>\n<p><embed type="application/x-shockwave-flash" src="https://v0.wordpress.com/player.swf?v=1.04" width="670" height="375" wmode="direct" seamlesstabbing="true" allowfullscreen="true" allowscriptaccess="always" overstretch="true" flashvars="guid=e9kH4FzP&amp;isDynamicSeeking=true"></embed></p>\n<p>Bu sürümdeki yenilikler; yenilenen &#8220;Bas Bunu&#8221; özelliği ile ister tarayıcınızdan, ister mobil cihazlarınızdan şimşek hızıyla içerik paylaşabilirsiniz. Genişletilmiş karakter kümesi desteği ile, çince, japonca, korece dil desteğinin yanı sıra, emojiler de artık kullanılabilir hale geldi. Tema özelleştirici daha da geliştirildi. Tumblr ve Kickstarter için dahili gömme özelliği geliştirildi. Eklenti güncellemek artık neredeyse sihirli bir işlem. Güncelle tuşuna bastığınızda her şey bulunduğunuz sayfada olup bitiyor.</p>\n<p><strong>Kaputun altında</strong></p>\n<p><em>utf8mb4 desteği:</em> Veritabanı karakter kümesi utf8 yerine utf8mb4 olarak güncellendi, böylece 4 baytlık bir sürü yeni karakter kullanılabilir hale geldi.<br />\n<em>Javascript erişilebilirliği:</em> Artık ekran okuyucuların anlayabileceği sesli bildirimleri Javascript ile <code>wp.a11y.speak()</code> kullanarak yapabilirsiniz.<br />\n<em>Ortak terimlerin ayrıştırılması:</em> Birden çok sınıfa ait terimlerden bir tanesi güncellendiğinde terim ayrıştırılarak ayrı ayrı saklanabiliyor. Daha fazla bilgi için <a href="https://developer.wordpress.org/plugins/taxonomy/working-with-split-terms-in-wp-4-2/">Eklenti geliştirici el kitabı</a> bakabilirsiniz.<br />\n<em>Karmaşık sorgu sıralama:</em> <code>WP_Query</code>, <code>WP_Comment_Query</code> ve <code>WP_User_Query</code> artık isimli meta sorgularını kullanarak karışık sorgular çalıştabiliyor.<br />\n<strong><br />\nTakım</strong></p>\n<p>Bu sürüm Drew Jaynes önderliğinde, 283 katılımcının katkılarıyla geliştirildi.</p>\n<p>WordPress.org üzerindeki resmi 4.2 duyurusuna da <a href="https://wordpress.org/news/2015/04/powell/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/4l9p0-ZaahM" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:47:"http://www.wp-tr.org/wordpress-turkce-4-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:42:"http://www.wp-tr.org/wordpress-turkce-4-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:24:"WordPress Türkçe 4.1.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/8UG2q2vr3PE/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:53:"http://www.wp-tr.org/wordpress-turkce-4-1-2/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 22 Apr 2015 13:49:51 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:14:"Güncellemeler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:5:"4.1.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"Türkçe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:14:"Türkçe Paket";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:24:"WordPress Türkçe 4.1.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=20020";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:457:"Merhaba arkadaşlar, WordPress Türkçe 4.1.2 şu an indirilebilir durumda. Bu önemli bir güvenlik dağıtımıdır ve en kısa sürede sitelerinizi güncellemenizi öneririz. WordPress 4.1.1 ve öncesinde anonim kullanıcıların sitenin yönetimini ele geçirebilmelerine olanak sağlayan kritik bir çapraz-site betik açığı mevcut. Bu dağıtım ile hem bu açık, hem de diğer üç güvenlik açığı kapatıldı; &#8211; WordPress 4.1 [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2009:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 4.1.2 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda. Bu önemli bir güvenlik dağıtımıdır ve en kısa sürede sitelerinizi güncellemenizi öneririz.</p>\n<p>WordPress 4.1.1 ve öncesinde anonim kullanıcıların sitenin yönetimini ele geçirebilmelerine olanak sağlayan kritik bir çapraz-site betik açığı mevcut. Bu dağıtım ile hem bu açık, hem de diğer üç güvenlik açığı kapatıldı;</p>\n<p>&#8211; WordPress 4.1 ve üzerinde geçersiz ya da tehlikeli dosya isimlerine sahip dosyalar yüklenebiliyordu.<br />\n&#8211; WordPress 3.9 ve üzerinde kısıtlı bir çapraz-site betik açığı, sosyal mühendisliğe olanak sağlayabiliyordu.<br />\n&#8211; Bazı eklentiler <acronym title="Structured Query Language">SQL</acronym> enjeksiyonu açığına sebep oluyorlardı.</p>\n<p>Bunların yanında güvenliği pekiştirici ufak güncellemeler de yapıldı. Ayrıca bir çok eklenti de güvenlik gereği yeni sürümler çıkardılar. WordPress&#8217;in yanı sıra, kullandığınız eklentilerin de sürümlerini güncellemeyi ihmal etmeyin.</p>\n<p>WordPress.org üzerindeki resmi 4.1.2 duyurusuna da <a href="https://wordpress.org/news/2015/04/wordpress-4-1-2/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/8UG2q2vr3PE" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:49:"http://www.wp-tr.org/wordpress-turkce-4-1-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:44:"http://www.wp-tr.org/wordpress-turkce-4-1-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:22:"WordPress Türkçe 3.5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/YrJk6oUUFDc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:51:"http://www.wp-tr.org/wordpress-turkce-3-5/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 11 Dec 2012 23:12:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:14:"Güncellemeler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:3:"3.5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"Türkçe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:14:"Türkçe Paket";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:22:"WordPress Türkçe 3.5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19936";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:477:"Merhaba arkadaşlar, WordPress Türkçe 3.5 şu an indirilebilir durumda. &#8220;Elvin&#8221; kod adlı 3.5 sürümünde en büyük yenilik, görsel yükleme, düzenleme ve galeri oluşturma alanlarında. Geliştiriciler için bir çok yapısal iyileştirme de mevcut. Eskisine göre çok daha performanslı sorgular çalıştırılabilecek. Son olarak yönetim ekranları yüksek çözünürlüklü cihazlar için (yeni iPad, MacBook Pro Retina, vb) elden geçirilip [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1765:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 3.5 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda.</p>\n<p>&#8220;Elvin&#8221; kod adlı 3.5 sürümünde en büyük yenilik, görsel yükleme, düzenleme ve galeri oluşturma alanlarında. Geliştiriciler için bir çok yapısal iyileştirme de mevcut. Eskisine göre çok daha performanslı sorgular çalıştırılabilecek. Son olarak yönetim ekranları yüksek çözünürlüklü cihazlar için (yeni iPad, MacBook Pro Retina, vb) elden geçirilip cilalanmış.</p>\n<p>Yeni varsayılan tema Twenty Twelve de 3.5 paketine eklenmiş durumda. Kolayca bir içerik yönetim sistemine altyapı olabilecek bir tema.</p>\n<p>Bağlantı yöneticisi artık yeni kurulumlarda varsayılan olarak gelmeyecek, bunun yerine bir eklenti olarak istendiğinde yüklenebilecek. Eski kurulumlardaki bağlantı yöneticileri varlığını sürdürecek.</p>\n<p>WordPress.org üzerindeki resmi 3.5 duyurusuna da <a href="http://wordpress.org/news/2012/12/elvin/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/YrJk6oUUFDc" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:47:"http://www.wp-tr.org/wordpress-turkce-3-5/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:42:"http://www.wp-tr.org/wordpress-turkce-3-5/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:24:"WordPress Türkçe 3.4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/Mrd1XzfDcCg/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:53:"http://www.wp-tr.org/wordpress-turkce-3-4-2/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 06 Sep 2012 22:30:18 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:14:"Güncellemeler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:5:"3.4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"Türkçe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:14:"Türkçe Paket";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:24:"WordPress Türkçe 3.4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19932";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:449:"Merhaba arkadaşlar, WordPress Türkçe 3.4.2 şu an indirilebilir durumda. Bu sürüm bir bakım ve güvenlik sürümüdür. 3.4 sürümünden bu yana yaklaşık 15 milyon kere indirilen WordPress&#8217;in 3.4.x dalında bir çok hata keşfedildi ve düzeltildi, ayrıca bir çok iyileştirme de yapıldı; Yönetim ekranlarında bazı eski tarayıcılar ile olan uyumsuzluklar giderildi Bir tema düzgün önizleme yapılamadığında ya [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2024:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 3.4.2 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda. Bu sürüm bir bakım ve güvenlik sürümüdür.</p>\n<p><a href="http://www.wp-tr.org/wordpress-turkce-3-4/" title="WordPress Türkçe 3.4">3.4</a> sürümünden bu yana yaklaşık 15 milyon kere indirilen WordPress&#8217;in 3.4.x dalında bir çok hata keşfedildi ve düzeltildi, ayrıca bir çok iyileştirme de yapıldı;</p>\n<ul>\n<li>Yönetim ekranlarında bazı eski tarayıcılar ile olan uyumsuzluklar giderildi</li>\n<li>Bir tema düzgün önizleme yapılamadığında ya da ekran görüntüsü görüntülenemediğinde ortaya çıkan bir hata düzeltildi.</li>\n<li>Görsel editör ile eklenti uyumluluğu iyileştirildi</li>\n<li>Bazı kategori kalıcı bağlantı yapıları ile sayfalama yapısı arasındaki problemler giderildi</li>\n<li>oEmbed sağlayıcılar ve geri izleyiciler ile ilgili hatalardan kaçınılacak geliştirmeler yapıldı</li>\n<li>Gereğinden büyük boyutlardaki üst kısım görsel dosyalarının yüklenmesi engellendi.</li>\n</ul>\n<p>Bunların yanında bir çok da güvenlik geliştirmeleri yapıldı. 3.4.2 sürümü ile ilgili orijinal açıklamaya <a href="http://wordpress.org/news/2012/09/wordpress-3-4-2/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/Mrd1XzfDcCg" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:49:"http://www.wp-tr.org/wordpress-turkce-3-4-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:44:"http://www.wp-tr.org/wordpress-turkce-3-4-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:32:"iOS için WordPress 3.1 çıktı";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/y60G6qEHnqE/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:59:"http://www.wp-tr.org/ios-icin-wordpress-3-1-cikti/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 10 Aug 2012 15:57:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:8:"Haberler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:19:"iOS için WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:4:"ipad";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:6:"iphone";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:17:"WordPress for iOS";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19927";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:474:"iOS için WordPress uygulamasının yeni sürümü çıktı. 3.0&#8217;dan 3.1 sürümüne çıkan uygulamada sürüm numarasındaki küçük artışın aksine bir çok yenilik var. Arayüzü tamamen yenilenen uygulama bir çok yeniliği de beraberinde getiriyor. Uygulama ikonuyla başlayan değişiklikler, geliştirilmiş giriş ekranı ve baştan aşağı tekrar tasarlanan yeni arayüzü ile devam ediyor. Uygulama daha önceki sürümlerinde olduğu gibi hem [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1817:"<p style="text-align: center;"><img class="size-full wp-image-19928 aligncenter" title="WordPress for iOS 3.1" src="http://www.wp-tr.org/wp-content/uploads/2012/08/ipad-3-1.jpg" alt="" width="480" height="360" /></p>\n<p>iOS için WordPress uygulamasının yeni sürümü çıktı. 3.0&#8217;dan 3.1 sürümüne çıkan uygulamada sürüm numarasındaki küçük artışın aksine bir çok yenilik var. Arayüzü tamamen yenilenen uygulama bir çok yeniliği de beraberinde getiriyor. Uygulama ikonuyla başlayan değişiklikler, geliştirilmiş giriş ekranı ve baştan aşağı tekrar tasarlanan yeni arayüzü ile devam ediyor. Uygulama daha önceki sürümlerinde olduğu gibi hem <a href="http://www.wp-tr.org/etiket/iphone">iPhone</a> hem de <a href="http://www.wp-tr.org/etiket/ipad">iPad</a>&#8216;lerde çalışıyor. iPhone sürümü Facebook uygulamasını andırırken, iPad uygulaması da Twitter uygulamasını anımsatıyor.</p>\n<p>Görsel değişikliklerin yanı sıra irili ufaklı bir çok geliştirme ve özellik de yeni sürümün değişiklikleri arasında yer alıyor;</p>\n<ul>\n<li>Uygulama içinden sitenize kolay erişim,</li>\n<li>Web arayüzündeki başlangıç ekranına uygulama içinden erişim,</li>\n<li>Yatay kullanım desteği,</li>\n<li>WordPress.com istatistikleri</li>\n<li>WordPress.com üzerinde blog yazan arkadaşları bulmaya olanak sağlayan arkadaş bulucu,</li>\n<li>iPad için yazı önizleme özelliği,</li>\n<li>Yine iPad için WordPress.com okuyucusu ve Hızlı Fotoğraf özellikleri,</li>\n<li>Bir çok performans ve altyapı iyileştirmeleri</li>\n</ul>\n<p>Yeni uygulamayı <a href="http://itunes.apple.com/US/app/id335703880?mt=8">App Store</a>&#8216;dan edinebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/y60G6qEHnqE" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:55:"http://www.wp-tr.org/ios-icin-wordpress-3-1-cikti/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explici