ess Türkçe 3.4.1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19923";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:480:"Merhaba arkadaşlar, WordPress Türkçe 3.4.1 şu an indirilebilir durumda. İki haftada üç milyon indirme sayısına ulaşan 3.4 sürümünün ardından hemen bir güvenlik güncelleştirmesi ile 3.4 dalı daha güçlü bir hale getiriliyor. 18 hatanın giderildiği ve güvenlik güncelleştirilmelerinin yer aldığı 3.4.1 sürümüne yükseltmek için hemen yönetim ekranlarınızın üstünde yer alan güncelleme bağlantısını kullanın. 3.4.1 sürümü ile [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1376:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 3.4.1 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda.</p>\n<p>İki haftada üç milyon indirme sayısına ulaşan 3.4 sürümünün ardından hemen bir güvenlik güncelleştirmesi ile 3.4 dalı daha güçlü bir hale getiriliyor. 18 hatanın giderildiği ve güvenlik güncelleştirilmelerinin yer aldığı 3.4.1 sürümüne yükseltmek için hemen yönetim ekranlarınızın üstünde yer alan güncelleme bağlantısını kullanın. 3.4.1 sürümü ile ilgili orijinal WordPress bildirisine <a href="http://wordpress.org/news/2012/06/wordpress-3-4-1/">buradan</a> ulaşabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/FMEcIgRV2Ac" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:49:"http://www.wp-tr.org/wordpress-turkce-3-4-1/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:44:"http://www.wp-tr.org/wordpress-turkce-3-4-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:22:"WordPress Türkçe 3.4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/d8qFWbgMC5o/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:51:"http://www.wp-tr.org/wordpress-turkce-3-4/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 14 Jun 2012 14:50:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:14:"Güncellemeler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:3:"3.4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:8:"Türkçe";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:14:"Türkçe Paket";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:22:"WordPress Türkçe 3.4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19921";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:484:"Merhaba arkadaşlar, WordPress Türkçe 3.4 şu an indirilebilir durumda. Gitarist Grant Green&#8216;in anısına &#8220;Green&#8221; kod adı verilen 3.4 sürümü çıktı. Biz de hiç vakit kaybetmeden Türkçe sürümü hazırladık. Yeni sürümde öne çıkan özellikler olarak tema özelleştirme, özel başlık bölümü, twitter entegrasonu ve görsel başlıkları özelliklerini sayabiliriz. Yeni özellikler ile ilgili kısa bir klibi aşağıda bulabilirsiniz [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3985:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 3.4 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda.</p>\n<p>Gitarist <a href="http://en.wikipedia.org/wiki/Grant_Green">Grant Green</a>&#8216;in anısına &#8220;Green&#8221; kod adı verilen 3.4 sürümü çıktı. Biz de hiç vakit kaybetmeden Türkçe sürümü hazırladık.</p>\n<p>Yeni sürümde öne çıkan özellikler olarak tema özelleştirme, özel başlık bölümü, twitter entegrasonu ve görsel başlıkları özelliklerini sayabiliriz. Yeni özellikler ile ilgili kısa bir klibi aşağıda bulabilirsiniz (İngilizce).</p>\n<p><embed type="application/x-shockwave-flash" src="http://s0.videopress.com/player.swf?v=1.03" width="670" height="375" wmode="direct" seamlesstabbing="true" allowfullscreen="true" allowscriptaccess="always" overstretch="true" flashvars="guid=Gg0EFixV&amp;isDynamicSeeking=true"></embed></p>\n<p><strong>Kullanıcılar için</strong><br />\n3.4 sürümündeki en büyük değişiklik tema özelleştirici. Mevcut temanız ya da geçmeyi planladığınız yeni temalar ile ilgili bir çok değişikliği kapalı kapılar ardında yapıp, dünyanın geri kalanı fark etmeden bu değişiklikleri uygulayabilirsiniz. Buna benzer yeni özellikler de gelecek sürümlerde bizi bekliyor.</p>\n<p>Yönetim ekranlarında gündelik kullanımınızı kolaylaştıracak bir çok ufak tefek değişiklik mevcut. Örneğin çok fazla temanız varsa, temaları listelemek ve aralarında gezinmek artık çok daha kolay. Özel başlık görseli kullanmak istediğinizde artık ortam kütüphanesinin nimetlerinden faydalanabileceksiniz.</p>\n<p>Gömme desteği geliştirilmiş, artık tweet&#8217;leri de yazıların içine gömebileceksiniz. Yeni bir satıra ilgili tweet&#8217;in kalıcı bağlantısını yapıştırmanız yeterli.</p>\n<p>Son olarak görsel başlıklarında basit <acronym title="HyperText Markup Language">HTML</acronym> kullanımı desteği ile görsellerinize daha güçlü başlıklar atabileceksiniz.</p>\n<blockquote class="twitter-tweet" width="500" lang="tr"><p>WordPress Türkçe 3.4 çıktı! <a href="https://twitter.com/search/%23wordpress">#wordpress</a> #3.4 <a href="https://twitter.com/search/%23turkce">#turkce</a> <a href="http://t.co/Sx28SAyU" title="http://tr.wordpress.org/">tr.wordpress.org</a> <a href="http://t.co/BEpVkceY" title="http://www.wp-tr.org/wordpress-turkce-3-4/">wp-tr.org/wordpress-turk?</a></p>\n<p>&mdash; WordPress Türkiye (@WP_Turkiye) <a href="https://twitter.com/WP_Turkiye/status/213281154269323264" data-datetime="2012-06-14T14:46:04+00:00">Haziran 14, 2012</a></p></blockquote>\n<p><script src="//platform.twitter.com/widgets.js" charset="utf-8"></script></p>\n<p><strong>Geliştiriciler için</strong><br />\nKaputun altında özellikle <acronym title="eXtensible Markup Language">XML</acronym>-<acronym title="Remote Procedure Call">RPC</acronym>, tema, özel başlık <acronym title="Application Programming Interface">API</acronym>&#8217;si, WP_Query iyileştirmeleri ve çeviri sistemleri gibi bir çok alanda bir çok irili ufaklı geliştirme yapıldı. <a href="http://codex.wordpress.org/Version_3.4" target="_blank">Codex</a>&#8216;ten bu geliştirmeler ile ilgili daha detaylı bilgi alabilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/d8qFWbgMC5o" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:47:"