:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:24:"WordPress Türkçe 3.3.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://www.wp-tr.org/?p=19913";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:515:"Merhaba arkadaşlar, WordPress Türkçe 3.3.2 şu an indirilebilir durumda. Bu sürüm güvenlik dağıtımı olarak çıktı. Üçüncü parti yazılımlardaki güvenlik güncellemeleri (Plupload, SWFUpload, SWFObject) sisteme yansıtıldı. Ayrıca bir kaç önemli güvenlik açığı da yamandı. Daha detaylı bilgiyi değişim kayıtlarından takip edebilirsiniz. Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1238:"<p>Merhaba arkadaşlar,</p>\n<p><a href="http://tr.wordpress.org/"><img src="/static/img/wp-indir-son.jpg" alt="WordPress Türkiye indir" align="left" /></a>WordPress Türkçe 3.3.2 şu an <a href="http://tr.wordpress.org/">indir</a>ilebilir durumda.</p>\n<p>Bu sürüm güvenlik dağıtımı olarak çıktı. Üçüncü parti yazılımlardaki güvenlik güncellemeleri (Plupload, SWFUpload, SWFObject) sisteme yansıtıldı. Ayrıca bir kaç önemli güvenlik açığı da yamandı. Daha detaylı bilgiyi <a href="http://core.trac.wordpress.org/log/branches/3.3?rev=20552&#038;stop_rev=20087">değişim kayıtlarından</a> takip edebilirsiniz.</p>\n<p>Yine her zaman olduğu gibi yükseltme yapmadan önce mutlaka veritabanınızın ve dosyalarınızın yedeğini almanızı öneriyoruz. Sürüm yükseltmeyle ilgili olarak sizi <a href="/belgeler/wordpress/wordpress-surum-yukseltme/">sürüm yükseltme belgemiz</a>e yönlendirebiliriz.</p>\n<p>Yeni sürümle ilgili sorunlarınızı <a href="/forum/">forumda</a> paylaşabilir, Türkçe pakette bulduğunuz çeviri hatalarını ve çeviri hakkında önerilerinizi bize bildirebilirsiniz.</p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/eUS2Jv9K75s" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:49:"http://www.wp-tr.org/wordpress-turkce-3-3-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:44:"http://www.wp-tr.org/wordpress-turkce-3-3-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"Yeni 10marifet.org ve WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://feedproxy.google.com/~r/wp-turkiye/~3/orrtdW7ecvI/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:62:"http://www.wp-tr.org/yeni-10marifet-org-ve-wordpress/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 31 Jan 2012 07:38:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:8:"Haberler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Röportaj";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:9:"10marifet";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:18:"Hasan Yalçınkaya";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:5:"pilli";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://www.wp-tr.org/?p=803";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:525:"Yakın zamanda altyapısını yenileyerek WordPress kullanmaya başlayan 10marifet.org ile ilgili Hasan Yalçınkaya ile kısa bir röportaj yaptık; 10marifet.org ve pillinetwork&#8216;ü kısaca tanıtabilir misiniz? pillinetwork, 2000&#8217;den beri yayında olan hafif.org ve bildirgec.org&#8216;un 2006&#8217;da güçlerini birleştirip kurdukları bir bloglar ağı. Farklı konularda toplam 10 adet blog&#8217;dan oluşuyor. 10marifet.org ise trafikleriyle bunların arasından sıyrılan ve özel ilgiyi hak [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Emre Erkan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:9000:"<p><a href="http://www.wp-tr.org/wp-content/uploads/2012/01/10marifet.png"><img class="alignleft size-medium wp-image-804" title="10marifet" src="http://www.wp-tr.org/wp-content/uploads/2012/01/10marifet-200x30.png" alt="" width="200" height="30" /></a>Yakın zamanda altyapısını yenileyerek WordPress kullanmaya başlayan <a href="http://www.10marifet.org">10marifet.org</a> ile ilgili <a href="http://twitter.com/hafifuyku">Hasan Yalçınkaya</a> ile kısa bir röportaj yaptık;<br />\n<br class="clear" /></p>\n<h3><a href="http://www.10marifet.org/">10marifet.org</a> ve <a href="http://www.pilli.com/">pillinetwork</a>&#8216;ü kısaca tanıtabilir misiniz?</h3>\n<p>pillinetwork, 2000&#8217;den beri yayında olan <a href="http://www.hafif.org/">hafif.org</a> ve <a href="http://www.bildirgec.org/">bildirgec.org</a>&#8216;un 2006&#8217;da güçlerini birleştirip kurdukları bir bloglar ağı. Farklı konularda toplam 10 adet blog&#8217;dan oluşuyor. <a href="http://www.10marifet.org/">10marifet.org</a> ise trafikleriyle bunların arasından sıyrılan ve özel ilgiyi hak ettiğini ispat eden bir hobi ve elişi blogu.</p>\n<h3>Neden WordPress&#8217;e geçiş ihtiyacı hissettiniz?</h3>\n<p>2006&#8217;da Ruby on Rails kullanarak kendimiz yazdığımız altyapı artık bakım, ekleme ya da iyileştirme yapılamayacak kadar hantallaşmıştı. (Burada suçlu kesinlikle Ruby on Rails değil, biziz) Biz de artık daha hızlı ve üzerinde istediğimiz değişiklikleri daha kolay yapabileceğimiz bir altyapıya terfi etmek istedik.</p>\n<p>WordPress&#8217;i ihtiyacımız olan çalışma şekline en yakın yazılım olduğu için seçtik. Bu geçişi en az iş gücü harcayarak, programcılarımızı en az meşgul edecek şekilde yapmak istedik, zira onlar <a href="http://put.io/">put.io</a> ile meşguller.</p>\n<h3>Geçiş ne kadar sürdü? Ne tür zorluklarla karşılaştınız ve nasıl bir planlama yaptınız?</h3>\n<p>Önce ben WordPress ve Drupal ile bir ay geçirdim. İstediğimiz her şeyi yapıyorlar mı, ne kadar emek gerekecek bunları kestirmeye çalıştım. WordPress&#8217;te karar kıldıktan sonra temayı yapmaya başladım. Bu süreyi saymıyorum çünkü çok yavaşım. Ardından yaklaşık bir hafta çeşitli eklentileri deneyerek ve WordPress?i eski pillinetwork özelliklerine yakın bir hale getirebilmek ile harcadım. Ardından migrasyon hazırlıklarına başladık. <a href="http://www.10marifet.org/">10marifet.org</a>&#8216;un içinde hâlihazırda bulunan 65.000 yazı, 300.000 yorum ve 350.000 kullanıcıyı taşımak için özel bir WordPress eklentisi yazıldı. Bu, bir iki gün uğraştırdı. Çünkü WPEngine (<a href="http://www.wpengine.com/">wpengine.com</a>) denilen yeni nesil WordPress hosting şirketini kullanmayı ve ölçekleme sorunları ile hiç uğraşmamayı istiyorduk, fakat WPEngine&#8217;deki MySQL veritabanına kendi verimizi sokuşturmak dosya yükleme kısıtları yüzünden zor oluyordu.</p>\n<p>Sonuçta WPEngine&#8217;den vazgeçtik, çünkü <acronym title="Content Delivery Network">CDN</acronym> bağlayacağız diye iki kez bütün eklentilerimizin, bileşenlerimizin ayarlarını sildiler, Türkçe karakterleri düzeltemeyeceğimiz bir şekilde bozdular ve Pazartesi açacağız dememize rağmen bütün hafta sonu düzeltmediler. Hafta sonu destek vermiyorlarmış.</p>\n<p>Olabilir, yeni bir şirkettir, bütün bunlar halledilebilir sorunlar ama hız konusunda bir sürpriz yaşadık. Almanya&#8217;da <a href="http://put.io/">put.io</a> için kullandığımız makinelerden birine bir WordPress kurduk ve Türkiye?den erişimin WPEngine?e nazaran 20-30 kat hızlı olduğunu gördük. WPEngine topolojisini ABD?li kullanıcıya göre optimize etmiş. Biz de bu hızı bir daha bırakamayacağımıza karar verdik ve ölçeklenebilirlik konusunu üstlenmeye ve kendi WordPress&#8217;imizi kendimiz barındırmaya karar verdik.</p>\n<p>Bu geçişin nazik yanlarından biri de 10marifet?in sahip olduğu derin Google penetrasyonunu yitirmemek, Google?dan etiket sayfalarına düşen insanlara 404 sayfası göstermemekti.</p>\n<p>Bunun için önce bütün adresleri mümkün olduğu kadar aynı yaptık. Ancak eski sistemde etiket isimlerini <acronym title="Uniform Resource Locator">URL</acronym>&#8217;nin içine Türkçe ekliyormuşuz. WordPress&#8217;te bu imkânsız (tabii niye imkânlı olsun) redirection isimli bir eklenti ile 55.000 Türkçe karakterli etiket sayfası linkini İngilizce sürümüne yönlendirdik.</p>\n<p>Bu beni en korkutan hamle idi. Şu anda altından başarıyla kalktık görünüyor.</p>\n<h3>Artıları, eksileri neler oldu?</h3>\n<p>Bir kaç pillinetwork özelliği biraz eften püften yöntemlerle çözüldü. Tuttum için kullandığımız <a href="http://www.wp-tr.org/etiket/eklenti">eklenti</a> çok iyi çalışmıyor. Yazı ekleme süreci biraz değişti. Eskiden üyeler yazılarını düzenleyip tekrar onaya gönderebiliyorlardı, şimdi bundan vazgeçmek zorunda kaldık. Yepyeni bir yazı girme tecrübesi var, kullanıcılar sitenin yönetim ara yüzünü de biraz görüyorlar. Pilli yorum avcısı henüz yok, ama yapacağız. Bizim alamet-i farikamız son yorumlar kutusu artık okumadığınız yorum varsa renklendirmiyor, sadece ziyaret edilmiş sayfa linklerini <acronym title="Cascading Style Sheets">CSS</acronym> ile işaret ediyoruz. (Yapılabilir ama çok pahalı sorgular üretiyor)</p>\n<p>WordPress eskiden bana &#8220;kalın&#8221; geliyordu, çok değişmiş. Kendi başına kuvvetli bir makinede çok hızlı. Neredeyse akla gelecek her şeyin eklentisini birileri yazmış. Tam istediğiniz olmasa da biraz fedakârlık yaparak istediğinize ulaşıyorsunuz. İçinde bir çok karmaşıklıklar var ama kolayca kullanıcıdan gizlenebiliyor.</p>\n<h3>10marifet?in pillinetwork&#8217;teki diğer siteler ile olan organik ilişki koptu mu? Ortak hesap kullanılamıyor, bunu bir dezavantaj olarak görmüyor musunuz?</h3>\n<p>Evet organik bağ bu hamle ile kopuyor. Ama bunu bir dezavantaj olarak görmüyoruz, çünkü pillinetwork?ün ortak hesabı hiç bir zaman beklediğimiz gibi kullanılmadı. Her sitenin birbirinden olabildiğince farklı, kendi kitleleri var. İstisnalar da bizi seviyorlardır ve bir kez daha hesap yaratmaya bozulmazlar diye düşündük. Ayrıca WordPress&#8217;i seversek Multisite ile single signon&#8217;u açıveririz diye düşündüm. İnşallah sandığım kadar kolaydır.</p>\n<h3>Diğer network sitelerini de WordPress&#8217;e taşımayı düşünüyor musunuz? 10marifet pilot site mi?</h3>\n<p>Aynen öyle. Sırada <a href="http://www.22dakika.org/">22dakika</a> var&#8230;</p>\n<h3>İngilizce paketi kullanmışsınız ve özel modifikasyonlar yapmışsınız gibi gözüküyor. Türkçe paketi kullanmamanız için özel bir sebep var mı?</h3>\n<p>Önce Türkçe paketi kurduk ve öyle başladık. Ama bir süre sonra burada şunu tercüme etmeye çalışmışlar herhalde diye düşünmenin bizi yavaşlattığını farkettik. PoEdit&#8217;i açıp Türkçe dosyasını düzenlemeye çalıştık, ama çok fazla satır vardı. İngilizcesini açıp sadece kullanıcının gördüğü yerleri yeniden tercüme etmek daha kolay oldu. Bir de 10marifet kullanıcısına &#8220;Çoklu tarayıcı yükleyicisi&#8221; gibi zor terimler göstermek yerine &#8220;Sorun varsa bir de buradan deneyin&#8221; gibi mesajlar yazdık. Bunu her site için tekrarlamayı düşünüyoruz. Sitenin kullanıcısını karşına alıp ona hitaben yazmak faydalı oluyor.</p>\n<h3>İstatistiksel bilgi (Üye sayısı, ziyaretçi sayısı, sayfa gösterim, sunucu, önbellekleme vb.) paylaşabilir misiniz?</h3>\n<p>Tabii. WordPress öncesi ayda 850.000 tekil ziyaretçi, 1.200.000 ziyaret ve 4.500.000 sayfa gösterimi vardı. WordPress ile geçirdiğimiz bir hafta sonunda şu anda gönül rahatlığı ile 1.000.000 tekil ve 7.500.000 sayfa gösterimi tahmininde bulunabiliyorum. Çünkü günlük sayfa gösterimi 250 binlere fırladı. (Trafiğimizi arttıran etken eski sistemden kurtulmamız ve çok hızlanmamız.)</p>\n<p>\n<a href="http://www.wp-tr.org/wp-content/uploads/2012/01/hasan_rop.png"><img class="alignright size-full wp-image-805" title="Hasan Yalçınkaya" src="http://www.wp-tr.org/wp-content/uploads/2012/01/hasan_rop.png" alt="Hasan Yalçınkaya" width="200" height="298" /></a><br />\n<br />\n<strong>Hasan Yalçınkaya</strong><br />\nPilli Kurucu Ortak</p>\n<p>90&#8217;larda bir süre dergi ve gazete yazarlığı yaptıktan sonra 1998&#8217;de ilk blogunu açtı. 2000&#8217;de küçük bir web atölyesi olarak <a href="http://www.pilli.com">Pilli</a>&#8216;yi kurdu. Pilli, 2006&#8217;da pillinetwork ve <a href="http://www.sosyomat.com/">Sosyomat</a>&#8216;ı, 2010&#8217;da ise <a href="http://put.io">Put.io</a>&#8216;yu hayata geçirerek uluslararası sulara yelken açtı.</p>\n<p><br class="clear" /></p><img src="http://feeds.feedburner.com/~r/wp-turkiye/~4/orrtdW7ecvI" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:58:"http://www.wp-tr.org/yeni-10marifet-org-ve-wordpress/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:53:"http://www.wp-tr.org/yeni-10marifet-org-ve-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:2:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";s:4:"href";s:38:"http://feeds.feedburner.com/wp-turkiye";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";