(119, '_transient_feed_d117b5738fbd35bd8c0391cda1f2b5d9', 'a:4:{s:5:"child";a:1:{s:0:"";a:1:{s:3:"rss";a:1:{i:0;a:6:{s:4:"data";s:3:"\n\n\n";s:7:"attribs";a:1:{s:0:"";a:1:{s:7:"version";s:3:"2.0";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:1:{s:7:"channel";a:1:{i:0;a:6:{s:4:"data";s:61:"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:16:"WordPress Planet";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:28:"http://planet.wordpress.org/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"language";a:1:{i:0;a:5:{s:4:"data";s:2:"en";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:47:"WordPress Planet - http://planet.wordpress.org/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"item";a:50:{i:0;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"Matt: Changing America’s Mind";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44992";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:44:"http://ma.tt/2015/04/changing-americas-mind/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:351:"<p><a href="http://www.bloomberg.com/graphics/2015-pace-of-social-change/"><img class="alignnone size-full" src="https://ma.tt/files/2015/04/bottom.png" alt="" /></a></p>\n<p>Bloomberg has a cool look at societal changes, called <a href="http://www.bloomberg.com/graphics/2015-pace-of-social-change/">This Is How Fast America Changes Its Mind</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 01 May 2015 05:56:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:74:"WPTavern: How to Restore the Link Title Attribute Removed in WordPress 4.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=43134";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://wptavern.com/how-to-restore-the-link-title-attribute-removed-in-wordpress-4-2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:6310:"<p>WordPress 4.2 is <a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download">a week old</a> and has been <a href="https://wordpress.org/download/counter/">downloaded</a> more than six million times. One of the first things I noticed after updating is the change to the Insert/edit link modal box. Instead of having to apply a title to the URL, the title is replaced with Link Text. The text that is highlighted before adding a link is automatically inserted into the Link Text box.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/LinkmodalChange.png" rel="prettyphoto[43134]"><img class="wp-image-43135 size-full" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/LinkmodalChange.png?resize=1025%2C301" alt="LinkmodalChange" /></a>WordPress 4.2 Add Link Modal on the Left WordPress 4.1 on the Right\n<p>While I found this behavior to be annoying at first, it has quickly become one of my favorite changes. Adding links is quicker and more efficient. Several other people however, don&#8217;t like the change. WordPress user <a href="https://profiles.wordpress.org/Enticknap">Enticknap</a> created a <a href="https://core.trac.wordpress.org/ticket/32095">ticket on Trac</a> reporting the issue as a bug when in fact, the change was deliberate.</p>\n<p><a href="https://profiles.wordpress.org/DrewAPicture">Drew Jaynes</a>, who led the <a href="http://wptavern.com/drew-jaynes-to-lead-wordpress-4-2">WordPress 4.2 development cycle</a>, explained <a href="https://core.trac.wordpress.org/ticket/32095#comment:5">why the change was made</a>.</p>\n<blockquote><p>The &#8216;Title&#8217; field was intentionally removed from the wpLink modal in <a class="closed ticket" title="task (blessed): Include ''source anchor'' in wpLink quicktags modal for improved ui/ux (closed: fixed)" href="https://core.trac.wordpress.org/ticket/28206">#28206</a> largely because it was often confused with the actual link text itself.</p>\n<p>In recent years, we&#8217;ve begun to actively discourage the use of title attributes in links as they are largely useless outside of providing the &#8220;hover tooltip&#8221; many visual users enjoy, and more importantly, they don&#8217;t promote good accessibility.</p>\n<p>If you&#8217;d like to continue using title attributes in links, you can add them manually using the Text mode in the editor.</p></blockquote>\n<p>Several people took part in the conversation, explaining why the Title box is an important part of their work flow. Andrew Nacin, who helped design the original Link dialog, <a href="https://core.trac.wordpress.org/ticket/32095#comment:22">said,</a> &#8220;I wish this is how it worked from the start.&#8221; Nacin described the Title attribute as an edge case and that its bad for accessibility.</p>\n<p>The discussion was heated at times, but the conclusion is that the Title attribute will not be added back to the dialog box. Instead, users are encouraged to use the <a href="https://wordpress.org/plugins/restore-link-title-field/">Restore Link Title Field</a> plugin developed by <a href="https://profiles.wordpress.org/otto42/">Samuel &#8216;Otto&#8217; Wood</a> and <a href="https://wordpress.org/plugins/restore-link-title-field/">Sergey Biryukov</a>.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/RestoreLinkTitleAttribute.png" rel="prettyphoto[43134]"><img class="size-full wp-image-43138" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/RestoreLinkTitleAttribute.png?resize=502%2C249" alt="Link Title Attribute Restored" /></a>Link Title Attribute Restored\n<p>With the plugin activated, the Insert/edit link dialog is restored to how it was in WordPress 4.1. According to the <a href="https://wordpress.org/plugins/restore-link-title-field/">WordPress plugin directory</a>, the plugin is activated on 100+ sites. I asked Wood if there are plans to add additional features.</p>\n<p>&#8220;I don&#8217;t think adding new features is in the cards as there&#8217;s not much to add,&#8221; he said. &#8220;We might change it up as we fix some of the <a href="https://core.trac.wordpress.org/ticket/32180">problems in core</a> causing it to be difficult to do properly.&#8221;</p>\n<h2>WordPress is Continuously Evolving Software</h2>\n<p>I sympathize with those who are upset that the Link Title attribute was removed from WordPress 4.2. If a feature you depend on in WordPress is drastically changed or removed, the first instinct is to be upset. It forces you to change your workflow and the change is often unexpected.</p>\n<p>I&#8217;ve traveled this path, but I&#8217;ve realized WordPress is continuously evolving software that tries to cater to the majority. Features removed from WordPress generally never go away as they&#8217;re replaced with plugins. A good example is when the ability to add borders and padding to images <a href="http://wptavern.com/common-issues-and-troubleshooting-wordpress-3-9">was removed in WordPress 3.9</a>.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/04/AdvancedImageEditingOptions.png" rel="prettyphoto[43134]"><img class="size-full wp-image-21489" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/04/AdvancedImageEditingOptions.png?resize=840%2C401" alt="Advanced Image Editing Styles" /></a>Advanced Image Styles\n<p>This change lead to a lengthy discussion both on WordPress.org and <a href="http://en.forums.wordpress.com/topic/image-resize-1?replies=430">WordPress.com support forums</a>. Gregory Cornelius created the <a href="https://wordpress.org/plugins/advanced-image-styles/">Advanced Image Styles</a> plugin which re-adds the ability to adjust an image&#8217;s margins and borders as you could prior to WordPress 3.9. According to the plugin directory, it&#8217;s active on more than 20,000 sites.</p>\n<p>I&#8217;m not saying you shouldn&#8217;t speak up when something you use in WordPress is removed. Rather, it&#8217;s a reminder that there is a way for everyone to get the features they want as WordPress core undergoes changes.</p>\n<p><em><strong>Note</strong></em> Before installing the plugin to restore the Link Title attribute, please <a href="http://silktide.com/i-thought-title-text-improved-accessibility-i-was-wrong/">read this post</a> shared by Peter Wilson in the comments.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 01 May 2015 04:49:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:75:"WPTavern: Toivo: A Bold Minimalist WordPress Theme for Blogs and Businesses";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=43078";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://wptavern.com/toivo-a-bold-minimalist-wordpress-theme-for-blogs-and-businesses";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4786:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/tovio.jpg" rel="prettyphoto[43078]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/tovio.jpg?resize=1025%2C489" alt="tovio" class="aligncenter size-full wp-image-43080" /></a></p>\n<p><a href="https://wordpress.org/themes/toivo-lite/" target="_blank">Toivo Lite</a> is a new theme on WordPress.org that features a bold minimalist design that really shines on mobile. <a href="https://foxland.fi/" target="_blank">Sami Keijonen</a> created the theme to be suitable for both business and blog sites.</p>\n<p>Toivo is Finnish and it means &#8220;hope&#8221; in English. It&#8217;s one of a very small number of WordPress themes listed as <a href="https://wordpress.org/themes/tags/accessibility-ready/" target="_blank">accessibility-ready</a> in the official directory. Toivo meets the necessary <a href="https://make.wordpress.org/themes/handbook/review/accessibility/" target="_blank">guidelines</a> without compromising the overall design.</p>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/tovio-screenshot.png" rel="prettyphoto[43078]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/tovio-screenshot.png?resize=880%2C660" alt="tovio-screenshot" class="aligncenter size-full wp-image-43081" /></a></p>\n<p>Toivo can be easily personalized via the customizer with the following built-in options:</p>\n<ul>\n<li>Set header text color, background color, header image, and background image</li>\n<li>Support for 3 navigation menus: primary, top, and social navigation</li>\n<li>Select from 3 different layouts: 1 column,  2 Columns: Content / Sidebar, 2 Columns: Sidebar / Content</li>\n<li>Edit the front page callout title, text, and URL</li>\n</ul>\n<p>With Jetpack active, the theme has additional features for custom content support:</p>\n<ul>\n<li>Upload a logo</li>\n<li>Show your testimonials</li>\n<li>Display portfolio items</li>\n<li>Add infinite scroll to your blog</li>\n</ul>\n<p>Toivo is Keijonen&#8217;s sixth theme accepted to WordPress.org. In the past he has often built on top of the <a href="http://themehybrid.com/hybrid-core" target="_blank">Hybrid Core</a> framework, but this theme uses only select parts, including the <a href="https://github.com/justintadlock/hybrid-core/blob/master/classes/hybrid-media-grabber.php" target="_blank">Hybrid Media Grabber</a> (a script for grabbing media related to a post), a stripped down version of Schema.org markup support, and the <a href="http://themehybrid.com/plugins/breadcrumb-trail" target="_blank">Breadcrumb Trail</a>.</p>\n<p>&#8220;I can still use best parts of Hybrid Core and make decisions based on theme I’m building,&#8221; Keijonen said. &#8220;Toivo is slimmer with fewer translating strings, and has less code to handle.&#8221;</p>\n<p>Keijonen said that branching out has helped him to understand every line of code and have more control over the theme.</p>\n<p>&#8220;Don&#8217;t get me wrong, I have learned most of my WordPress theme knowledge from Justin Tadlock,&#8221; he said. &#8220;Theme Hybrid is still the only community I feel I belong. It is the place where you can learn, be yourself, ask help, have opinions, and get feedback. But in a way I have grown out of it; it&#8217;s like a moving-from-home experience.&#8221;</p>\n<p>Toivo was rejected when submitted to WordPress.com, but Keijonen is known for his tenacity and continual experimentation with design and distribution approaches.</p>\n<p>&#8220;I have plans to fork the theme, create church and charity themes out of it, and sell it on Themeforest if they allow it,&#8221; he said.</p>\n<p>A year ago, Keijonen conducted an <a href="http://wptavern.com/the-mina-olen-free-wordpress-theme-experiment" target="_blank">experiment</a> wherein he made his commercial Mina Olen theme available for free on GitHub to see if it would affect its popularity and sales for support. The results were positive overall, and Keijonen now has more commercial products available on GitHub. To date, he has earned $5,304 from the WordPress.com version of Mina Olen and 2,142€ from sales of the self-hosted version.</p>\n<p>Getting Toivo approved on WordPress.org was the next step in his theme development journey and Keijonen reports that the experience was &#8220;fast as a shark&#8221; this time. Toivo has been downloaded more than 1,100 times in less than a week. Check out the <a href="https://foxland.fi/demo/toivo/" target="_blank">live demo</a> to see the theme in action. You can <a href="https://wordpress.org/themes/toivo-lite/" target="_blank">download</a> it for free from WordPress.org or get additional features and support with the <a href="https://foxland.fi/downloads/toivo/" target="_blank">commercial version</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 01 May 2015 03:31:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:70:"WPTavern: How Barış Ünver Lives and Works with Censorship in Turkey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=43060";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:77:"http://wptavern.com/how-baris-unver-lives-and-works-with-censorship-in-turkey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1235:"<p>Doc Pop of Torquemag.io has <a href="http://torquemag.io/a-wordpress-developer-on-censorship-in-turkey/">published a great article</a> featuring WordPress developer, Barış Ünver. Ünver is 27 years old and a <a href="http://tutsplus.com/authors/baris-unver">Tuts+ author</a> living in Ankara, the capital of Turkey. In the article, Ünver describes what it&#8217;s like to live and work in Turkey. When asked whether WordPress being blocked in Turkey is a regular occurrence, he responded:</p>\n<blockquote><p>It’s not extremely common, but we experience downtime on large websites like Facebook, YouTube, and Twitter a couple times each year. WordPress.com is actually one of the first websites that was <a href="http://ma.tt/2007/08/blocked-in-turkey/" target="_blank">blocked back in 2007</a>—you can read the story here.</p></blockquote>\n<p>There are other interesting tidbits within the article as well such as the number of people who know how to use VPN&#8217;s as if it&#8217;s common knowledge. Ünver also provides insight into the tools used to get around censorship. If the country you live in blocked access to WordPress.com or WordPress.org, what tools, services, and systems would you use to get around it?</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 30 Apr 2015 19:07:37 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:64:"WPTavern: WPWeekly Episode 190 – Women in WordPress Roundtable";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:44:"http://wptavern.com?p=43111&preview_id=43111";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:70:"http://wptavern.com/wpweekly-episode-190-women-in-wordpress-roundtable";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1837:"<p>This week&#8217;s episode of WordPress Weekly features <a href="http://www.web-savvy-marketing.com/">Rebbeca Gill</a>, <a href="http://www.bourncreative.com/">Jennifer Bourn</a>, and <a href="http://www.carriedils.com/">Carrie Dils</a> to casually discuss women in WordPress, women in tech, and a variety of other topics.</p>\n<p>The guests share their personal experiences of being involved in the WordPress community. We discuss how important it is to act responsibly, especially during WordCamp after parties which are business related events. Near the end of the discussion, the guests share tips and advice on how women can get more involved and meet influential members of the WordPress community.</p>\n<h2>Stories Discussed:</h2>\n<p><a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download">WordPress 4.2 “Powell” is Now Available for Download</a><br />\n<a href="http://wptavern.com/wordpress-4-2-1-released-to-patch-comment-exploit-vulnerability">WordPress 4.2.1 Released to Patch Comment Exploit Vulnerability</a><br />\n<a href="http://wptavern.com/managewp-launches-wordpress-events-hub">ManageWP Launches WordPress Events Hub</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, May 6th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href="https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738" target="_blank">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href="http://www.wptavern.com/feed/podcast" target="_blank">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href="http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr" target="_blank">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #190:</strong><br />\n</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 30 Apr 2015 18:41:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:110:"WPTavern: WordPress 4.3 to Focus on Mobile Experience, Admin UI, Better Passwords, and Customizer Improvements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=43084";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:117:"http://wptavern.com/wordpress-4-3-to-focus-on-mobile-experience-admin-ui-better-passwords-and-customizer-improvements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4866:"<p><a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/notes.jpg" rel="prettyphoto[43084]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/notes.jpg?resize=960%2C456" alt="notes" class="aligncenter size-full wp-image-43107" /></a></p>\n<p>WordPress 4.3 development <a href="https://make.wordpress.org/core/2015/04/28/wordpress-4-3-kickoff/" target="_blank">kicked off</a> this week with release lead <a href="https://make.wordpress.org/core/author/obenland/" target="_blank">Konstantin Obenland</a> at the helm. The main focus of this release will be to improve the experience of using WordPress on touch and small-screen devices. Contributors will also be renewing efforts to improve the Admin UI and the Network Admin UI, particularly as it relates to the experience on narrow screens and responsive list tables.</p>\n<h3>Customizer Design and Architectural Improvements</h3>\n<p>The customizer will also be getting some attention. Weston Ruter <a href="https://weston.ruter.net/2015/04/29/customizer-features-for-wordpress-4-3-kickoff/" target="_blank">published</a> a summary of the three areas he proposes tackling:</p>\n<ul>\n<li><strong>Customizer Partial Refresh:</strong> This <a href="https://wordpress.org/plugins/customize-partial-refresh/" target="_blank">feature plugin</a> aims to refresh parts of a Customizer preview instead of reloading the entire page when a setting changed without transport=postMessage.</li>\n<li><strong>Customizer Transactions:</strong> This proposal is dependent on the Partial Refresh and involves re-architecting the customizer to make way for the possibility of feature plugins like scheduled settings, setting revisions, and drafted/pending settings.</li>\n<li><strong>Customizer Concurrency/Locking:</strong> This <a href="https://core.trac.wordpress.org/ticket/31436" target="_blank">proposal</a> would add concurrency/locking support to prevent multiple users from overwriting each other&#8217;s changes while working in the customizer.</li>\n</ul>\n<p>Nick Halsey also has a few ideas he is proposing for iterating on customizer development that was completed in 4.2.</p>\n<p>&#8220;I would like to aim for adding theme install in 4.3, which would require a shiny install process, and shiny updates could work into that well too,&#8221; he said. Halsey is aiming to have a functional and tested proposal ready before the scheduled time to decide on which features to merge in to 4.3.</p>\n<p>He&#8217;s also hoping to renew work on <a href="https://core.trac.wordpress.org/ticket/31336" target="_blank">Customizer UI design changes</a>, which would separate navigation from the options UI by removing accordion behavior for a better experience. It will be interesting to see how these changes, if selected to merge into 4.3, affect theme developer&#8217;s <a href="http://wptavern.com/wordpress-org-now-requires-theme-authors-to-use-the-customizer-to-build-theme-options" target="_blank">adoption of the customizer</a>.</p>\n<h3>Better Passwords Coming to WordPress 4.3</h3>\n<p>Mark Jaquith will be spearheading an effort to improve password creation in WordPress 4.3 and discussion will take place in the <a href="https://wordpress.slack.com/archives/core-passwords" target="_blank">#core-passwords</a> channel on Slack. The first leg of his proposal would make “user chooses own password” non-default so that a user can choose his own password or opt to allow WordPress to generate one.</p>\n<p>Jaquith is also proposing that the <a href="http://wptavern.com/ridiculously-smart-password-meter-coming-to-wordpress-3-7" target="_blank">password strength meter</a>, added in WordPress 3.7, offer feedback on why a user&#8217;s selected password might be measured as weak.</p>\n<p>&#8220;Simple feedback like &#8216;too short — add more characters!&#8217;, &#8216;Try adding some numbers and symbols!&#8217;,&#8221; he suggested. &#8220;Not only that, we could actually make the addition for them, show them their password attempt with some additions that would make it better.&#8221;</p>\n<p>Also, Jaquith proposes adding an option to make the password entry visible, eliminating the need for entering it twice. The fourth and final leg of his password improvement proposal is a major and long-overdue step toward improving the security of WordPress.</p>\n<p>&#8220;Let’s not send passwords via e-mail anymore; it’s insecure,&#8221; he said &#8220;We’re not getting around &#8216;full access to e-mail means you can reset,&#8217; but we can stop passwords from sitting around in e-mail accounts forever.&#8221;</p>\n<p>Contributors are aiming to release WordPress 4.3 on Tuesday, August 18th. Follow the <a href="https://make.wordpress.org/core/version-4-3-project-schedule/" target="_blank">project schedule</a> for approximate dates for feature merge, betas, and release candidate(s).</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 30 Apr 2015 17:19:27 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:42:"Matt: Brunello Cucinelli, King of Cashmere";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44990";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"http://ma.tt/2015/04/brunello-cucinelli-king-of-cashmere/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:685:"<blockquote><p>I want to take a step backward. Who remembers the last email they sent yesterday? No one. Or the last text message. Emperor Hadrian used to say, <i>“</i>The daily business, the daily life, the daily chores, kills the human being.<i>“</i> I’m not interested in daily chores. We have now swapped information for knowledge, which is not the same thing. I do not want to know. I’m not online. I don’t even have a computer.</p></blockquote>\n<p>Om has an incredible <a href="http://pi.co/brunello-cucinelli-2/">interview with Brunello Cucinelli on Pi.co</a>, which I&#8217;d recommend for everyone but especially people interested in design or entrepreneurship.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 30 Apr 2015 06:55:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:81:"WPTavern: Data Shows 24% of Themes Hosted on WordPress.org Support the Customizer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=43064";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://wptavern.com/only-24-of-themes-hosted-on-wordpress-org-support-the-customizer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2914:"<p><a href="https://twitter.com/aaronjorbin">Aaron Jorbin</a>, who contributes to WordPress core on a regular basis, has published a script called <a href="https://github.com/aaronjorbin/WordPress-Theme-Directory-Slurper">WordPress Theme Directory Slurper</a>. The PHP based script downloads and updates a copy of the latest stable version of every theme in the <a href="http://wordpress.org/themes/">WordPress.org theme directory</a>. Devin Price put the script to good use and has <a href="http://wptheming.com/2015/04/theme-repository-data/">published a series of data points</a> related to the theme directory.</p>\n<p>It took Price 112 minutes to run the script and download nearly 4GB of theme code. In his report, Price answers the following questions:</p>\n<ul>\n<li>How many themes are based on Underscores?</li>\n<li>How many themes are on WordPress.org?</li>\n<li>How many themes have <em>lite</em> in their name?</li>\n<li>How many themes use the latest WordPress functions?</li>\n<li>How many themes add an options page?</li>\n<li>How many themes use a bundled options framework?</li>\n<li>How many themes use TGM Activation?</li>\n</ul>\n<h2>How Many Themes Support the Customizer?</h2>\n<p>Last week, <a href="http://wptavern.com/wordpress-org-now-requires-theme-authors-to-use-the-customizer-to-build-theme-options">we reported on a significant change</a> to the WordPress theme directory guidelines. Beginning on April 22nd, themes submitted to the WordPress.org theme directory will have to use the customizer to build theme options. Themes already hosted in the directory have six months to comply before the Theme Review Team will enforce the new requirement.</p>\n<p>By searching the directory for themes that use <code>$wp_customize-&gt;add_control</code>, Price was able to determine that <strong>761 themes</strong> or <strong>23.8%</strong> currently support the customizer. The low number coincides with Justin Tadlock&#8217;s assessment <a href="https://make.wordpress.org/themes/2015/04/22/details-on-the-new-theme-settings-customizer-guideline/">that adoption has been slow</a>, especially when you consider that it was added three years ago to <a href="https://codex.wordpress.org/Version_3.4">WordPress 3.4</a>.</p>\n<p>One thing to keep in mind is that after the six month cutoff date, themes not using the customizer will still be able to be downloaded from and hosted on the directory. However, the theme code can not be updated unless it follows the new guidelines.</p>\n<p>It will be interesting to see what the data looks like three months from now as it would indicate how many and how fast, themes are adopting the customizer. Price is taking requests for what data you&#8217;d like to see, but if you want to do the research yourself, Jorbin&#8217;s <a href="https://github.com/aaronjorbin/WordPress-Theme-Directory-Slurper">Theme Directory Slurper</a> is available for free on GitHub.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 29 Apr 2015 23:16:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:70:"WPTavern: Postmatic Launches 100% Email-Based Commenting for WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42986";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://wptavern.com/postmatic-launches-100-email-based-commenting-for-wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:6840:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/11/postmatic1.jpg" rel="prettyphoto[42986]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/11/postmatic1.jpg?resize=810%2C378" alt="postmatic" class="aligncenter size-full wp-image-33866" /></a></p>\n<p><a href="https://gopostmatic.com" target="_blank">Postmatic</a> publicly launched its email-based commenting service today and is now officially out of beta. The free <a href="https://wordpress.org/plugins/postmatic/" target="_blank">plugin</a> aims to increase comment engagement by allowing readers to subscribe to new posts/comments via email and leave comments by simply hitting reply.</p>\n<p>Postmatic also launched a <a href="https://gopostmatic.com/premium/" target="_blank">commercial service</a> alongside version 1.0. For $9/month customers can add additional features, including guaranteed mail delivery for thousands of subscribers, fully responsive HTML email for posts and comments, support for oEmbed and shortcodes, and the ability to moderate comments from your inbox.</p>\n<h3>The Challenges of Sending Bulk Email</h3>\n<p>Since Postmatic is critically dependent on email delivery, founder Jason Lemieux and his team didn&#8217;t want to hassle with attempting to send it themselves.</p>\n<p>&#8220;Sending bulk email is really difficult to do correctly so we’ve partnered with folks that have already solved it,&#8221; he said. &#8220;All posts, comments, and otherwise are sent through a combination of both <a href="http://www.mailgun.com/" target="_blank">Mailgun</a> (by Rackspace) and <a href="https://www.mandrill.com/" target="_blank">Mandrill</a> (by Mailchimp).</p>\n<p>&#8220;This takes all of the uncertainty out of the equation and makes sending WordPress content to lists of tens of thousands of subscribers as easy as pie. Users don’t need to sign up for accounts with these services, change their dns or anything &#8211; we handle it all for them.&#8221;</p>\n<p>Lemieux reports that Postmatic had 1,200 sites in its beta program, ~500 of which they considered highly active. The individual installations were the easy part of the beta. Supporting the subscribers, which are more numerous, was the greatest challenge the team encountered.</p>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/direct-reply.png" rel="prettyphoto[42986]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/direct-reply.png?resize=259%2C500" alt="direct-reply" class="alignright size-large wp-image-43052" /></a><strong>&#8220;During beta we delivered posts and comments to roughly 46,000 unique subscribers and processed nearly 15,000 incoming comments</strong>,&#8221; he said. &#8220;These numbers are pretty small so we’ve built a system that scales and are ready to open the doors to everyone.&#8221;</p>\n<p>Notifications sent from Postmatic are two-way transactions designed to invite further discussion in comments, so the team has to be able to adequately support the myriad of email clients that people are using.</p>\n<p>&#8220;Email is complicated and as old as it is, it still seems like the wild west in a lot of ways,&#8221; Lemieux said. &#8220;We have to make sure that the post being delivered to an old-timer using Pine on his home-built Linux box communicates ideas just as well as the same post when seen in Gmail or on an Apple watch. Then we have to accept comment replies from all of these sources as well, which it turns out you can do. With a watch. Leave a comment. Go figure.&#8221;</p>\n<h3>The Future of Postmatic</h3>\n<p>Postmatic is a micro-startup that is mostly self-funded. Approximately 10 months before starting, the team knew that they wanted to be ready to quit their jobs when the time came.</p>\n<p>&#8220;We were fortunate to be able to squirrel away much of the funding we needed while also building it in tandem with our usual client work,&#8221; Lemieux said. &#8220;When we entered beta last fall and saw the reaction people were having to commenting by email we chose to stop taking on new client work, bring in a small amount of private funding, and go at it full time.&#8221;</p>\n<p>Postmatic&#8217;s tiny four-person team is what made this possible. Two members are full-time and the other two are currently part-time.</p>\n<p>As part of their quest to seamlessly join email and commenting, the team deemed it important to launch with <a href="http://wptavern.com/postmatic-now-supports-1-click-migration-of-subscribers-from-jetpack" target="_blank">importers for Jetpack</a>, Mailpoet, and Mailchimp. This makes the transition easier for site administrators who are already hooked into more traditional comment subscription services. Postmatic also has a few more high priority items on the roadmap.</p>\n<p>&#8220;The first is to support sites with high publishing frequency by enabling digests,&#8221; Lemieux said. &#8220;We have some fantastic ideas about how to do this in the new world of email commenting that will be of huge benefit to publishers and readers both.</p>\n<p>&#8220;As we move into the world of professional publishing we’ll also need a diversity of templates. Rolling in a template library or template builder is the plan there. Both of those things are next on our list.&#8221;</p>\n<p>The team behind Postmatic is investing heavily in 100% email commenting because they believe that innovation in WordPress comments is long overdue.</p>\n<p>&#8220;Every comment system needs email to some degree,&#8221; Lemieux said. &#8220;Livefyre, Disqus, Jetpack &#8211; all send an email notification (if subscribed) that a new comment has been posted. But you still have to jump over to a blog to reply and post a comment. It&#8217;s not always possible to do so, nor is it easy on mobile &#8211; which has become so important.</p>\n<p>&#8220;Postmatic takes that out of the equation &#8211; notification leads to reply, leads to blog comment, in one seamless action. Why wouldn&#8217;t you want email commenting to work like that?&#8221;</p>\n<p>Email commenting and post notifications are available in the <a href="https://wordpress.org/plugins/postmatic/" target="_blank">free plugin</a>, but these features are just the beginning of how Postmatic is aiming to revolutionize WordPress commenting.</p>\n<p>&#8220;The debate about the usefulness of comments in WordPress rages on while email marketing and automation has become a very hot area,&#8221;  Lemieux said. &#8220;But really the WordPress comments system is an email automation platform just waiting to happen.&#8221;</p>\n<p>If you&#8217;re curious about what it&#8217;s like to participate in comments without ever leaving your inbox, Postmatic has a <a href="https://gopostmatic.com/2015/04/try-the-magic-right-now/" target="_blank">live demo</a> available where you can try it out.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 29 Apr 2015 16:33:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"WPTavern: WP REST API Version 2.0 Beta 1 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42955";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:59:"http://wptavern.com/wp-rest-api-version-2-0-beta-1-released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2217:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg" rel="prettyphoto[42955]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg?resize=1025%2C469" alt="wp-rest-api" class="aligncenter size-full wp-image-43000" /></a></p>\n<p>Contributors on the <a href="https://github.com/WP-API/WP-API" target="_blank">WP REST API</a> project have released <a href="https://github.com/WP-API/WP-API/releases/tag/2.0-beta1" target="_blank">version 2.0 beta 1</a>, named after Simpsons character <a href="https://www.youtube.com/watch?v=g9MTejMEUJU" target="_blank">Ralph Wiggum</a>. This release is not backwards compatible with version 1, but project lead Ryan McCue  <a href="https://make.wordpress.org/core/2015/04/29/wp-rest-api-version-2-0-beta-1/" target="_blank">assured developers</a> that it is a direct continuation and that the fundamentals of the API haven&#8217;t changed.</p>\n<p><a href="http://v2.wp-api.org" target="_blank">Documentation for version 2</a> is now in progress, starting with basic schema docs, and the site has a section that outlines the <a href="http://v2.wp-api.org/changes-beta-1.html" target="_blank">changes in 2.0 Beta 1</a> internals and externals. It also includes an <a href="http://v2.wp-api.org/changes-beta-1.html#migrating-endpoints-from-v1-to-v2" target="_blank">example</a> for migrating endpoints from version 1 code to version 2.</p>\n<p>Compatibility with future beta releases is not guaranteed and this release comes with a note of caution for testers:</p>\n<blockquote><p>While we believe the API is now stable enough for public testing, we may continue to break the API in the future as we improve it further. Only use the API in development, and do not use version 2 in production environments.</p></blockquote>\n<p>Version 2.0 beta 1 had 23 contributors and many generous companies donated employee time to the project. This is a major milestone for the WP REST API on its journey to being proposed for inclusion in WordPress core. Check out the project&#8217;s <a href="https://github.com/WP-API/WP-API/issues/571" target="_blank">core merge plan</a> to follow the progress and view steps as they are completed.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 29 Apr 2015 05:42:37 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:83:"WPTavern: WordPress Plugins Created by JP Bot May Not be Maintained After June 2015";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42901";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:93:"http://wptavern.com/wordpress-plugins-created-by-jp-bot-may-not-be-maintained-after-june-2015";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2225:"<p>In late 2014, we went <a href="http://wptavern.com/jp-bot-the-silent-bot-behind-the-jetpack-module-extraction-plugins">behind the scenes</a> with <a href="http://ahs.pw/" target="_blank">Anas Sulaiman</a> who goes by the WordPress.org username of <a href="https://profiles.wordpress.org/wpjp/">JP Bot.</a> Sulaiman is responsible for creating six WordPress plugins that are alternatives to popular Jetpack modules. We received a tip from a reader that the plugins will soon be retired. When browsing to any of the six plugins on WordPress.org, the following message is displayed:</p>\n<blockquote><p>Retiring on June 2015. JP plugins will not be maintained after the end of June 2015. Thanks for everyone who used these plugins. Special thanks for those who gave good ratings.</p></blockquote>\n<p>I asked Sulaiman why he&#8217;s retiring his plugins at the end of June. &#8220;As I said in the interview in 2014, I make sure my projects stay alive when I can no longer work on them. Now, I can hardly find the time to keep JP plugins up to date; hence, I posted that notice in the hope that someone from the community would step up and take the wheel,&#8221; he responded.</p>\n<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/jp-bot-plugins.jpg" rel="prettyphoto[42901]"><img class="aligncenter size-full wp-image-33603" src="http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/jp-bot-plugins.jpg?resize=700%2C222" alt="jp-bot-plugins" /></a>Sulaiman confirmed that someone has taken over his plugins but has not worked on them for over a month. He remains hopeful that the person is still motivated. &#8220;Anyways, if no one would seriously pick up JP plugins, I&#8217;m considering updating them every six months, or perhaps quarterly or so. After all, there are 4000+ users who are counting on them,&#8221; he said.</p>\n<p>I suggested that he add the <a href="http://wptavern.com/adopt-me-plugin-tag-is-now-in-use-on-wordpress-org">adopt-me tag</a> to his plugins to increase the chances an interested party will take them over. If you use any of the plugins developed by JP Bot, I highly encourage you to keep tabs on what happens after June 2015 as you might need to find an alternative.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 29 Apr 2015 03:31:19 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:48:"WPTavern: ManageWP Launches WordPress Events Hub";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42960";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:58:"http://wptavern.com/managewp-launches-wordpress-events-hub";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3382:"<p>There are a variety of WordPress events that take place around the world where users learn WordPress in person. Some are <a href="http://central.wordcamp.org/schedule/">WordCamps</a>, <a href="http://wordpress.meetup.com/">meetups</a>, and others are WordPress specific but don&#8217;t use the WordCamp branding. Until now, there has not been an easy way to see all WordPress events on one page. <a href="https://managewp.org/">ManageWP.org</a> has <a href="https://managewp.org/articles/9696/launching-wordpress-events-hub">launched</a> a WordPress <a href="https://managewp.org/events/">Events Hub</a> which displays WordCamps, meetups, and non-WordCamps on the same page using a map overlay.</p>\n<a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/EventsAcrossTheCountry.png" rel="prettyphoto[42960]"><img class="size-full wp-image-42974" src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/EventsAcrossTheCountry.png?resize=982%2C924" alt="Events Across the US" /></a>Events Across the US\n<p>Vladimir Prelovac, Founder and CEO of <a href="https://managewp.com/">ManageWP.com</a>, explains why he created the site:</p>\n<blockquote><p>I was travelling the US last year and wanted to see what WordPress events I could attend along the route and there was no elegant solution to this problem. WordCamp Central lists only WordCamps without a map showing their location. There are also numerous meetups as well as non-WordCamp conferences like LoopConf, CaboPress, ThemeConf that are not listed anywhere. So I decided to build it.</p></blockquote>\n<p>Only registered users to ManageWP.org are able to create new events. On the event creation screen, there are fields to add an event&#8217;s address, name, type, date, URL, Twitter account, and Twitter hashtag. You can also add speakers as well. I found creating a WordPress meetup a little confusing since I had to set a start and end date.</p>\n<a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/CreateNewEventScreen.png" rel="prettyphoto[42960]"><img class="size-full wp-image-42980" src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/CreateNewEventScreen.png?resize=994%2C838" alt="Event Creation Screen" /></a>Event Creation Screen\n<p>I think the event type should be the second field underneath the event&#8217;s name. I&#8217;d also like to see a set of fields or options added that are specific to the type of event being held. For example, if it&#8217;s a meetup, there&#8217;s no reason to have an end date. Instead, the end date should be replaced with an option to set a time.</p>\n<p>There should also be a way to configure repeating events, similar to how Meetup.com does it. This way, I don&#8217;t have to remember to edit the event&#8217;s details every month. Events are not moderated, allowing submissions to appear immediately on the map.</p>\n<p>As the number of WordPress events across the world increases, it&#8217;s nice to have a resource that unites them on one map. In future iterations, it would be cool if users could create an itinerary. The itinerary would be saved to the user&#8217;s account and would be sharable through a URL. This way, users could get together and plan a road trip together.</p>\n<p>Prelovac is keeping a close eye on the comments of this post, so after you check out the events hub, please leave your feedback in the comments.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 28 Apr 2015 19:33:43 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:103:"WPTavern: Redux and Kirki Frameworks Join Forces to Provide Better Support for the WordPress Customizer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42937";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:113:"http://wptavern.com/redux-and-kirki-frameworks-join-forces-to-provide-better-support-for-the-wordpress-customizer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4653:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/redux-kirki-frameworks.jpg" rel="prettyphoto[42937]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/redux-kirki-frameworks.jpg?resize=876%2C407" alt="redux-kirki-frameworks" class="aligncenter size-full wp-image-42981" /></a></p>\n<p>In light of the WordPress Theme Review team&#8217;s recent decision to <a href="http://wptavern.com/wordpress-org-now-requires-theme-authors-to-use-the-customizer-to-build-theme-options" target="_blank">enforce the use of the native customizer</a> for themes in the official directory, the folks behind the Redux and Kirki frameworks are joining forces to better support developers for the new requirement.</p>\n<p><a href="http://reduxframework.com/" target="_blank">Redux</a>, which is built on the WordPress Settings API, is one of the most widely used options frameworks for themes and plugins, with WordPress.org reporting 90,000+ active installs. It supports a multitude of field types, custom error handling, and custom field and validation types, but is not currently compatible with the Customizer API.</p>\n<p>That&#8217;s where <a href="http://kirki.org/" target="_blank">Kirki</a> is stepping in to offer a framework for <a href="http://wptavern.com/kirki-a-free-plugin-to-style-the-wordpress-customizer-and-add-advanced-controls" target="_blank">advanced controls using the customizer</a>. Kirki, created by <a href="http://aristeides.com/">Aristeides Stathopoulos</a>, makes it easy to style the customizer to be a more natural extension of your theme and add panels and sections with more than 20 different <a href="http://kirki.org/#field-types" target="_blank">field types</a>.</p>\n<p>Both open source frameworks and their developers will be <a href="http://redux.io/" target="_blank">working together</a> to offer &#8220;the most powerful WordPress frameworks under one roof.&#8221; They are currently working on making the data output the same as well as creating a converter API for Redux developers. The eventual goal is that Redux will cover both custom settings panels as well as the customizer, while Kirki will be focused purely on the customizer.</p>\n<p>Redux lead developer <a href="https://twitter.com/simplerain" target="_blank">Dovy Paukstys</a> was one of the most vocal opponents of the decision to make the customizer a requirement for WordPress.org theme options. His position is that it limits developers and cannot provide a complete replacement for the Settings API.</p>\n<p>&#8220;The announcement of April 22, 2015 regarding the requirements for WP.org theme submission bothered me,&#8221; Paukstys said. &#8220;I had a decision to make; work to make Redux work fully in the customizer, or reduce our community.</p>\n<p>&#8220;I then remembered the Kirki project and decided to ping Ari. We discussed the possibility of bringing Kirki into the Redux organization and progressing from there.&#8221; Kirki is joining Redux as part of the team, but it will be maintained as a separate framework.</p>\n<p>&#8220;Kirki will always be light, with a smaller footprint,&#8221; Paukstys said. &#8220;There are no plans to turn Kirki into the Swiss army knife that Redux is. However, Kirki will be modified slightly.&#8221;</p>\n<p>The Redux and Kirki teams plan to share concepts and development time in order to ensure that they can mirror the data output between the two frameworks.</p>\n<p>&#8220;I am also in the process of creating the Kirki API, which will allow Redux devs to take their current config and use it with Kirki, rather than Redux,&#8221; Paukstys said. This will enable developers who have built themes using Redux to easily port their theme options over to Kirki for compatibility with the customizer.</p>\n<p>Eventually, Redux will support both custom options panels using the Settings API and the customizer. In the meantime, Paukstys took the initiative to partner with Kirki to make sure Redux users won&#8217;t be hung out to dry with the new WordPress.org requirements.</p>\n<p>&#8220;Kirki is a great solution for Customizer only themes,&#8221; Paukstys said. &#8220;There&#8217;s room enough on our team for both frameworks. Both serve a unique audience.&#8221;</p>\n<p>As the WordPress Theme Review team seems firmly set on upholding its controversial decision regarding the customizer, Redux and other frameworks have no other choice but to fall in line.</p>\n<p>&#8220;This community is too divided,&#8221; Paukstys said. &#8220;We prefer working together, rather than working apart. We believe greater things will come in the future moving forward together, as a team.&#8221;</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 28 Apr 2015 17:51:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:13;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:24:"Matt: Who is Steve Jobs?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=45000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:39:"http://ma.tt/2015/04/who-is-steve-jobs/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3898:"<p><a href="http://www.amazon.com/dp/0385347405"><img class="alignright" src="http://i1.wp.com/ecx.images-amazon.com/images/I/51jePfRiSOL.jpg?resize=300%2C459" alt="" /></a>I checked out the new book <a href="http://www.amazon.com/dp/B00N6PCWY8/"><em>Becoming Steve Jobs</em> by Brent Schlender and Rick Tetzeli</a> because there had been some interesting excerpts published to the web, and apparently those closest to Steve didn&#8217;t like <a href="http://www.amazon.com/dp/B004W2UBYW/">the Walter Isaacson book</a>, with Jony Ive saying &#8220;My regard [for Isaacson’s book] couldn’t be any lower.&#8221;</p>\n<p>Along with about a million other people I bought and read the authorized biography, and didn&#8217;t think it portrayed Jobs in a way that made me think any less of him, but there must have been some things in there that someone who knew him closely felt were so off that as a group they decided to coordinate and speak with a new author to set the record straight, as Eddy Cue said of the new <em>Becoming</em> book, &#8220;Well done and first to get it right.&#8221; I will never know who Steve Jobs really was, but it is interesting to triangulate and learn from different takes, especially Isaacson&#8217;s biography that Jobs himself endorsed but might not have read and this new one promoted by his closest friends, colleagues, and family.</p>\n<p>As an independent third party who doesn&#8217;t know any of the characters involved personally, I must say that I felt like I got a much worse impression of Steve Jobs from <em>Becoming</em> than from the authorized biography. It was great to hear the direct voices and anecdotes of so many people close to him that haven&#8217;t spoken much publicly like his wife Laurene &#8212; he was a very private man and his friends respect that. But the parts where Schlender/Tetzeli try to balance things out by acknowledging some of the rougher parts of Steve&#8217;s public life, especially the recent ones around options backdating, anti-poaching agreements, book pricing, (all overblown in my opinion) or even when trying to show his negotiating acumen with suppliers, Disney, or music labels, they make Jobs look like an insensitive jerk, which seems to be the opposite of what everyone involved was intending.</p>\n<p>The direct quotes in the book could not be kinder, and it&#8217;s clear from both books that Jobs was incredibly warm, caring, and thoughtful to those closest to him, but <em>Becoming</em> tries so hard to emphasize that it makes the contrast of some of his public and private actions seem especially callous. The personal anecdotes from the author are the best part: one of the most interesting parts of the book is actually when Jobs calls Schlender to invite him for a walk, as one of the people he reached out to and wanted to speak to before he passed, and Schlender &#8212; not knowing the context &#8212; actually chastises him for cutting off his journalistic access and other trivia, and then blows off the meeting, to his lifelong regret.</p>\n<p>It&#8217;s tragic, and it&#8217;s very <em>human</em>, and that&#8217;s what makes for great stories. No one suggests that Steve Jobs was a saint, nor did he need to be. His legacy is already well-protected both in the incredible results while he was alive, and even more so in what the team he built has accomplished since his passing, both periods which actually amaze and inspire me. <em>Becoming Steve Jobs</em> tries harder and accomplishes less to honor the man. It is worth reading if, like me, you gobble up every book around the technology leaders of the past 40 years and want a different take on a familiar tune, but if you were only to read one book about Jobs, and get the most positive impression of the man and his genius, I&#8217;d recommend <a href="http://www.amazon.com/dp/B004W2UBYW/">Isaacson&#8217;s <em>Steve Jobs</em></a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 28 Apr 2015 16:44:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:14;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:87:"WPTavern: Poll: How Often Do You Read a WordPress Plugin’s Changelog Before Updating?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42906";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:92:"http://wptavern.com/poll-how-often-do-you-read-a-wordpress-plugins-changelog-before-updating";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:840:"<p>As <a href="http://wptavern.com/do-wordpress-org-themes-need-a-changelog">the debate</a> on whether or not <a href="https://wordpress.org/themes/">WordPress.org hosted themes</a> should have changelogs continues, one line of thought is that regular users don&#8217;t read them. As a long time user of WordPress, I always read a plugin&#8217;s changelog before updating.</p>\n<p>A <strong>good</strong> changelog tells me what bugs have been fixed, new features that have been added, and security issues that have been addressed. It also gives me a timeline of changes I can refer to for troubleshooting. Let us know how often you read a WordPress plugin&#8217;s changelog before updating by participating in the following poll.</p>\nNote: There is a poll embedded within this post, please visit the site to participate in this post''s poll.";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Apr 2015 20:16:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:15;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:73:"WPTavern: WordPress 4.2.1 Released to Patch Comment Exploit Vulnerability";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42873";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://wptavern.com/wordpress-4-2-1-released-to-patch-comment-exploit-vulnerability";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2486:"<a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2014/04/security-release.jpg" rel="prettyphoto[42873]"><img src="http://i2.wp.com/wptavern.com/wp-content/uploads/2014/04/security-release.jpg?resize=1024%2C505" alt="photo credit: Will Montague - cc" class="size-full wp-image-20655" /></a>photo credit: <a href="http://www.flickr.com/photos/willmontague/3813295674/">Will Montague</a> &#8211; <a href="http://creativecommons.org/licenses/by-nc/2.0/">cc</a>\n<p>This morning we reported on an <a href="http://wptavern.com/zero-day-xss-vulnerability-in-wordpress-4-2-currently-being-patched" target="_blank">XSS vulnerability in WordPress 4.2</a>, 4.1.2, 4.1.1, and 3.9.3, which allows an attacker to compromise a site via its comments. The security team quickly patched the vulnerability and <a href="https://wordpress.org/news/2015/04/wordpress-4-2-1/" target="_blank">released 4.2.1</a> within hours of being notified.</p>\n<p>WordPress&#8217; official statement on the security issue:</p>\n<blockquote><p>The WordPress team was made aware of a XSS issue a few hours ago that we will release an update for shortly. It is a core issue, but the number of sites vulnerable is much smaller than you may think because the vast majority of WordPress-powered sites run Akismet, which blocks this attack. When the fix is tested and ready in the coming hours WordPress users will receive an auto-update and should be safe and protected even if they don’t use Akismet.</p></blockquote>\n<p>That auto-update is now being rolled out to sites where updates have not been disabled. If you are unsure of whether or not your site can perform automatic background updates, Gary Pendergast linked to the <a href="https://wordpress.org/plugins/background-update-tester/" target="_blank">Background Update Tester</a> plugin in the security release. This is a core-supported plugin that will check your site for background update compatibility and explain any issues.</p>\n<p>Since <a href="https://wordpress.org/plugins/akismet/" target="_blank">Akismet</a> is active on more than a million websites, the number of affected users that were not protected is much smaller than it might have been otherwise.</p>\n<p>WordPress 4.2.1 is a critical security release for a widely publicized vulnerability that you do not want to ignore. Users are advised to update immediately. The background update may already have hit your site. If not, you can update manually by navigating to Dashboard → Updates.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Apr 2015 19:46:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:16;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:30:"Matt: Cell Phones &amp; Cancer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44995";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:40:"http://ma.tt/2015/04/cell-phones-cancer/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:833:"<blockquote><p>The ability of radiation to cause cancer is dependent on whether or not the radiation is able to alter chemical bonds. This occurs when electrons involved in bonding in a molecule absorb radiation with enough energy to allow them to escape – this is called <a href="http://en.wikipedia.org/wiki/Ionization" target="_blank">ionization</a>. The thing is, whether or not radiation is ionizing is based solely on its energy, not on its number, and as we saw above, its energy is determined entirely from its frequency.</p></blockquote>\n<p>Cool article on WordPress.com about <a href="http://mitchkirby.com/2015/04/22/why-cell-phones-cant-cause-cancer-but-bananas-can/">Why Cell Phones Can’t Cause Cancer, But Bananas Can</a>, which I read while eating (and finishing) a banana. It covers dielectric heating too.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Apr 2015 16:29:43 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:17;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"WPTavern: Do WordPress.org Themes Need a Changelog?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42838";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:60:"http://wptavern.com/do-wordpress-org-themes-need-a-changelog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3692:"<a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/changelog.jpg" rel="prettyphoto[42838]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/changelog.jpg?resize=1024%2C525" alt="photo credit: time - (license)" class="size-full wp-image-42884" /></a>photo credit: <a href="http://www.flickr.com/photos/68419214@N04/6897782843">time</a> &#8211; <a href="https://creativecommons.org/licenses/by-sa/2.0/">(license)</a>\n<p>Over the weekend, Theme Review Team member Jose Castaneda posted a <a href="https://make.wordpress.org/themes/2015/04/26/changelog-proposal/" target="_blank">proposal to add change logs</a> to themes hosted on WordPress.org. The discussion has been on the table for years, but renewed interest in change logs is surfacing for the upcoming 4.3 and 4.4 release cycles.</p>\n<p>Adding changelogs to themes requires action on two related tickets: a <a href="https://meta.trac.wordpress.org/ticket/45" target="_blank">meta ticket</a> to add support for change logs on WordPress.org and a <a href="https://core.trac.wordpress.org/ticket/22810" target="_blank">core ticket</a> to expose the changelog file to users in the WordPress admin.</p>\n<p>Castaneda&#8217;s proposal requests that the team select a standard format for theme authors to follow in either the readme.txt file or a new changelog.txt file. From there the team would follow the core development release cycle to complete whatever steps necessary to get changelog support added to WordPress.org themes.</p>\n<p>Theme Review Team members are divided on whether or not change logs are beneficial to users, as they already have the ability to detect changes using a .diff file when authors submit updates. Others find change logs to be a more readable addition.</p>\n<p>&#8220;Personally, I find change logs to be incredibly helpful, even when using a .diff,&#8221; Theme Review Team admin Chip Bennett said. &#8220;The changelog is the human-readable summary of changes, that can really help grok the diff changes.&#8221;</p>\n<p>Justin Tadlock isn&#8217;t convinced that WordPress users would benefit from themes including change logs:</p>\n<blockquote><p>Honestly, I don’t see change logs as all that important from a user standpoint. While I don’t have any official stats, I’d wager that the vast majority of users don’t read change logs and, of those who do happen upon one, don’t understand most of what’s actually in the file.</p>\n<p>Change logs are, by and large, a developer tool. It’s a nice-to-have feature. I don’t care one way or another. I never read them. I doubt we&#8217;ll get great change logs from the majority of theme authors. We can’t even manage to get some semantic versioning down or basic inline PHP docs. We’ll probably see a lot of Git commit logs copied/pasted or my personal favorite, “Changed a bunch of stuff. Too busy building awesome s*** to care about tracking changes”.</p></blockquote>\n<p>Active discussion on the topic is taking place on the <a href="https://make.wordpress.org/themes/2015/04/26/changelog-proposal/" target="_blank">make.wordpress.org/themes</a> blog. If the team concludes that change logs are beneficial, the main question to answer is whether or not they should simply take up residence in the readme.txt file, like plugins do, or have their own separate file.</p>\n<p>Ultimately, the issue boils down to whether or not WordPress users read and appreciate changelogs, or if they are more beneficial for developers. As the Theme Review Team is primarily made up of developers, it would be valuable if average users who desire theme change logs could chime in on situations where the file might be helpful.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Apr 2015 15:36:01 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:18;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:77:"WPTavern: Zero Day XSS Vulnerability in WordPress 4.2 Currently Being Patched";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42843";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:87:"http://wptavern.com/zero-day-xss-vulnerability-in-wordpress-4-2-currently-being-patched";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2686:"<p>Klikki Oy is <a href="http://klikki.fi/adv/wordpress2.html" target="_blank">reporting</a> a new comment XSS exploit vulnerability in WordPress 4.2, 4.1.2, 4.1.1, and 3.9.3, which allows an unauthenticated attacker to inject JavaScript into comments.</p>\n<blockquote><p>If triggered by a logged-in administrator, under default settings the attacker can leverage the vulnerability to execute arbitrary code on the server via the plugin and theme editors.</p>\n<p>Alternatively the attacker could change the administrator’s password, create new administrator accounts, or do whatever else the currently logged-in administrator can do on the target system.</p></blockquote>\n<p>This particular vulnerability is similar to one <a href="https://cedricvb.be/post/wordpress-stored-xss-vulnerability-4-1-2/" target="_blank">reported by Cedric Van Bockhaven in 2014</a>, which was patched in the most recent <a href="http://wptavern.com/wordpress-4-1-2-is-a-critical-security-release-immediate-update-recommended" target="_blank">WordPress 4.1.2 security release</a>. That particular vulnerability was related to four-byte characters being inserted into comments, causing premature truncation by MySQL.</p>\n<p>In this instance, an attacker posts an excessively long comment in order to trigger the MySQL TEXT type size limit, which truncates the comment as it is inserted into the database.</p>\n<blockquote><p>The truncation results in malformed HTML generated on the page. The attacker can supply any attributes in the allowed HTML tags, in the same way as with the two recently published stored XSS vulnerabilities affecting the WordPress core.</p>\n<p>In these two cases, the injected JavaScript apparently can&#8217;t be triggered in the administrative Dashboard so these exploits seem to require getting around comment moderation e.g. by posting one harmless comment first.</p></blockquote>\n<p>A patch from the WordPress security team should be forthcoming. At this time the team could not provide an ETA, but in the meantime there are a few things users can do to mitigate the risk.</p>\n<p>&#8220;Your best option is to install Akismet (which has already been configured to block this attack), or disable comments,&#8221; core contributor Gary Pendergast said in response to <a href="https://wordpress.slack.com/archives/core/p1430134328007948" target="_blank">inquiries on the WordPress #core Slack channel</a>. &#8220;JavaScript is blocked by wp_kses(). Akismet blocks this specific attack, which gets around wp_kses()’s protection.&#8221;</p>\n<p>WordPress users can also temporarily disable comments in the meantime until the patch has been issued by the WordPress security team.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 27 Apr 2015 12:10:22 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:19;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:18:"Matt: Entanglement";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44985";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:34:"http://ma.tt/2015/04/entanglement/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:243:"<p>If you&#8217;re curious about quantum entanglement (and a type of synesthesia) at all, check out <a href="http://www.npr.org/programs/invisibilia/382451600/entanglement">this week&#8217;s Invisibilia show on NPR called Entanglement</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 26 Apr 2015 15:19:44 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:20;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:15:"Matt: 100 Books";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44983";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:31:"http://ma.tt/2015/04/100-books/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:413:"<p>You can&#8217;t go wrong with Amazon&#8217;s <a href="http://www.amazon.com/b?ie=UTF8&node=8192263011">100 Books To Read In A Lifetime</a>. I&#8217;ve only read a bit over a dozen of them, and some of those in school when I probably didn&#8217;t appreciate them. I&#8217;ve never had a time in my life when I thought, &#8220;You know, I&#8217;m reading too much.&#8221; It&#8217;s a weekend &#8212; read!</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 25 Apr 2015 23:38:17 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:21;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"Matt: Atlantic Earth Day Pictures";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44980";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:49:"http://ma.tt/2015/04/atlantic-earth-day-pictures/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:185:"<p>The Atlantic <a href="http://www.theatlantic.com/photo/2015/04/earth-day-45/390864/">has a set of 45 pictures that are both beautiful and shocking</a> to commemorate Earth Day.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 25 Apr 2015 04:41:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:22;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:79:"WPTavern: Automattic’s Dave Martin Publishes His 5 Step Remote Hiring Process";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42810";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:86:"http://wptavern.com/automattics-dave-martin-publishes-his-5-step-remote-hiring-process";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3389:"<a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/automattic-offices.jpg" rel="prettyphoto[42810]"><img class="wp-image-22370 size-full" src="http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/automattic-offices.jpg?resize=1025%2C478" alt="photo credit: Peter Slutsky" /></a>photo credit: <a href="http://peterslutsky.com/2013/05/14/pics-touring-automattics-new-office/">Peter Slutsky</a>\n<p>If you&#8217;re thinking about applying to work for <a href="http://automattic.com/">Automattic</a>, you might want to <a href="http://davemart.in/2015/04/22/inside-automattics-remote-hiring-process/">read this article first</a>. Dave Martin, Creative Director at Automattic, published an in-depth look behind the scenes of the remote hiring process for the design and growth portion of the company. He explains the five step process in detail which gives future applicants a good idea of what to expect.</p>\n<p>It&#8217;s a fascinating read and I learned that every part of the process has a purpose. For instance, every trial project consists of work that would normally be completed by existing exmployees. Every question asked by Martin in the interview process has a purpose, whether it&#8217;s to glean information or get a feel for how the applicant communicates.</p>\n<p>The one area of the hiring process I&#8217;ve routinely seen scrutinized by those who don&#8217;t make the cut is the lack of specific feedback on why they&#8217;re not a good fit for a position. Dave Clements, who <a href="https://www.davidclements.me/2014/04/01/experience-trial-automattic/">almost made it to the final stage</a> of the hiring process, criticized the lack of detail from Automattic on why he wasn&#8217;t a good fit.</p>\n<blockquote><p>My only criticism of my whole process from start to finish is that I wish they would have gone into more detail into on why I was not a good fit for them. They had been so verbose and open up to that point about any question that I asked of them, but when I asked why they had come to the decision to not move forward, I was given a fairly generic response as they &#8216;couldn’t go into too much detail&#8217;.</p></blockquote>\n<p>Martin tries to do his best to highlight why someone is not a good fit, but the process is not easy and the number one goal is to hire the best people.</p>\n<blockquote><p>If things don’t end up working out, I’ll do my best to highlight why. At this point the applicant has invested quite a bit of time. I try to be as specific as possible as to why they are not going to proceed to a final interview.</p>\n<p>Telling people no is hard, but mistakenly bringing on the wrong people can be much worse. While you want to always be kind, and helpful to all applicants, your primary responsibility when hiring is to ensure that only the best people get hired. That is priority number one.</p></blockquote>\n<p>Whether you&#8217;re a distributed company or someone who&#8217;s interested in working for one, there is plenty to learn from the post. I also encourage you to read this <a href="https://hbr.org/2014/04/the-ceo-of-automattic-on-holding-auditions-to-build-a-strong-team">Harvard Business Review article</a> from 2014 featuring Matt Mullenweg, on holding auditions to build a strong team. If you&#8217;ve gone through the Automattic hiring process, let us know what it&#8217;s like in the comments.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 23:12:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:23;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"WPTavern: Story.am Relaunches, Now 100% Free";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42704";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:52:"http://wptavern.com/story-am-relaunches-now-100-free";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4448:"<p><a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/story-am.jpg" rel="prettyphoto[42704]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/story-am.jpg?resize=774%2C337" alt="story-am" class="aligncenter size-full wp-image-42815" /></a></p>\n<p>Nick Haskins launched <a href="https://story.am/" target="_blank">Story.am</a> earlier this year as a hosted storytelling platform that offers all the features of <a href="http://wptavern.com/?s=Aesop+Story+Engine" target="_blank">Aesop Story Engine</a>. Initially, the platform was only available to paying customers, but this week Haskins announced that Story.am is <a href="https://story.am/story-am-re-launch/" target="_blank">now available to everyone for free</a>.</p>\n<p>The platform had not received much feedback in the several months it has been open to customers, so Haskins decided to remove all barriers to account creation.</p>\n<p>&#8220;We really want feedback on <a href="https://lasso.is/" target="_blank">Lasso</a>, our visual web editor on Story.AM,&#8221; he said. &#8220;By making it free, we hope to garner a lot of feedback, even if that feedback isn&#8217;t good. Often times, that type of feedback is the best.&#8221;</p>\n<p>In our <a href="http://wptavern.com/introducing-lasso-a-new-frontend-editor-for-wordpress" target="_blank">recent review of Lasso</a>, Jeff Chandler found that the product wasn&#8217;t quite polished enough for prime time but that it has potential. Haskins is hoping to build a broader network of Lasso users who will offer the feedback he needs to improve the editing experience.</p>\n<p>Immediately following his announcement that Story.am accounts are now available for free, Haskins was averaging one signup a minute.</p>\n<blockquote class="twitter-tweet" width="550"><p>Newsletter out, story.am now averaging one signup a minute for the last few minutes. &#10;&#10;The power of free.</p>\n<p>&mdash; Nick Haskins (@nphaskins) <a href="https://twitter.com/nphaskins/status/591359988309708800">April 23, 2015</a></p></blockquote>\n<p></p>\n<p>&#8220;Since the announcement yesterday evening there have been about 130 signups, so we&#8217;ve calmed down to about 5-7 signups an hour,&#8221; he said.</p>\n<p>Story.am is a multisite installation that was built to be elastic and ready to scale. In the future, Haskins will open up a Pro level that will offer additional features such as the ability to sell story subscriptions with Stripe and use your own domain.</p>\n<p>&#8220;The domain mapping and ability to sell story subscriptions are all in place and ready to go,&#8221; he said. &#8220;But rather than just releasing a Pro level straight away, I&#8217;m interested to see if what I THINK users want, is actually inline with what they REALLY want.&#8221;</p>\n<p>Haskins is taking notes of trends while monitoring the signups to get a better picture of how people plan to use Story.am.</p>\n<p>&#8220;I&#8217;m seeing a lot of what I would describe as &#8216;people who aren&#8217;t necessarily writers but want to tell stories,''&#8221; he said. &#8220;The domains that are coming across include terms like comic, pastor, fish, school, etc. It&#8217;s quite interesting to see. We are tracking everything in great detail, so as time goes on we&#8217;ll begin to have some solid metrics.&#8221;</p>\n<p>Many Story.am users are using the platform in the education space, a trend which has continued since opening up the site to free accounts. The platform is also open to bloggers, but Haskins is not aiming to compete with WordPress.com.</p>\n<p>&#8220;I&#8217;d like to see folks use stories in their own unique ways, with their own flair, and I think this will be tough to come by on a &#8216;generalized&#8217; network. i.e, one that basically treats everyone as the same,&#8221; he said. &#8220;One thing I don&#8217;t want to purposefully do is compete with WordPress.com. I&#8217;d much rather work with them to bring our ideas and tools to their platform, in some way, shape, or form.&#8221;</p>\n<p>Story.am has no current ETA for launching Pro level features, but Haskins said that he will be gauging the demand and gathering feedback before moving on monetizing the platform. If you&#8217;re curious about how Aesop Story Engine components work with WordPress and want to try the new Lasso frontend editor, it&#8217;s now as easy as signing up for a free account on <a href="https://story.am/">Story.am</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 22:18:11 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:24;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:75:"WPTavern: New Plugin Adds Quick Access to the “Press This” Posting Form";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42776";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://wptavern.com/new-plugin-adds-quick-access-to-the-press-this-posting-form";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:5312:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new.png" rel="prettyphoto[42776]"><img class="aligncenter size-full wp-image-42649" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new.png?resize=986%2C531" alt="press-this-new" /></a></p>\n<p>One of the highlights of the recent <a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download" target="_blank">WordPress 4.2</a> release is the <a href="http://wptavern.com/pressthis-revamped-with-a-new-user-interface-and-minimalist-design" target="_blank">completely revamped Press This interface</a>. The feature&#8217;s intended purpose is to make it easy to share text, images, and videos from around the web in a quick post, but many users are newly captivated by Press This&#8217; new minimalist design for post creation.</p>\n<p>Once you try Press This for publishing, you may become some so partial to the posting form that you don&#8217;t want to go back to the standard post editor. It includes only the most essential formatting buttons and a button to add media, with all other extraneous selections for post formats, categories, and tags collapsed.</p>\n<p><a href="https://wordpress.org/plugins/press-this-new-post/" target="_blank">Press This New Post</a> is a new plugin, created by <a href="https://profiles.wordpress.org/drewapicture/" target="_blank">Drew Jaynes</a>, that gives you quick access to the Press This posting form from the &#8216;+ New&#8217; drop-down in the toolbar.</p>\n<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new-post.jpg" rel="prettyphoto[42776]"><img class="aligncenter size-full wp-image-42787" src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new-post.jpg?resize=888%2C405" alt="press-this-new-post" /></a></p>\n<p>The link takes you to the Press This editor where you can scan a URL or simply start writing a new post.</p>\n<p>In the plugin&#8217;s description, Jaynes refers to the easy access as &#8220;Quick Draft on steroids,&#8221; but it may also become a real substitute for WordPress&#8217; dearly-departed <a href="http://wptavern.com/wordpress-zen-mode-5-compelling-reasons-to-turn-on-distraction-free-writing" target="_blank">zen mode</a>. Many users are distracted by the sliding side menu and the fading of non-essential parts of the editor that was introduced in WordPress 4.1 when the <a href="http://wptavern.com/focus-project-and-session-ui-approved-for-merge-into-wordpress-4-1" target="_blank">Focus Project was merged into core</a>. These animations are guaranteed not to happen to you in Press This mode.</p>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/pop-tarts.jpg" rel="prettyphoto[42776]"><img class="aligncenter size-full wp-image-42794" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/pop-tarts.jpg?resize=974%2C534" alt="pop-tarts" /></a></p>\n<p>Jaynes is a regular user of the Press This post editor, which was one of his motivations for creating the quick access plugin.</p>\n<p>&#8220;I&#8217;ve already drafted three blog posts using it instead of the standard editor,&#8221; he said. &#8220;Obviously in most cases I finish up in the standard editor, but I really like the posting interface.</p>\n<p>&#8220;I think if we get to the point where Press This supports other post types and/or even other sites in a multisite network, it could really save a lot of time.&#8221;</p>\n<p>The Press This team is actively working on continuing to iterate the feature along those lines and both <a href="https://twitter.com/michaelarestad" target="_blank">Michael Arestad</a> and <a href="https://twitter.com/stephdau" target="_blank">Stephane Daury</a> have stepped up as core component maintainers.</p>\n<p>&#8220;I know for a fact that they both have future plans for improving and iterating it,&#8221; Jaynes said. &#8220;It’s actually really cool to see a continuation of the passion beyond a feature plugin getting merged.&#8221;</p>\n<p>Michael Arestad recently posted his thoughts on <a href="http://blog.michaelarestad.com/2015/04/23/pressed-it/" target="_blank">the future of Press This</a> and listed a host of features that the team is looking at adding:</p>\n<ul>\n<li>Split button (gonna be awesome)</li>\n<li>Some rearranging of components</li>\n<li>Improved tags UI</li>\n<li>Featured image</li>\n<li>Browser extensions</li>\n<li>Site switching</li>\n<li>Image flow improvements are in the works, which should drastically improve the media experience in both editors</li>\n<li>Improved NUX flow</li>\n</ul>\n<p>With its committed maintainers, the Press This feature is well-positioned to evolve to support more diverse content types, which may attract even more users than the bookmarklet does in the long run. If you&#8217;re still thinking of Press This as just a simple bookmarklet for re-posting content, you may want to revisit it. The feature has the potential to influence future iterations of the standard post editor, which suddenly seems a little cluttered.</p>\n<p>If you enjoy using Press This mode for creating new posts, the <a href="https://wordpress.org/plugins/press-this-new-post/" target="_blank">Press This New Post</a> plugin might be a handy addition to your site. Download it for free on WordPress.org.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 20:06:43 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:25;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:73:"WPTavern: Insight into the Jamaican WordPress Community with Bianca Welds";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42752";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://wptavern.com/insight-into-the-jamaican-wordpress-community-with-bianca-welds";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:6221:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/bianca_edi1.jpg" rel="prettyphoto[42752]"><img class="alignright size-medium wp-image-42760" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/bianca_edi1.jpg?resize=300%2C226" alt="bianca_edi1" /></a>Last week, I met <a href="http://biancawelds.com/">Bianca Welds</a> who lives in Jamaica. She&#8217;s used WordPress for more than 10 years and has knowledge of the developing tech scene in Jamaica. In this interview, we learn how she discovered WordPress, the Jamaican WordPress community, and if the country will ever host a WordCamp.</p>\n<p><strong>How long have you used WordPress?</strong></p>\n<p>I just celebrated my 10th anniversary. I started using WordPress in 2005 and my first post was on April 2nd, 2005.</p>\n<p><strong>What is your WordPress origin story?</strong></p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/WPProfileOriginStory.png" rel="prettyphoto[42752]"><img class="size-full wp-image-42763" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/WPProfileOriginStory.png?resize=736%2C227" alt="As seen on the WordPress profile page" /></a>As seen on the WordPress profile page\n<p>I was working at IBM at the time and finally decided I liked the idea of having my own <a href="http://biancawelds.com/">personal website</a>. The more I thought about it, the more I realized I wanted to have a blog as well as a static site. I knew I could build an HTML site myself, so I researched this blogging thing, and I found <a href="https://www.blogger.com/home">Blogspot</a>. Within a day of signing up, I became frustrated at not being able to customize it, so I looked for alternatives. I came across WordPress and fell in love, purchased a hosting account, installed it, and never looked back.</p>\n<p><strong>What is the tech scene like in Jamaica?</strong></p>\n<p>The tech scene is currently developing nicely. There has been a lot of slow foundation growth over the last decade, but in the last few years, we have seen some dramatic acceleration. The tech meetup, <a href="http://kingstonbeta.com/">Kingston Beta</a>, grew to hosting a regional conference called <a href="http://connectimass.com/media-2/community-events/connect-events-networks/caribbean-beta/">Caribbean Beta</a>.</p>\n<p>The Slash Roots Developer Community saw the formation of the <a href="http://slashroots.org/">Slash Roots Foundation</a> which does a lot of work in the Open Data space. It expanded to organize the <a href="http://developingcaribbean.org/">Developing the Caribbean</a> conference, and was instrumental in the formation of <a href="http://codeforthecaribbean.org/">Code for the Caribbean</a>.</p>\n<p>Startup events have been growing with our first Startup Weekend taking place in 2013. The Digital Jam Mobile Application competition was held for three years along with several other initiatives. The first <a href="http://venturecapitaljamaica.com/conference/about">Venture Capital Conference</a> was held in 2013 where the first formal angel investor group, <a href="http://www.firstangelsja.com/">First Angels</a>, was created. <a href="http://www.start-upjamaica.com/en/p/list/57094">StartUpJamaica</a> is our first accelerator and it launched last year with over 200 applications, where 36 teams participated in boot camps and training. This is a small sample of the things that are happening in our space.</p>\n<p><strong>Is there a vibrant WordPress community in Jamaica?</strong></p>\n<p>Vibrant on an individual level perhaps. There is no active WordPress community at present. There are a lot of WordPress sites being built and a lot of WordPress blogs being run, but they are more or less individual efforts with no real communication or collaboration to grow and develop a community.</p>\n<p>I have recently started putting out feelers to see if there is enough interest in starting a regular WordPress meetup. In the last week, I&#8217;ve had interest from about two dozen people.</p>\n<p><strong>To date, there has not been a WordCamp in Jamaica. Do you think there will ever be one and will you help organize it?</strong></p>\n<p>I hope there will be and I definitely want to be a part of it. The first goal though would be to get the meetups going and gather a core community, so that&#8217;s my focus now.</p>\n<p><strong>Have you ever attended a WordCamp? If not, which one will be your first?</strong></p>\n<p>Unfortunately, I have never attended any WordCamps. I am working on changing that in the near future by going to <a href="http://miami.wordcamp.org/2015/">WordCamp Miami</a> which is the nearest one to Jamaica.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/WCMiamiFeaturedImage.png" rel="prettyphoto[42752]"><img class="wp-image-22707 size-full" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/WCMiamiFeaturedImage.png?resize=650%2C200" alt="WordCamp Miami Featured Image" /></a>WordCamp Miami Swag\n<p><strong>What do you like most about WordPress and what do you like the least?</strong></p>\n<p>My favorite thing about WordPress is its flexibility. While it may not be the perfect solution for every challenge, there are few things that cannot be done. My least favorite thing is how much there is to learn to truly take full advantage of its power.</p>\n<p><strong>If you wanted people to know something about Jamaica, what would it be?</strong></p>\n<p>The one thing I always try to share when I am <strong>the Jamaican</strong> in the crowd is that, Jamaica is so much more than beaches, weed and reggae. It definitely has those, but there are so many other aspects to our geography, our culture and our people who outsiders don&#8217;t yet fully grasp. But the world is learning.</p>\n<h2>Take the Jamaican WordPress Survey</h2>\n<p>Welds is trying to figure out the size and composition of the Jamaican WordPress community. Please help her out, especially if you&#8217;re a WordPress user living in Jamaica, by taking this <a href="http://lattitudestudios.com/wordpress-jamaica-survey/">short survey</a>. Information will remain confidential and will help Welds develop a better picture of the size and skill level of her local community.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 17:02:21 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:26;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:104:"WPTavern: WPWeekly Episode 189 – Drew Jaynes on What it’s Like to Lead a WordPress Development Cycle";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:44:"http://wptavern.com?p=42751&preview_id=42751";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:107:"http://wptavern.com/wpweekly-episode-189-drew-jaynes-on-what-its-like-to-lead-a-wordpress-development-cycle";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3186:"<p>On this episode of WordPress Weekly, <a href="http://marcuscouch.com/">Marcus Couch</a> and I were joined by <a href="http://werdswords.com/">Drew Jaynes</a>, web engineer for <a href="http://10up.com/">10up,</a> and <a href="http://wptavern.com/drew-jaynes-to-lead-wordpress-4-2">release lead for WordPress 4.2</a>. Jaynes explains how a release lead is chosen, their responsibilities, and what their role is. Release leads are shepherds who work with multiple teams to keep development on track.</p>\n<p>Jaynes also explained how people can contribute to WordPress core through <a href="https://core.trac.wordpress.org/">Trac</a>. We discussed new features in WordPress 4.2 and what the benefits are to <a href="http://wptavern.com/wordpress-core-team-announces-release-leads-for-wordpress-4-3-and-4-4">selecting release leads ahead of time</a>. Last but not least, Jaynes helped us cover the week&#8217;s news.</p>\n<h2>Stories Discussed:</h2>\n<p><a href="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins">XSS Vulnerability Affects More Than a Dozen Popular WordPress Plugins</a><br />\n<a href="http://wptavern.com/xss-vulnerability-what-to-do-if-you-buy-or-sell-items-on-themeforest-and-codecanyon">XSS Vulnerability: What to do if You Buy or Sell Items on Themeforest and CodeCanyon</a><br />\n<a href="http://wptavern.com/wordpress-4-1-2-is-a-critical-security-release-immediate-update-recommended">WordPress 4.1.2 is a Critical Security Release, Immediate Update Recommended</a><br />\n<a href="http://wptavern.com/facebook-has-abandoned-its-official-wordpress-plugin">Facebook Has Abandoned Its Official WordPress Plugin</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href="https://wordpress.org/plugins/cosmick-star-rating/">Comstick Star Rating</a> conforms to the Google structured data algorithm. It allows you to capture customer reviews with a simple shortcode on any page. By inserting a single function into your theme&#8217;s header or footer, your rating will be displayed in Google search.</p>\n<p><a href="https://wordpress.org/plugins/employee-spotlight/">Employee Spotlight</a> displays employees, team members, founders, or just a single person in a four column circle grid. It comes with two sidebar widgets that display featured and recent employees selected in the editor.</p>\n<p><a href="https://wordpress.org/plugins/web-push-notifications/">Web Push Notifications</a> allows you to send push notifications to visitors who use Safari and Chrome.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, April 29th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href="https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738" target="_blank">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href="http://www.wptavern.com/feed/podcast" target="_blank">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href="http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr" target="_blank">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #189:</strong><br />\n</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 06:30:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:27;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:65:"WPTavern: Why Some Sites Automatically Updated to WordPress 4.1.3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42743";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:75:"http://wptavern.com/why-some-sites-automatically-updated-to-wordpress-4-1-3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1948:"<p>Since <a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download">WordPress 4.2 was released</a>, some users are <a href="https://twitter.com/clindsey/status/591436003853750272">questioning</a> why their sites have automatically updated to WordPress 4.1.3. There&#8217;s no information about the release on the <a href="https://core.trac.wordpress.org/ticket/32051">Make WordPress Core</a> site or the official <a href="https://wordpress.org/news/">WordPress news blog</a>. However, <a href="http://codex.wordpress.org/Version_4.1.3">this Codex article</a> explains what&#8217;s in 4.1.3 and the reason it was released.</p>\n<blockquote><p>Fix database writes for esoteric character sets, broken in the WordPress 4.1.2 security release. Neither UTF-8 nor latin1 were affected. For more information, see <a class="external text" href="https://core.trac.wordpress.org/ticket/32051">ticket #32051</a>.</p></blockquote>\n<p>The ticket contains a lengthy technical discussion of a critical bug and what was done to fix it. In addition to 4.1.3, the patch was merged into the following versions:</p>\n<ul>\n<li>3.7.7</li>\n<li>3.8.7</li>\n<li>3.9.5</li>\n<li>4.0.3</li>\n</ul>\n<p>Since these are point releases, sites running WordPress 3.7 and higher will automatically update unless the server doesn&#8217;t support it or they&#8217;re disabled. If you&#8217;re running an old version of WordPress, I highly encourage you to update to 4.2. Not only does it have <a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download">some nifty new features</a>, but it also fixes <a href="https://core.trac.wordpress.org/query?status=accepted&status=assigned&status=closed&status=new&status=reopened&status=reviewing&type=defect+%28bug%29&version=%21&version=%21trunk&resolution=fixed&milestone=4.2&col=id&col=summary&col=milestone&col=status&col=type&col=owner&col=priority&order=priority" target="_blank">231 defects</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 04:25:35 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:28;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:50:"Post Status: WordPress 4.2, “Powell”, released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"https://poststatus.com/?p=12432";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:42:"https://poststatus.com/%e2%9d%a4%ef%b8%8f/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:5937:"<p></p>\n<h3>The consistency of WordPress</h3>\n<p>WordPress 4.2,&nbsp;<a href="http://wordpress.org/news/2015/04/powell/">Powell</a>,&nbsp;marks the impressive sixth major version in a row on a four month average development cycle.</p>\n<ul>\n<li>WordPress 3.7: October 24th, 2013</li>\n<li>WordPress 3.8: December 12th, 2013</li>\n<li>WordPress 3.9: April 16th, 2014</li>\n<li>WordPress 4.0: September 4th, 2014</li>\n<li>WordPress 4.1: December 18th, 2014</li>\n<li>WordPress 4.2: April 23rd, 2015</li>\n</ul>\n<p>This streak of consistency in WordPress releases is not accidental. Groundwork was put in place organizationally, technically, and philosophically to help ensure consistent, iterative improvements for WordPress.</p>\n<p>The project has always been quite good at updates, if compared to competition. However, a few releases prior to 3.7 got sidetracked, distracted, or thrown off schedule if held to our own high standard.</p>\n<p>Concepts such as the introduction of <a href="https://make.wordpress.org/core/features-as-plugins/">feature plugins</a> have helped put sanity and routine into the release schedule, even without repeat release leads these last six versions (and none will repeat at least through 4.4).</p>\n<h4>Features of WordPress 4.2</h4>\n<h3>Press This</h3>\n<p><img class="aligncenter size-large wp-image-12436" src="https://poststatus.com/wp-content/uploads/2015/04/press-this-wp-752x517.png" alt="press-this-wp" width="752" height="517" /></p>\n<p>It’s quite possible even long term WordPress users have never heard of, much less used, Press This. However, the bookmarklet makes sharing and publishing others’ articles on your own blog quite simple.</p>\n<p>It was long overdue to either be cut from core or completely revamped. It was completely revamped under the “feature as plugin” model, led by Michael Arestad.</p>\n<p>I’ve been using the new Press This or a while now on my personal blog, and it’s really great. If your goal is to blog more regularly, and you like to curate or share what you’re reading/watching, you’ll love Press This. You can find the bookmarklet in the admin and primary Tools page.</p>\n<p>The editor is modern and honestly a great prototype for what could be a future full WordPress editor. The bookmarklet sits in my bookmarks, and it’s encouraged me to more often blog my thoughts on what I read — versus leave my thoughts with a single Tweet.</p>\n<p>I was at first on the fence as to whether Press This made sense to get a revamp. I’m now convinced it was a great decision, and the team that worked on most of the features was outstanding.</p>\n<p>There are more features coming to Press This. You can check some of them out <a href="http://blog.michaelarestad.com/2015/04/23/pressed-it/">on Michael’s blog post</a> celebrating its inclusion in 4.2. If you’ve never pressed anything with Press This, definitely give it a shot.</p>\n<h3>Customizer Theme Switcher</h3>\n<p>Another feature plugin that made it into 4.2 is the Customizer Theme Switcher. Relatively self-explanatory, this feature brings the theme choosing experience to the customizer.</p>\n<p>The project was lead by Nick Halsey, and you can find the core proposal for the feature <a href="https://make.wordpress.org/core/2015/02/11/customizer-theme-switcher-feature-plugin-merge-proposal/">on the Make WordPress blog</a>. Not many folks using WordPress as a full CMS will change themes that often, but for those that do, the move for selecting and testing themes to the customizer makes sense.</p>\n<h3>Shiny Updates</h3>\n<p><img class="aligncenter size-full wp-image-12438" src="https://poststatus.com/wp-content/uploads/2015/04/shiny-updates.png" alt="shiny-updates" width="707" height="391" /></p>\n<p>Shiny Updates allows for inline updates directly in the plugins admin screen, without a redirect to the funky plugin update progression page you’re probably quite familiar with.</p>\n<p>Shiny Updates is part of a larger effort for making both updates and installs better. Due to some potential UX issues and in order to stick with the release schedule, shiny installs was postponed. However, in a future release, the install and activation process for plugins will be a simpler process as well.</p>\n<h3>Utf8mb4 support to enable special characters and emoji</h3>\n<p><img class="aligncenter size-large wp-image-12437" src="https://poststatus.com/wp-content/uploads/2015/04/4.2-characters-752x626.png" alt="4.2-characters" width="752" height="626" /></p>\n<p>WordPress can now handle all sorts of special characters by default, including Chinese, but also various glyphs and other symbols. And yes, emoji.</p>\n<p>Perhaps the most discussed and also misunderstood feature of WordPress 4.2, Utf8mb4 makes WordPress more accessible in more languages, and that is awesome.</p>\n<p>Also, don’t kid yourself: everyone loves emoji. As WordPress is used more as a mobile app backend, this change will be especially welcome. Can you imagine an app that didn’t support emoji? Of course not. <img src="https://s.w.org/images/core/emoji/72x72/1f389.png" alt="?" class="wp-smiley" /></p>\n<p>By the way, there is <a href="https://codex.wordpress.org/Emoji">a handy Codex article</a> that details how to enable the emoji keyboard on various operating systems.</p>\n<h3>Notes on developer features</h3>\n<p>There are some great developer features in WordPress 4.2 as well. I highly recommend reading Aaron Jorbin&#8217;s <a href="https://make.wordpress.org/core/2015/04/23/wordpress-4-2-field-notes/">field notes post</a> that details some of the key features for developers and also has links to detailed posts to cover each one.</p>\n<h3>An excellent release</h3>\n<p>WordPress 4.2 is an excellent release that has a nice balance of new features, fixes, and developer enhancements.</p>\n<p>Congratulations to the core team and everyone that was involved in the release of WordPress 4.2, &#8220;Powell&#8221;.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 03:12:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Brian Krogsgard";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:29;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"Alex King: Setting the wp_remote_get() User Agent";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=21651";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:60:"http://alexking.org/blog/2015/04/23/user-agent-wp_remote_get";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1041:"<p>I was recently trying to make some API requests from within WordPress using `wp_remote_get()`, but the site I was asking for data from was rejecting requests from the default WordPress User Agent. I tried to set the user agent to something different, but it still wasn&#8217;t working:</p>\n<p><code>$response = wp_remote_get($url, array(<br />\n&nbsp;&nbsp;''timeout'' => 20,<br />\n&nbsp;&nbsp;''User-Agent'' => ''Mozilla/5.0 (Macintosh; Intel Mac OS X 10.8; rv:20.0) Gecko/20100101 Firefox/20.0''<br />\n));</code></p>\n<p>Thankfully, <a href="http://ottopress.com">Otto</a> spotted my problem. The `user-agent` key needs to be lowercase so that it is picked up properly by the WordPress core code. This works:</p>\n<p><code>$response = wp_remote_get($url, array(<br />\n&nbsp;&nbsp;''timeout'' => 20,<br />\n&nbsp;&nbsp;''<b>u</b>ser-<b>a</b>gent'' => ''Mozilla/5.0 (Macintosh; Intel Mac OS X 10.8; rv:20.0) Gecko/20100101 Firefox/20.0''<br />\n));</code></p>\n<p>And there you have it. It&#8217;s always nice to have an extra set of eyes on some code.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 24 Apr 2015 00:19:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:30;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:65:"WPTavern: Jetpack 3.5 Introduces Menu Management on WordPress.com";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42711";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:75:"http://wptavern.com/jetpack-3-5-introduces-menu-management-on-wordpress-com";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2958:"<p><a href="http://jetpack.me/2015/04/23/jetpack-3-5-menu-management/" target="_blank">Jetpack 3.5</a> was released today, coinciding with <a href="http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download" target="_blank">WordPress 4.2</a>. This release expands the capabilities of Jetpack&#8217;s centralized site management to include menus. If you have <a href="http://jetpack.me/support/site-management/" target="_blank">Jetpack Manage</a> activated, you can now log into WordPress.com to manage menus for any of your sites that have opted in.</p>\n<p><a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/menu-management.png" rel="prettyphoto[42711]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/menu-management.png?resize=700%2C404" alt="menu-management" class="aligncenter size-full wp-image-42721" /></a></p>\n<p>The benefit of going to WordPress.com to manage menus for self-hosted sites was not immediately evident for those who don&#8217;t make use of the centralized site management feature. The interface is different and the dashboard contains a limited set of site management controls.</p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/pollyplummer">@pollyplummer</a> <a href="https://twitter.com/jetpack">@jetpack</a> I can’t think of any. Aside from how weird that is, the disconnect isn’t intuitive. Solutions in search of problems.</p>\n<p>&mdash; John Parris (@John_Parris) <a href="https://twitter.com/John_Parris/status/591370442839056384">April 23, 2015</a></p></blockquote>\n<p></p>\n<p>For those who manage just one or two sites, it isn&#8217;t clear why you would opt to log into WordPress.com instead of your site&#8217;s admin panel, which is essentially the command center, where everything is at your disposal.</p>\n<p>Jetpack representative Jeremy Herve <a href="https://twitter.com/jeherve/status/591342288867106816" target="_blank">explained</a> that the primary benefits of the menu management feature are applicable &#8220;when working on multiple sites, when on mobile, and when you don&#8217;t want to log into the self-hosted site.</p>\n<p>&#8220;I must also admit than I&#8217;m not the biggest fan of the Menus interface in WordPress.org,&#8221; he said. &#8220;It&#8217;s confusing for new users.&#8221;</p>\n<p>If you prefer WordPress.com&#8217;s menu manager and posting interface but want to retain the freedom of self-hosting your site, then Jetpack Manage may be a good fit for you. If the disconnected, dissimilar interfaces don&#8217;t make sense for managing your sites, then there&#8217;s no need to activate it. Currently, bulk plugin management across multiple sites seems to be the most popular use of Jetpack Manage.</p>\n<p>The 3.5 release also includes a dozen bug fixes and a few small enhancements. View Jetpack&#8217;s <a href="https://wordpress.org/plugins/jetpack/changelog/" target="_blank">changelog</a> for details.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 23 Apr 2015 23:48:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:31;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:26:"Matt: Big Announcement Day";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44979";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:42:"http://ma.tt/2015/04/big-announcement-day/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:283:"<p>Two big releases today: <a href="https://wordpress.org/news/2015/04/powell/">WordPress 4.2 with lots of interface improvements and emoji support</a>, and the <a href="http://jetpack.me/2015/04/23/jetpack-3-5-menu-management/">3.5 release of Jetpack with a new menu editor</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 23 Apr 2015 19:55:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:32;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:66:"WPTavern: WordPress 4.2 “Powell” is Now Available for Download";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42641";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:70:"http://wptavern.com/wordpress-4-2-powell-is-now-available-for-download";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:7427:"<p><a href="https://wordpress.org/news/2015/04/powell/" target="_blank">WordPress 4.2 &#8220;Powell&#8221;</a> has arrived and is now ready for download. It is named for <a href="http://en.wikipedia.org/wiki/Bud_Powell" target="_blank">Earl Rudolph &#8220;Bud&#8221; Powell</a>, an American jazz pianist. This release, <a href="http://wptavern.com/drew-jaynes-to-lead-wordpress-4-2" target="_blank">led by 10up engineer Drew Jaynes</a>, offers a balanced mix of front-facing features that users will enjoy, as well as improvements for developers. Here is a tour of the highlights.</p>\n<h3>Press This Overhauled</h3>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new.png" rel="prettyphoto[42641]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/press-this-new.png?resize=986%2C531" alt="press-this-new" class="aligncenter size-full wp-image-42649" /></a></p>\n<p>WordPress 4.2 contributors have brought the Press This feature back to life with a <a href="http://wptavern.com/pressthis-revamped-with-a-new-user-interface-and-minimalist-design" target="_blank">completely revamped interface</a> that makes it easy to share content from any website. It allows you to grab text, images, and videos, quickly add your thoughts, and publish. Any media is automatically added to your media library during the process. Add the bookmarklet from the Tools screen to your browser&#8217;s bookmark bar or your mobile desktop to jump start your publishing.</p>\n<h3>Switch Themes in the Customizer</h3>\n<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/02/customizer-theme-switcher.jpg" rel="prettyphoto[42641]"><img src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/02/customizer-theme-switcher.jpg?resize=1025%2C473" alt="customizer-theme-switcher" class="aligncenter size-full wp-image-38931" /></a></p>\n<p>WordPress 4.2 makes it possible to <a href="http://wptavern.com/customizer-theme-switcher-approved-for-merge-into-wordpress-4-2" target="_blank">switch themes in the customizer</a>.  Users can now browse through themes that have already been installed and activate a new one without ever leaving the frontend. This further streamlines the UI for customizing your site and paves the way for the theme installation process to be added to the customizer in the future.</p>\n<h3>Expanded 4-Byte Unicode Character Support, Including Emoji</h3>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/emoji-support.jpg" rel="prettyphoto[42641]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/emoji-support.jpg?resize=1025%2C512" alt="emoji-support" class="aligncenter size-full wp-image-42652" /></a></p>\n<p>This release changes database character encoding from  utf8mb3 to utf8mb4, which makes it possible for WordPress to <a href="http://wptavern.com/emoji-enables-wordpress-to-natively-support-chinese-korean-and-japanese-characters" target="_blank">natively support Chinese, Japanese, and Korean characters</a>. The character encoding update also opens up a whole new world for using musical and mathematical symbols, hieroglyphs, and <a href="https://codex.wordpress.org/Emoji" target="_blank">emoji</a>. Emoji support has been added everywhere, and you can even <a href="http://www.brandonkraft.com/b/2015/03/emoji-wordpress-and-you/" target="_blank">use them in URLs</a>, if you&#8217;re adventurous.</p>\n<h3>Enhanced Plugin Updates</h3>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/new-plugin-updates.png" rel="prettyphoto[42641]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/new-plugin-updates.png?resize=657%2C325" alt="new-plugin-updates" class="aligncenter size-full wp-image-42658" /></a></p>\n<p>After you update to 4.2, you will be able to update plugins on the plugins screen without refreshing the page and without being whisked away to a new update screen. This makes it a more intuitive process and cuts down on the clicking required to manage your site in the admin. It is also the first stepping stone toward <a href="http://wptavern.com/wordpress-4-2-radically-improves-the-plugin-install-and-update-process" target="_blank">improving the plugin installation process</a> to provide the same convenient experience.</p>\n<h3>Improvements Under the Hood</h3>\n<p>In addition to all the front-facing improvements, WordPress 4.2 includes some equally exciting updates for developers.</p>\n<ul>\n<li><a href="http://wptavern.com/new-plugin-detects-shared-terms-in-wordpress-ahead-of-taxonomy-term-splitting-in-4-2" target="_blank">Taxonomy Term Splitting</a> &#8211; terms shared across multiple taxonomies will now be split when one of them is updated.</li>\n<li>Complex Query Ordering &#8211; <code>WP_Query</code>, <code>WP_Comment_Query</code>, and <code>WP_User_Query</code> now support complex ordering with named meta query clauses.</li>\n<li>JavaScript Accessibility &#8211; Send audible notifications to screen readers in JavaScript with <a href="https://make.wordpress.org/accessibility/2015/04/15/let-wordpress-speak-new-in-wordpress-4-2/" target="_blank">wp.a11y.speak()</a>. Pass it a string, and an update will be sent to a dedicated ARIA live notifications area.</li>\n<li><a href="https://make.wordpress.org/core/2015/04/23/tinymce-views-api-improvements/" target="_blank">TinyMCE views API improvements</a> &#8211; this API is not yet ready for production but developers are welcome to test and experiment with it.</li>\n</ul>\n<p>Check out Aaron Jorbin&#8217;s<a href="https://make.wordpress.org/core/2015/04/23/wordpress-4-2-field-notes/" target="_blank"> WordPress 4.2 Field Notes</a> post for a more comprehensive overview of what&#8217;s new for developers.</p>\n<h3>Many More Small Improvements</h3>\n<p>WordPress 4.2 is also packed full of subtle refinements that make it more beautiful and easier to use. The <a href="http://wptavern.com/wordpress-4-2-introduces-subtle-refinements-to-the-default-admin-color-scheme" target="_blank">default admin color scheme has been updated</a> every so slightly to be more harmonious to the eyes and more consistent with WordPress&#8217; branding.</p>\n<p><a href="http://wptavern.com/wordpress-4-2-will-automatically-enable-pretty-permalinks-for-new-sites-on-installation" target="_blank">Pretty permalinks are now automatically enabled</a> for new sites on installation. In most cases, administrators on new sites will never be greeted with ugly permalinks again, saving a step in the setup process.</p>\n<p>The <a href="https://codex.wordpress.org/Embeds" target="_blank">oEmbed white list</a> has been updated to include Tumblr.com and Kickstarter, so you can easily paste links into the post editor and have the content instantly appear.</p>\n<p>WordPress 4.2 fixes <a href="https://core.trac.wordpress.org/query?status=accepted&status=assigned&status=closed&status=new&status=reopened&status=reviewing&type=defect+(bug)&version=!&version=!trunk&resolution=fixed&milestone=4.2&col=id&col=summary&col=milestone&col=status&col=type&col=owner&col=priority&order=priority" target="_blank">231 defects</a>, thanks to the volunteer efforts of 283 contributors. A complete list of all the changes in this release is available in the <a href="https://codex.wordpress.org/Version_4.2" target="_blank">4.2 codex page</a>. For a quick tour of all the highlights in 4.2, check out the video created for this release:</p>\n<p></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 23 Apr 2015 18:39:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:33;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:34:"Matt: What we can learn from Japan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44977";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:50:"http://ma.tt/2015/04/what-we-can-learn-from-japan/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:688:"<blockquote><p>I travel back and forth between Japan and the United States, mostly Tokyo and New York and a few other American cities, several times a year. The contrast is jarring. Arriving in the US can feel like rolling back a decade or more, returning to a time when information was scarce, infrastructure was creaky and basic services such as ground transportation were chaotic and unreliable.</p></blockquote>\n<p>Roland Kelts on <a href="http://www.newstatesman.com/politics/2015/03/learning-love-stagnation">What the west can learn from Japan’s “lost decades.”</a> This echoes a lot of my experience there recently, and I had the good fortune of meeting Roland as well.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 23 Apr 2015 00:25:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:34;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:68:"WPTavern: Wapuunk T-Shirts Now Available in the WordPress Swag Store";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42499";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:78:"http://wptavern.com/wapuunk-t-shirts-now-available-in-the-wordpress-swag-store";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2504:"<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/WAPUUNK_ADULT_1024x1024.jpg" rel="prettyphoto[42499]"><img src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/WAPUUNK_ADULT_1024x1024.jpg?resize=300%2C300" alt="WAPUUNK_ADULT_1024x1024" class="alignright size-medium wp-image-42618" /></a>The fame of wapuunk has spread far and wide and now fans of the creature can purchase t-shirts in the <a href="http://hellomerch.com/collections/wordpress/products/wapuunk-grey-t-shirt" target="_blank">WordPress Swag Store</a>.</p>\n<p>The punk Wapuu was <a href="http://wptavern.com/scott-evans-on-designing-the-punk-wapuu-for-wordcamp-london-2015" target="_blank">created for WordCamp London 2015</a> by Scott Evans with collaboration from the event&#8217;s organizing team. The mascot was so well-received that Evans&#8217; colleagues urged him to see if it could land in the swag store.</p>\n<p>&#8220;I supplied the vector artwork and some guidance and passed it on to Hello Merch which did the rest,&#8221; he said. Within approximately three weeks the t-shirt was made available for sale.</p>\n<p>It&#8217;s unusual to see new items added to the WordPress Swag Store, but the iconic Wapuunk mascot seems to be an instant hit with swag collectors.</p>\n<p>&#8220;After all the buzz of WordCamp London it seemed worth a go,&#8221; Evans said. &#8220;After all, they are different from the official WordCamp t-shirts we made. I think lots of folk were keen to see Wapuunk on a t-shirt.&#8221;</p>\n<p>In contrast to the simple WordPress logo-branded items, Wapuunk and other variations of the mascot have a unique way of linking the local culture and/or an event experience with the logo. Wapuu variations illustrate the variety of WordPress communities around the globe. They evoke a strong connection between the software and the local community.</p>\n<p><a href="http://wptavern.com/meet-wapuujlo-official-mascot-of-wordcamp-belgrade" target="_blank">WordCamp Belgrade featured Wapuujlo</a> at its first event, and <a href="http://philly.wordcamp.org/2015/" target="_blank">WordCamp Philly</a> will also debut a new Wapuu collection in June. With WordPress&#8217; <a href="http://wptavern.com/matt-mullenwegs-state-of-the-word-highlights-internationalization-mobile-and-new-tools-for-wordpress-contributors" target="_blank">increased focus on internationalization</a> in 2015, Wapuu variations are a fitting compliment to the many diverse communities this software brings together.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 23 Apr 2015 00:16:57 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:35;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:95:"WPTavern: WordPress.org Now Requires Theme Authors to Use the Customizer to Build Theme Options";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42579";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:105:"http://wptavern.com/wordpress-org-now-requires-theme-authors-to-use-the-customizer-to-build-theme-options";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:7412:"<p><a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/colored-pencils.jpg" rel="prettyphoto[42579]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/colored-pencils.jpg?resize=960%2C470" alt="colored-pencils" class="aligncenter size-full wp-image-42610" /></a></p>\n<p>The WordPress Theme Review team made a major decision this week to <a href="https://make.wordpress.org/themes/2015/04/21/this-weeks-meeting-important-information-regarding-theme-options/" target="_blank">enforce the use of the native customizer</a> on new themes submitted to the directory. Theme authors who want to include customization options will no longer be able to create their own settings panels but will be required to follow the new customizer standard, effective immediately.</p>\n<p>Existing themes in the directory will have six months to comply before the Theme Review Team starts to enforce the new requirement. To facilitate this process the team is preparing a series of posts and better documentation on how to use the customizer.</p>\n<p>Theme Review Team member Justin Tadlock <a href="https://wordpress.slack.com/archives/themereview/p1429641246005571" target="_blank">brought the matter to a vote</a> during the last meeting:</p>\n<blockquote><p>I&#8217;m proposing that we do an outright ban on custom settings screens in the admin. The plan was to allow theme authors to naturally move over to the customizer given time. This hasn&#8217;t worked.</p></blockquote>\n<p>As attempts to standardize the use of the customizer in new themes have not been successful, the Theme Review Team has opted to draw a hard line, as gatekeepers to the official directory. For the most part, reactions to the new guidelines have been positive, but theme authors who incorporate other options frameworks are not thrilled about having to rewrite their options for the customizer.</p>\n<h3>Will the Customizer Requirement Stifle Innovation for Theme Developers?</h3>\n<p>While many developers agree that the customizer is WordPress&#8217; strongest option right now for providing live previews on design customizations, some are worried that the new requirement will limit creativity and innovation that might spring up from different solutions.</p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/justintadlock">@justintadlock</a> Big change.  I''m pro customizer but not allowing it means better solutions may not see the light of day or even be attempted.</p>\n<p>&mdash; Carl Hancock (@carlhancock) <a href="https://twitter.com/carlhancock/status/590613807870906368">April 21, 2015</a></p></blockquote>\n<p></p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/justintadlock">@justintadlock</a> It''s better than most as far as WP goes today. I''d just hate to see it stifle other ways of tackling the customizer concept.</p>\n<p>&mdash; Carl Hancock (@carlhancock) <a href="https://twitter.com/carlhancock/status/590614883525341185">April 21, 2015</a></p></blockquote>\n<p></p>\n<p><a href="https://twitter.com/simplerain" target="_blank">Dovy Paukstys</a>, lead developer of the Redux Framework, <a href="https://make.wordpress.org/themes/2015/04/21/this-weeks-meeting-important-information-regarding-theme-options/#comment-41129" target="_blank">commented</a> on the announcement to express a common concern among developers who utilize more specialized controls than the customizer can currently provide.</p>\n<blockquote><p>So essentially what you’re mandating is for Frameworks, like Redux, to port all of their special controls to the Customizer because if a theme uses any form of a custom control and doesn&#8217;t display it in the customizer, in 6 months time you will boot from WP.org. Correct?</p>\n<p>Doesn&#8217;t that seem a little narrow sighted? The customizer is great for live reload, but it doesn&#8217;t have the real-estate for advanced fields that developers make.</p></blockquote>\n<p>Resistance to the new guideline is frequently met with the suggestion that developers instead work on improving the customizer to be better for all users, as it is now WordPress&#8217; core-supported method of providing theme options. Paukstys finds it to be too limited in its current state for anything other than simple style changes.</p>\n<blockquote><p>My personal motivation to improve the customizer is low since I personally do not see it as a viable option outside of styling. There’s simply not enough real-estate from a design perspective. It also doesn’t have things like visual validation, warnings, etc. It doesn’t offer field visibility linking, etc. It serves a powerful purpose, but I do not feel it is a complete replacement for the settings API.</p></blockquote>\n<p>Paukstys further contends that the community was not represented in the decision process that followed the official proposal and that the new mandate unfairly promotes a single, narrow approach.</p>\n<blockquote><p>Why do you wish to limit developers so much? Isn’t the point of open source for people to make things in different ways and improve the whole? Why are you limiting your devs? Could it be that the customizer hasn&#8217;t had the adoption that you think it deserves? This just seems like a mandate by your team and not a desire of the community as a whole.</p></blockquote>\n<p>According to Emil Uzelac, theme authors using Redux or another framework are still at liberty to use the <a href="http://tgmpluginactivation.com/" target="_blank">TGM Plugin Activation library</a> to notify users of a theme being “Redux-Ready,&#8221; for example, but will not be able to fully package those options as part of the theme submitted to WordPress.org.</p>\n<p>Tadlock is currently preparing a more comprehensive reply to these concerns but maintains that he will always support more innovative ways of approaching customization, should a new solution surpass that of the customizer in the future.</p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/carlhancock">@carlhancock</a> I''ll always fight to get something innovative pushed through even if it doesn''t fit in the guidelines.</p>\n<p>&mdash; Justin Tadlock (@justintadlock) <a href="https://twitter.com/justintadlock/status/590616882648109056">April 21, 2015</a></p></blockquote>\n<p></p>\n<p>The Theme Review guidelines have continued to evolve with WordPress over the years and the team meetings are open to all who wish to have a voice in the decision-making process.</p>\n<p>Tadlock is aiming to produce more education for theme authors within a day or two. He has also committed to helping developers build controls that are not readily available.</p>\n<blockquote><p>Make me a list of controls you’d like to see. Core added a lot more options in 4.0, but I’m open to building any control classes that could be utilized by theme authors. If there’s a control that the customizer doesn’t support out of the box, it should be built by extending the core <code>WP_Customize_Control</code> class. I’ll at least attempt to build any controls that people need help with.</p></blockquote>\n<p>Theme developers who are worried about working with a limited set of customizer options will have help from the Theme Review Team. Those with themes that need updating have a six-month head start before the guidelines will be enforced on themes that submit an update.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 22 Apr 2015 21:00:18 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:36;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:84:"Post Status: Theme Review Team to require using the Customizer for all theme options";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"https://poststatus.com/?p=12405";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:57:"https://poststatus.com/customizer-required-theme-options/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:5575:"<p>The Theme Review Team announced that all themes <a href="https://wordpress.org/themes">hosted on WordPress.org</a> will <a href="https://make.wordpress.org/themes/2015/04/21/this-weeks-meeting-important-information-regarding-theme-options/">be required to use the Customizer for theme options</a> moving forward. The new requirement will be phased in over 6 months, which gives existing theme authors some time to make the updates and new theme authors some time to adjust themes that might already be in progress.</p>\n<p>This is a huge change. Although the Customizer has been available since WordPress 3.4 &#8212; which was released in June of 2012 &#8212; adoption has been slow on themes submitted to the official WordPress theme repository.</p>\n<p>Official stats aren&#8217;t available, but of the <a href="https://themes.trac.wordpress.org/query?priority=new+theme&status=new&priority=previously+reviewed&keywords=!~buddypress&col=id&col=summary&col=status&col=time&col=changetime&col=reporter&report=2&order=time">ten most recent themes</a> submitted to the theme repo I looked at, 20% had a custom options page. Of the <a href="https://themes.trac.wordpress.org/query?priority=theme+update&status=new&status=reopened&keywords=!~buddypress&col=id&col=summary&col=priority&col=status&col=reporter&col=owner&col=time&col=changetime&report=1&order=time">ten most recent updates</a>, 40% had a custom options page. This is a very small sample, but there&#8217;s no doubt this change will effect a huge amount of submissions.</p>\n<p>From a theme review perspective this makes a lot of sense. Verifying proper sanitization and proper use of the Settings API can take a huge amount of time for reviewers.</p>\n<p>Many theme authors use frameworks like the Options Framework, Redux, Titan, Options Tree, and UpThemes &#8212; but reviewers still need to check for potentially malicious alterations, proper text domains, and function prefixing. Standardizing this by requiring the Customizer will make the job of theme review simpler.</p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/devinsays">@devinsays</a> Echoing others, it''s a win for users and will speed up review times. I think the time has come.</p>\n<p>&mdash; Kirk Wight (@kwight) <a href="https://twitter.com/kwight/status/590782169817026560">April 22, 2015</a></p></blockquote>\n<p></p>\n<p>From a user interface perspective, it also seems like a good move. Users can always expect options to be available in the Customizer tab if they exist and they won&#8217;t need to navigate unfamiliar custom screen layouts &#8212; though users of specific themes might be confused when the options page disappears on an update and moves into the Customizer bar.</p>\n<p>For theme authors it is probably a mixed bag. Many authors rely on WordPress.org to drive sales of commercial theme upsells, and the theme options page is a common place to promote such upsells. It can also take quite a bit of time to migrate options from a custom page to the Customizer and ensure perfect backwards compatibility.</p>\n<blockquote class="twitter-tweet" width="550"><p><a href="https://twitter.com/devinsays">@devinsays</a> I think it’s a great way to standardize and will ultimately be easier for both users and theme authors.</p>\n<p>&mdash; Dan Manchester (@elseloop) <a href="https://twitter.com/elseloop/status/590720553486569473">April 22, 2015</a></p></blockquote>\n<p></p>\n<p>Certain frameworks also provide features that aren&#8217;t native to the Customizer, like repeater fields, multiselect, image radio buttons, datepickers, editor instances, and custom typography options &#8212; though Customizer libraries like <a href="http://kirki.org/">Kirki</a> can also bridge those gaps.</p>\n<p>The Customizer has evolved quite a bit since it was first introduced. WordPress 4.0 brought a number of enhancements like contextual controls, panels and additional field types. Core features like custom headers, custom backgrounds and widget editing have migrated to the Customizer and then been improved over successive releases. In the upcoming WordPress 4.2 release users will be able to switch themes directly from the Customizer.</p>\n<p>It could be argued that space constraints in the Customizer could make organization a bit more difficult for themes that ship with hundreds of different options, but there are many examples of WordPress themes already handling this well.</p>\n<p>The <a href="https://wordpress.org/themes/make/">Make theme</a> by the Theme Foundry is one such example. It has six custom panels and over three hundred individual customization options &#8212; but is still a very usable and popular product. Obox <a title="Layers, by Obox, introduces a beautiful page building interface" href="https://poststatus.com/layers-theme-obox/">also went all in</a> on the Customizer with their Layers page builder theme. Examples like these help prove that the Customizer can scale fairly well, even with a lot of options.</p>\n<p>Personally, I think the standardization of options is a great move forward. I originally started developing the <a href="http://wptheming.com/options-framework-theme/">Options Framework</a> (an easy way for developers to build custom options pages) over five years ago because there was not a good solution in core. I&#8217;m now happy to report that the code I helped develop is nearly obsolete as better tools have become available.</p>\n<p><a href="http://ma.tt/2014/10/wordcamp-san-francisco-2014/">Photo: TRT member Emil Uzelac, by Sheri Bigelow</a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 22 Apr 2015 15:21:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Devin Price";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:37;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:94:"WPTavern: XSS Vulnerability: What to do if You Buy or Sell Items on Themeforest and CodeCanyon";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42541";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:103:"http://wptavern.com/xss-vulnerability-what-to-do-if-you-buy-or-sell-items-on-themeforest-and-codecanyon";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:6328:"<a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/ImportantFeaturedImage.png" rel="prettyphoto[42541]"><img class="size-full wp-image-42559" src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/ImportantFeaturedImage.png?resize=650%2C200" alt="Important Featured Image" /></a>photo credit: <a href="http://www.flickr.com/photos/66742614@N00/290711738">What&#8217;s important?</a> &#8211; <a href="https://creativecommons.org/licenses/by-sa/2.0/">(license)</a>\n<p>Earlier this week, one of the largest <a title="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins" href="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins">coordinated efforts</a> between WordPress plugin authors, <a title="https://sucuri.net/" href="https://sucuri.net/">Sucuri</a>, and the WordPress security team resulted in a number of popular plugins receiving security updates. Due to inaccurate information within the WordPress codex, a number of developers improperly assumed the <a title="https://codex.wordpress.org/Function_Reference/add_query_arg" href="https://codex.wordpress.org/Function_Reference/add_query_arg"><i>add_query_arg()</i></a> and <a title="https://codex.wordpress.org/Function_Reference/remove_query_arg" href="https://codex.wordpress.org/Function_Reference/remove_query_arg"><i>remove_query_arg()</i></a> functions would properly escape user input.</p>\n<p>When combined, <a title="http://themeforest.net/category/wordpress" href="http://themeforest.net/category/wordpress">Themeforest</a> and <a title="http://codecanyon.net/category/wordpress" href="http://codecanyon.net/category/wordpress">CodeCanyon</a> sell nearly 8.8K WordPress items. Stephen Cronin, Quality Team Leader for Themeforest and CodeCanyon, has published an <a title="http://themeforest.net/forums/thread/security-vulnerability-affecting-wordpress-plugins-and-themes/173011" href="http://themeforest.net/forums/thread/security-vulnerability-affecting-wordpress-plugins-and-themes/173011">official forum post</a> that describes the vulnerability and how sellers can check for it within their items. If items you sell use the following code, it is likely affected.</p>\n<ul>\n<li>add_query_arg()</li>\n<li>remove_query_arg()</li>\n<li>TGM Plugin Activation class</li>\n</ul>\n<p><a title="https://github.com/thomasgriffin/TGM-Plugin-Activation" href="https://github.com/thomasgriffin/TGM-Plugin-Activation">TGM Plugin Activation</a> is a PHP library created and maintained by Thomas Griffin and Gary Jones that allows developers to require or recommend plugins for themes or for plugins. It allows users to install and even automatically activate plugins in singular or bulk fashion using native WordPress classes, functions, and interfaces. Sellers should review their code and <a title="https://make.wordpress.org/plugins/2015/04/20/fixing-add_query_arg-and-remove_query_arg-usage/" href="https://make.wordpress.org/plugins/2015/04/20/fixing-add_query_arg-and-remove_query_arg-usage/">follow the guidelines</a> published on the Make WordPress plugins site.</p>\n<p>While auditing the TGM Plugin Activation class, a XSS vulnerability was discovered. The TGM Plugin Activation class has since been updated despite the version number not being changed. If you&#8217;re a seller and use this class, you&#8217;ll need to update to the latest version of TGM Plugin Activation and update your item to include the latest version.</p>\n<h2>OptionTree</h2>\n<p>If you use <a title="https://wordpress.org/plugins/option-tree/" href="https://wordpress.org/plugins/option-tree/">OptionTree</a>, the marketplace review team is confident that all instances of <strong>add_query_arg</strong> and <strong>remove_query_arg</strong> have been escaped properly. There will be an update in the future that escapes these functions you should include in your item, but you shouldn&#8217;t delay updating your items while waiting for the update.</p>\n<h2>Redux Framework</h2>\n<p>The <a title="http://reduxframework.com/" href="http://reduxframework.com/">Redux framework</a> also uses <strong>add_query_arg</strong> and <strong>remove_query_arg</strong>, but most are escaped appropriately. There are a few questionable areas within the theme that the review team will provide updates on once they receive clarification.</p>\n<h2>Theme Authors</h2>\n<p>Theme authors who have bundled affected third-party plugins will be contacted by Envato in the next few days to update your theme. You&#8217;re encouraged to check bundled plugins before this time to see if they&#8217;re affected.</p>\n<h2>Buyers</h2>\n<p>According to Cronin, all WordPress specific items are being evaluated. Once the evaluation is complete, buyers who purchased an affected item will be notified. There&#8217;s no time frame on when the evaluation will be completed, however, Cronin says it is a priority and progress reports will be published in this <a title="http://codecanyon.net/forums/thread/security-vulnerability-affecting-wordpress-plugins-and-themes/173013" href="http://codecanyon.net/forums/thread/security-vulnerability-affecting-wordpress-plugins-and-themes/173013">forum thread</a>.</p>\n<h2>All Hands on Deck</h2>\n<p>Cronin says, &#8220;When submitting an update that addresses these issues, please include a note mentioning it&#8217;s related to the <a title="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins" href="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins">XSS vulnerability</a>. This will allow us to prioritize the review of updates.&#8221;</p>\n<p>Unlike the WordPress.org plugin directory, Themeforest and CodeCanyon only provide and notify buyers of updates if they register with the update system. It&#8217;s not an optimal upgrade routine and one that requires buyers to opt-in instead of opt-out.</p>\n<p>It&#8217;s important that sellers on Envato&#8217;s marketplaces do their part to check and patch any XSS vulnerabilities discovered. It&#8217;s also important the lines of communication remain open between the marketplaces and buyers so they can update purchased items as soon as possible. If you do business with Themeforest or CodeCanyon, be on the lookout for updates to items you&#8217;ve purchased.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 20:42:24 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:38;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:62:"WPTavern: Facebook Has Abandoned Its Official WordPress Plugin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42519";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:72:"http://wptavern.com/facebook-has-abandoned-its-official-wordpress-plugin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3383:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/facebook.jpg" rel="prettyphoto[42519]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/facebook.jpg?resize=638%2C300" alt="facebook" class="aligncenter size-full wp-image-42545" /></a></p>\n<p>The official <a href="https://wordpress.org/plugins/facebook/" target="_blank">Facebook plugin for WordPress</a> launched in 2012 with the help of engineers from Automattic and currently lists 14 contributing authors. The plugin is active on more than 200,000 websites, but Facebook has not updated the plugin description page to let users know that it has been <a href="https://wordpress.org/support/topic/wordpress-is-not-your-enemy-facebook-so-update-and-support-your-plugin" target="_blank">abandoned</a>.</p>\n<p>The Facebook plugin has received no updates since March 2014, and support questions have gone unanswered for approximately a year. The plugin&#8217;s star ratings have plummeted to 2.2 out of 5.</p>\n<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/facebook-plugin-forums.jpg" rel="prettyphoto[42519]"><img src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/facebook-plugin-forums.jpg?resize=775%2C409" alt="facebook-plugin-forums" class="aligncenter size-full wp-image-42551" /></a></p>\n<p>The official word on the plugin is that Facebook has abandoned it and it is now <a href="https://developers.facebook.com/docs/wordpress" target="_blank">supported by the community</a>:</p>\n<blockquote><p>The Facebook for WordPress was an officially supported tool to help WordPress developers integrate Social Plugins and publish Open Graph stories.</p>\n<p>The plugin is no longer officially supported by Facebook but is maintained by the developer community.</p></blockquote>\n<p>WordPress.com VIP still uses the plugin and has it listed among its <a href="https://vip.wordpress.com/plugins/" target="_blank">plugins and partners</a> but has developed a version tailored to VIP customers. If the plugin is similar enough to the official one listed on WordPress.org, it would be helpful to have some of the changes ported back to the community version.</p>\n<p>I spoke with Sara Rosso from the VIP team to inquire about Automattic&#8217;s plans for the Facebook plugin. Automattic&#8217;s official response indicates that they will not be part of the community support effort:</p>\n<blockquote><p>We&#8217;re currently supporting the Facebook plugin for use on the WordPress.com VIP platform, and we&#8217;ve made some modifications to it to work with our infrastructure. Automattic was a contributor to the initial version of the plugin (we provided some consultation and support), but there aren&#8217;t any plans to officially adopt ongoing development of the plugin as of today.</p></blockquote>\n<p>The plugin provides a complex assortment of features that utilize Facebook&#8217;s ever-changing APIs. As such, it&#8217;s not easy to support and requires regular updates to keep it current with changes at Facebook. The one-year old version is now riddled with bugs.</p>\n<p>Until a new maintainer steps up to adopt the plugin, WordPress users have no choice but to use <a href="https://wordpress.org/plugins/search.php?q=facebook" target="_blank">alternative community plugins</a>, which are linked on the documentation for the official plugin on Facebook.com.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 20:00:49 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:39;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:27:"Matt: Apple Loyalty Program";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44970";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:35:"http://ma.tt/2015/04/apple-loyalty/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:5602:"<p>So I finally got my hands on a the <a href="http://store.apple.com/us/buy-mac/macbook">new Macbook</a>, finally resorting to <a href="http://craigslist.org/">Craigslist</a> to find someone who had pre-ordered and pay them a small premium. I was going to write a review, and still will, but ended up writing a bunch on the process of buying things from Apple as a loyal customer.</p>\n<p>I have done the second-market Craigslist dance with probably 90% of new Apple tablets and phones before, but never for a laptop. I&#8217;m sure every ounce of effort has been expended to capitalize on the hype of the announcements and ship as many of these as possible, but this Macbook/Watch roll-out still seems especially rough with the stores having zero inventory or knowledge of if/when they&#8217;re getting anything in, and ship dates now slipping into the summer. There&#8217;s a deeper issue though: it speaks to a lack of Apple&#8217;s knowledge and connection to their customers, even though they have all the data.</p>\n<p>A <a href="http://elevenmadisonpark.com/">great restaurant</a> will <a href="http://www.amazon.com/Setting-Table-Transforming-Hospitality-Business/dp/0060742763">track every time you&#8217;ve eaten there, how much you spent, your preferences</a>, and use that to prioritize reservations and tailor service on subsequent visits. Airlines, for their terrible reputation, actually are decent at this too with their loyalty programs. On United I&#8217;m a <a href="http://www.wsj.com/articles/SB10001424127887323423804579025120455867410">Global Services level flyer</a> and get some really nice perks as a result, with the knowledge that if I don&#8217;t fly a certain amount of miles and spend a certain amount of dollars with them in a calendar year I&#8217;ll lose those perks (as I did for a few months earlier this year) and so when choosing between two flights to somewhere I&#8217;m more likely to pick the United one. (Also I think <em>some</em> of airlines bad rep is undeserved, they are flying human beings miles in the air inside tin cans where the cost of an error is catastrophic, everything is highly regulated, and many service factors are literally dependent on the weather.)</p>\n<p>I am an unapologetic, unrepentant Apple customer ever since I could afford it. One of the first things I did when I got my job at CNET in 2005 was upgrade my Mom from the inexpensive Linux box I built for her (all I could afford) to a Mac Mini. I get almost every new version of everything, including usually 4-6 phones a year (myself and family), at least a dozen laptops, iPads, Thunderbolt displays, iMacs, Mac Pros&#8230; at this point I&#8217;m probably a cumulative $100k customer of Apple, in addition to the millions we spend on Apple hardware at <a href="http://automattic.com/">Automattic</a> (everyone gets a new computer when they join, and we refresh them every 18-24 months, and <a href="https://matt.wordpress.com/2013/03/24/new-laptop-sticker/">a special W version at after 4 years of tenure</a>). And I&#8217;m late to the game! There are Apple customers today who bought their first product <em>decades</em> ago.</p>\n<p>However when pre-orders creak open at midnight, or people start queueing, the order of access to the latest and greatest from Apple is by whoever shows up first, or now online it&#8217;s essentially random depending on how lucky you are to load and complete the checkout process. In some ways there&#8217;s a beautiful equality to that, but for example when I went <a href="https://matt.wordpress.com/2013/09/20/huge-line-at-the-samsung-store-this-morning/">with Om in London for the 2013 iPhone release</a>, 95% of the line was people just there to buy and flip it, either locally or ship overseas &#8212; the very front of the line was Apple lovers, but in the rest of the line I saw people using Android.</p>\n<p>There is some sort of rank ordering inside Apple &#8212; <a href="http://9to5mac.com/community/karl-lagerfeld-has-an-apple-watch-w-gold-link-bracelet/">Karl Lagerfied</a> and <a href="http://9to5mac.com/2015/04/20/beyonce-exclusive-apple-watch-gold-link-bracelet/">Beyonce have Apple Watches</a> already, reviewers from <a href="http://daringfireball.net/">Gruber</a> to <a href="http://davidpogue.com/">Pogue</a> get devices a few weeks early to test &#8212; <strong>but imagine if there was an Apple Loyalty program for the rest of us?</strong> More than almost any other company Apple has been sustained through tough times by the belief and devotion of their best customers. It would be great if you could earn status with monetary (dollars spent) and non-monetary (impact on the world) points that give you priority ordering access, faster Genius bar appointments, maybe even access to events.</p>\n<p>Maybe the truth is Apple doesn&#8217;t need to do that, I&#8217;m going to keep using them because they make the best products, and when things are rough in the early days (like with the new Macbook, a few recent versions of OS X and iOS) I stick it out because I know it&#8217;ll get better. To my knowledge no other tech product maker has done a great loyalty program before, though there are hints in Asian players like <a href="http://www.mi.com/en/">Xiaomi</a> and <a href="https://oneplus.net/">OnePlus</a>. Most luxury brands from <a href="http://www.hermes.com/">Hermes</a> to <a href="https://www.patek.com/en/home">Patek</a> are also bad at this, because they don&#8217;t understand technology and data. But how cool would it be if Apple did reward, or even just recognize, their most loyal customers?</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 17:55:13 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:40;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:75:"WPTavern: Gateway: A Free WordPress Theme Built on the Foundation Framework";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42501";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://wptavern.com/gateway-a-free-wordpress-theme-built-on-the-foundation-framework";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4957:"<p><a href="https://wordpress.org/themes/gateway/" target="_blank">Gateway</a> is an elegant and eye-catching new theme that recently landed on WordPress.org. Since its release less than a week ago, the theme has already been downloaded more than 1400 times. It&#8217;s easy to see why it&#8217;s an instant hit &#8211; the versatile design is perfect for writers, businesses, or personal sites.</p>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/gateway.png" rel="prettyphoto[42501]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/gateway.png?resize=880%2C660" alt="gateway" class="aligncenter size-full wp-image-42522" /></a></p>\n<p>The homepage design for Gateway includes a full-width header background image, a spot for featured posts, and a featured video. All of the theme options can be found in the customizer, including logo upload, accent color and background settings.</p>\n<p>Gateway includes a custom page template for the home page as well as a full-width template. 404 pages also have a unique design. The theme includes support for one primary navigation menu and four optional widget areas.</p>\n<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/gateway-customizer.png" rel="prettyphoto[42501]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/gateway-customizer.png?resize=1025%2C543" alt="gateway-customizer" class="aligncenter size-full wp-image-42528" /></a></p>\n<h4>Support for Jetpack Users</h4>\n<p>Gateway has built-in support for nine different Jetpack features, including contact form, infinite scrolling, post sharing, related posts, site icon, shortcode embeds, carousel, and tiled galleries. If you use any of these features on your site, the theme&#8217;s design will integrate theme seamlessly.</p>\n<p>Check out a <a href="http://demo.rescuethemes.com/gateway/" target="_blank">live demo</a> to see Gateway in action with all of the supported Jetpack features activated.</p>\n<p>Gateway is <a href="https://rescuethemes.com/" target="_blank">Rescue Themes</a>&#8216; debut on WordPress.org. The theme and plugin shop was founded by <a href="http://jamigibbs.com/" target="_blank">Jami Gibbs</a> in May of 2014. Rescue Themes builds products that are specialized for niches and organizations with a particular focus on humanitarian efforts.</p>\n<p>Gateway was created using <a href="http://underscores.me/" target="_blank">Underscores</a>, Devin Price&#8217;s <a href="https://github.com/devinsays/customizer-library" target="_blank">Customizer Library</a>, and Zurb&#8217;s <a href="http://foundation.zurb.com/" target="_blank">Foundation Framework</a>.</p>\n<p>&#8220;I find Foundation to be easier to selectively include components, keeping the theme lean,&#8221; Gibbs said. &#8220;I also like the different grid options available, centering columns, offsets, etc. Last but not least, it&#8217;s developed in Sass.&#8221;</p>\n<p>Rescue Themes&#8217; primary avenue of distribution is currently through <a href="http://themeforest.net/user/RescueThemes/portfolio" target="_blank">Themeforest</a>. Gibbs is one of a handful of WordPress theme authors who are trying to make a difference by selling themes that conform to WordPress.org Theme Review standards.</p>\n<p>&#8220;I know Themeforest hasn&#8217;t always been the greatest place to find quality products,&#8221; she said. &#8220;A few of us are trying though.</p>\n<p>&#8220;I think a lot of theme devs <em>think</em> they’ve always developed to WP standards and I was among that crowd until I enlisted the help of Emil and Justin’s <a href="http://themereview.co" target="_blank">Themereview.co</a> for the <a href="http://themeforest.net/item/merch-a-woocommerce-wordpress-theme/full_screen_preview/10277209" target="_blank">Merch</a>, which I released earlier in the year,&#8221; Gibbs said. &#8220;Since then, I’ve release another premium theme, <a href="http://themeforest.net/item/brewery-a-wordpress-theme-for-beer-makers/full_screen_preview/10941216" target="_blank">Brewery</a>, and now Gateway &#8211; all built with those standards in mind.&#8221;</p>\n<p>To reinforce her knowledge of best practices, Gibbs also volunteers as a reviewer on the WordPress.org Theme Review team. The rigorous process of getting her theme approved took months, but she finds it to be worthwhile both for brand exposure and for giving back to the community.</p>\n<p>So far <a href="https://wordpress.org/themes/gateway/" target="_blank">Gateway</a> has been successful at attracting downloads on WordPress.org, and Gibbs plans to release more free themes as time allows. If you want to use the theme and need help getting started, you&#8217;ll find solid <a href="http://rescuethemes.com/documentation/gateway/" target="_blank">documentation</a> and <a href="https://rescuethemes.com/gateway-wordpress-theme/" target="_blank">demo content</a> available for Gateway on the Rescue Themes website.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 16:35:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:41;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:86:"WPTavern: WordPress 4.1.2 is a Critical Security Release, Immediate Update Recommended";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42408";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:95:"http://wptavern.com/wordpress-4-1-2-is-a-critical-security-release-immediate-update-recommended";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2696:"<p><a title="https://wordpress.org/news/2015/04/wordpress-4-1-2/" href="https://wordpress.org/news/2015/04/wordpress-4-1-2/">WordPress 4.1.2 is available</a> and is a critical security update for all previous versions of WordPress. The release has eight security fixes, one of which is high risk, three are medium-low risk, and the last four added to <a title="http://codex.wordpress.org/Hardening_WordPress" href="http://codex.wordpress.org/Hardening_WordPress">harden WordPress</a>. This is the first major security update to WordPress core since <a title="https://wordpress.org/news/2014/11/wordpress-4-0-1/" href="https://wordpress.org/news/2014/11/wordpress-4-0-1/">WordPress 4.0.1</a> released in late 2014. Three of the security issues addressed include:</p>\n<ul>\n<li>In WordPress 4.1 and higher, files with invalid or unsafe names could be uploaded. Discovered by <a href="http://HSASec.de">Michael Kapfer and Sebastian Kraemer of HSASec</a>.</li>\n<li>In WordPress 3.9 and higher, a very limited cross-site scripting vulnerability could be used as part of a social engineering attack. Discovered by <a href="http://zoczus.blogspot.com/">Jakub Zoczek</a>.</li>\n<li>Some plugins were vulnerable to an SQL injection vulnerability. Discovered by Ben Bidner of the WordPress security team.</li>\n</ul>\n<p>The team is aware of two update prompts being shown and is expected behavior. Users are encouraged to click the colored update button. The color of the button will be different depending upon the admin color scheme you use.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/TwoUpdateButtons.png" rel="prettyphoto[42408]"><img class="size-full wp-image-42513" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/TwoUpdateButtons.png?resize=845%2C352" alt="Red Update Button" /></a>Red Update Button\n<p>WordPress 4.1.2 is not affiliated with the cross site scripting vulnerability <a title="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins" href="http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins">discovered in a number of plugins</a> reported yesterday. You&#8217;re encouraged to update as soon as possible if you&#8217;ve <a title="https://make.wordpress.org/core/2013/10/25/the-definitive-guide-to-disabling-auto-updates-in-wordpress-3-7/" href="https://make.wordpress.org/core/2013/10/25/the-definitive-guide-to-disabling-auto-updates-in-wordpress-3-7/">disabled automatic updates</a> for point releases. Auto updates are being pushed out, but if you don&#8217;t want to wait, you can manually update WordPress by browsing to <strong>Dashboard &#8211; Updates</strong>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 15:27:32 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:42;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:26:"Matt: Intermittent Fasting";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=44966";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:42:"http://ma.tt/2015/04/intermittent-fasting/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:995:"<p>I&#8217;m going to try out intermittent fasting for a few weeks, after hearing about it for several years from fit-minded friends. It&#8217;s tough to find a link on it that doesn&#8217;t have some sort of newsletter popup or sell an ebook, but <a href="http://fourhourworkweek.com/2008/03/02/postponing-death-caloric-restriction-vs-intermittent-fasting-part-1/">Tim had a good guest post on it in 2008</a> which ends on a skeptical note, and this <a href="http://jamesclear.com/the-beginners-guide-to-intermittent-fasting">beginner&#8217;s guide to intermittent fasting by James Clear</a> is awesome for its graphics and straightforward way of introducing the concept and ways to approach it. I&#8217;m going to aim for a late lunch and a normal-timed dinner, since like James dinner is often my most social meal.</p>\n<p><strong>Update:</strong> <a href="http://ma.tt/2015/01/fasting/">I also forgot that I wrote about this with a few more links and some good comments in January</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 21 Apr 2015 04:24:12 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:43;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:64:"WPTavern: Applications to Host WordCamp Europe 2016 Closing Soon";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42413";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:74:"http://wptavern.com/applications-to-host-wordcamp-europe-2016-closing-soon";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3141:"<p><a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/wceu-volunteers.jpg" rel="prettyphoto[42413]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/wceu-volunteers.jpg?resize=1025%2C485" alt="wceu-volunteers" class="aligncenter size-full wp-image-31631" /></a></p>\n<p><a href="http://wptavern.com/seville-spain-to-host-wordcamp-europe-2015" target="_blank">WordCamp Europe 2015</a> will be held at the end of June in Seville, Spain, but organizers are already finalizing host city applications for the 2016 event. A <a href="http://europe.wordcamp.org/2015/call-for-applications-to-organise-wordcamp-europe-2016-closes-in-5-days/" target="_blank">final call</a> for host cities went out today and organizers announced that applications will close on Friday, April 24.</p>\n<p>This highly anticipated WordPress event is expected to bring in roughly 1,000 attendees from around the world. Such a massive undertaking requires a revolving planning process that prepares for the next year&#8217;s event while simultaneously planning the current year.</p>\n<p>Organizers for 2016 will be required to attend and assist in organizing the 2015 event as part of the <a href="http://wptavern.com/wordcamp-europe-now-taking-applications-for-2016-host-city" target="_blank">new organizer mentoring program</a> the team is piloting this year. Candidates must demonstrate excellent communication skills and become a reliable point of contact before being selected to the learn the ropes for the 2016 event.</p>\n<p>&#8220;We think it&#8217;s important for next year&#8217;s team to get involved in this year&#8217;s organization,&#8221; co-organizer Petya Raykovska said. &#8220;That&#8217;s why we started early and one of the requirements for the applying teams is to be available to join the team in Seville if chosen.&#8221;</p>\n<p>WordPress representatives in cities vying for the chance to host WCEU 2016 are required to complete a budget for each proposed venue and a detailed application form, which includes a team member summary, transportation and hotel information, and several other aspects of the event.</p>\n<p>&#8220;Compiling the application takes time and it&#8217;s understandable they&#8217;ll all come in the last week,&#8221; Raykovska said. She and other members of the organization team have been in contact with several local WordPress communities that will be applying, as the prospect can be somewhat daunting given the level of detail required.</p>\n<p>&#8220;Some teams need a bit of a nudge to feel confident enough to apply, even if they&#8217;ve done exceptional work organizing their local events,&#8221; she said.</p>\n<p>The host city for WCEU 2016 will be selected by mid-May, which will give the new organizers enough time to get involved in the most active and important stages of the 2015 event. A sample budget and application form are <a href="http://europe.wordcamp.org/2015/call-for-applications-to-organise-wordcamp-europe-2016-closes-in-5-days/" target="_blank">available on the WordCamp Europe website</a>. Local European WordPress communities have five remaining days to apply.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 20 Apr 2015 22:18:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:44;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:88:"WPTavern: GitHub Launches Licenses API to Help Open Source Developers License Their Code";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42389";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:98:"http://wptavern.com/github-launches-licenses-api-to-help-open-source-developers-license-their-code";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4884:"<p><a href="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/github-octocat.jpg" rel="prettyphoto[42389]"><img src="http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/github-octocat.jpg?resize=857%2C400" alt="github-octocat" class="aligncenter size-full wp-image-42456" /></a></p>\n<p>Open source software makes up the vast majority of licensed code hosted on <a href="https://github.com" target="_blank">GitHub</a>, as one of the primary features of the site is code sharing and collaboration. In of April 2015, GitHub reported <a href="https://github.com/about/press" target="_blank">9.2 million users collaborating across 21.8 million repositories</a>. For the past seven years since the site&#8217;s launch, one of the most difficult challenges has been getting users to add a license to their projects.</p>\n<p>Recent <a href="https://github.com/blog/1964-open-source-license-usage-on-github-com" target="_blank">open source license usage stats</a> show MIT, GPL, and Apache licenses coming in as the most popular choices with 44.69%, 12.96%, and 11.19% respectively. However, GitHub&#8217;s reckoning shows that licensing numbers are still very low and continue to drop. Only 20% of unforked repositories on the site are currently licensed (30% if you count forked repositories.)</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/percentage-of-github-repositories-licensed.png" rel="prettyphoto[42389]"><img src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/percentage-of-github-repositories-licensed.png?resize=762%2C445" alt="credit: GitHub.com" class="size-full wp-image-42417" /></a>credit: <a href="https://github.com/blog/1964-open-source-license-usage-on-github-com">GitHub.com</a>\n<p>Last month GitHub launched its <a href="https://developer.github.com/v3/licenses/" target="_blank">Licenses API</a> in order to combat the continual decline in licensing numbers. &#8220;We want to make it easier for open source developers to license their code, and for open source consumers to verify that they are using open source projects under an appropriate license,&#8221; the announcement said.</p>\n<p>The new Licenses API returns metadata about popular open source licenses and can detect a project&#8217;s license from the repository&#8217;s <code>LICENSE</code> file. Developers are welcome to preview the API while it&#8217;s still under development. Ultimately, GitHub is aiming to use the API to collect and provide more information about the open source licenses in use on the site, as well as the projects that are using them.</p>\n<p>When a project doesn&#8217;t possess a license, it&#8217;s difficult for others to know what their freedoms and limitations are for reproducing, distributing, and modifying the code. Many companies have very strict licensing requirements when it comes to the code they choose to include in their projects.</p>\n<p>In an effort to encourage users to add a license to their projects, GitHub created a handy tool called <a href="http://choosealicense.com/" target="_blank">ChooseALicense.com</a> that helps users select from the more popular open source licenses. The site uses plain language to make it easy to understand what is required, permitted, and forbidden for each license:</p>\n<p><a href="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/gpl3-license-info-github.png" rel="prettyphoto[42389]"><img src="http://i2.wp.com/wptavern.com/wp-content/uploads/2015/04/gpl3-license-info-github.png?resize=923%2C161" alt="gpl3-license-info-github" class="aligncenter size-full wp-image-42450" /></a></p>\n<p>Repositories with licenses had bottomed out at around 15% on GitHub shortly before it <a href="https://github.com/blog/1530-choosing-an-open-source-license" target="_blank">launched the license picker tool</a>. The sharp increase in licensing in 2013 in the graph above can be attributed to <a href="http://choosealicense.com/" target="_blank">ChooseALicense.com</a>. Unfortunately, over the past two years the number of licensed repositories began to decline again.</p>\n<p>Adding a license to your project is fundamental to sharing your code and empowering others to use it. Open source developers with struggling projects often complain about a lack of contribution. One of the most important things you can do to help your project get a good start is to carefully select an open source license that will be well-suited to the community you&#8217;re trying to build.</p>\n<p>GitHub is aiming to provide more in-depth analysis in the coming weeks using data from the new Licenses API, and also plans to publish how license usage affects project success. If you&#8217;re struggling to select a license for a project that you maintain, check out GitHub&#8217;s <a href="https://help.github.com/articles/open-source-licensing/" target="_blank">Guide to Open Source Licensing</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 20 Apr 2015 20:33:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Sarah Gooding";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:45;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:79:"WPTavern: XSS Vulnerability Affects More Than a Dozen Popular WordPress Plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wptavern.com/?p=42387";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:89:"http://wptavern.com/xss-vulnerability-affects-more-than-a-dozen-popular-wordpress-plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:8104:"<p>For the past week, security firm <a title="https://blog.sucuri.net/" href="https://blog.sucuri.net/">Sucuri</a> has <a title="https://blog.sucuri.net/2015/04/security-advisory-xss-vulnerability-affecting-multiple-wordpress-plugins" href="https://blog.sucuri.net/2015/04/security-advisory-xss-vulnerability-affecting-multiple-wordpress-plugins">worked with the WordPress core security team</a> to address a cross site scripting vulnerability discovered in more than a dozen popular WordPress plugins. The vulnerability stems from the improper use of the <a title="https://codex.wordpress.org/Function_Reference/add_query_arg" href="https://codex.wordpress.org/Function_Reference/add_query_arg"><i>add_query_arg()</i></a> and <a title="https://codex.wordpress.org/Function_Reference/remove_query_arg" href="https://codex.wordpress.org/Function_Reference/remove_query_arg"><i>remove_query_arg()</i></a> functions. Inaccurate information within the WordPress Codex lead many developers to assume these functions would properly escape user input.</p>\n<p>The Codex pages were created in 2009, but earlier this year, Samuel &#8216;Otto&#8217; Wood updated both pages to include information on using esc_url(). Inaccurate information has existed on both pages for more than five years, leading hundreds, if not thousands, of developers to use insecure code in plugins.</p>\n<a href="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/UpdatingTheCodex.png" rel="prettyphoto[42387]"><img class="wp-image-42392 size-full" src="http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/UpdatingTheCodex.png?resize=940%2C607" alt="The Updated Codex Pages" /></a>The Updated Codex Pages\n<p>The vulnerability was <a title="https://yoast.com/coordinated-security-release/" href="https://yoast.com/coordinated-security-release/">first reported by Joost de Valk</a> who has an excellent post describing the issue. Sucuri worked with Yoast and discovered the problem affects a lot more plugins than just WordPress SEO. Sucuri has audited the top 300-400 plugins in the directory and found at least 15 plugins to contain vulnerable code.</p>\n<ul>\n<li><a title="http://jetpack.me/2015/04/20/jetpack-3-4-3-coordinated-security-update/" href="http://jetpack.me/2015/04/20/jetpack-3-4-3-coordinated-security-update/">Jetpack</a></li>\n<li><a href="https://yoast.com/coordinated-security-release/">WordPress SEO</a></li>\n<li><a title="https://yoast.com/google-analytics-5-4-notes/%" href="https://yoast.com/google-analytics-5-4-notes/%">Google Analytics</a></li>\n<li><a title="http://semperfiwebdesign.com/blog/update-to-all-in-one-seo-pack-to-patch-security-vulnerability/" href="http://semperfiwebdesign.com/blog/update-to-all-in-one-seo-pack-to-patch-security-vulnerability/">All In one SEO</a></li>\n<li><a title="http://www.gravityhelp.com/gravity-forms-v1-9-6-released/" href="http://www.gravityhelp.com/gravity-forms-v1-9-6-released/">Gravity Forms</a></li>\n<li>Multiple Plugins from <a href="https://easydigitaldownloads.com/?p=500387">Easy Digital Downloads</a></li>\n<li><a title="https://updraftplus.com/updraftplus-1-9-64-2-9-64/" href="https://updraftplus.com/updraftplus-1-9-64-2-9-64/">UpdraftPlus</a></li>\n<li><a title="https://wpecommerce.org/news/important-security-release-for-all-wp-ecommerce-users/" href="https://wpecommerce.org/news/important-security-release-for-all-wp-ecommerce-users/">WP e-Commerce</a></li>\n<li>WPTouch</li>\n<li>Download Monitor</li>\n<li>P3 Profiler</li>\n<li><a title="https://wordimpress.com/how-open-source-benefits-web-security/" href="https://wordimpress.com/how-open-source-benefits-web-security/">Give</a></li>\n<li><a title="https://ithemes.com/2015/04/20/coordinated-wordpress-plugin-security-update/" href="https://ithemes.com/2015/04/20/coordinated-wordpress-plugin-security-update/">iThemes Exchange</a></li>\n<li>Broken-Link-Checker</li>\n<li><a title="https://ninjaforms.com/security-release-v2-9-11/" href="https://ninjaforms.com/security-release-v2-9-11/">Ninja Forms</a></li>\n<li><a title="http://aesopstoryengine.com/releases/security-release-1-6-1/" href="http://aesopstoryengine.com/releases/security-release-1-6-1/">Aesop Story Engine</a></li>\n<li><a title="https://www.joedolson.com/2015/04/important-security-fix-for-my-calendar/?utm_content=bufferdc550&utm_medium=social&utm_source=twitter.com&utm_campaign=buffer" href="https://www.joedolson.com/2015/04/important-security-fix-for-my-calendar/?utm_content=bufferdc550&utm_medium=social&utm_source=twitter.com&utm_campaign=buffer">My Calendar</a></li>\n</ul>\n<p>With over <a title="https://wordpress.org/plugins/" href="https://wordpress.org/plugins/">37,000 plugins in the directory</a>, 400 is just scratching the surface. Gary Pendergast, who is helping to manage the coordinated effort says, he doesn&#8217;t have an official headcount of the number of plugins affected. &#8220;There is no official head count on how many plugins are affected, as it’s a case-by-case thing to check.&#8221; Some of the vulnerable plugins within the list have opted-out of automatic updates. &#8220;Jetpack, EDD, P3, Download Monitor and Related Posts for WP opted-in to auto updates. I didn’t keep track of who opted out,&#8221; he said.</p>\n<p>So far, there is no evidence that suggests the vulnerability is being actively exploited. It&#8217;s extremely important that plugin authors revisit your code to make sure you&#8217;re not improperly using the <a title="https://codex.wordpress.org/Function_Reference/add_query_arg" href="https://codex.wordpress.org/Function_Reference/add_query_arg"><i>add_query_arg()</i></a> and <a title="https://codex.wordpress.org/Function_Reference/remove_query_arg" href="https://codex.wordpress.org/Function_Reference/remove_query_arg"><i>remove_query_arg()</i></a> functions. The Make WordPress Plugins site <a title="https://make.wordpress.org/plugins/2015/04/20/fixing-add_query_arg-and-remove_query_arg-usage/" href="https://make.wordpress.org/plugins/2015/04/20/fixing-add_query_arg-and-remove_query_arg-usage/">has a post</a> that provides in-depth information on how to check and fix your plugins.</p>\n<h2>This Vulnerability is Not New</h2>\n<p>Mike Jolley, lead developer for <a title="http://www.woothemes.com/" href="http://www.woothemes.com/">WooThemes</a>, published a post in 2013 on the use of <a title="http://mikejolley.com/2013/12/use-wordpress-url-manipulation-functions/" href="http://mikejolley.com/2013/12/use-wordpress-url-manipulation-functions/">WordPress&#8217; URL manipulation functions</a>. The post features <a title="https://codex.wordpress.org/Function_Reference/add_query_arg" href="https://codex.wordpress.org/Function_Reference/add_query_arg"><i>add_query_arg()</i></a> and <a title="https://codex.wordpress.org/Function_Reference/remove_query_arg" href="https://codex.wordpress.org/Function_Reference/remove_query_arg"><i>remove_query_arg()</i></a>, but near the end of the post, Jolley reminds developers to escape everything.</p>\n<blockquote><p>This caught me out a few weeks ago when I found out (the hard way) that WordPress doesn’t automatically sanitize the current URL if you don’t pass in your own. You need to use esc_url during output:</p>\n<p>echo esc_url( add_query_arg( $key, $value ) );</p>\n<p>If you forget to do this, a malicious URL, for example one containing some JavaScript, could potentially be output and executed on your page. Escape all the things to be safe!</p></blockquote>\n<h2>Battle Testing the Automatic Updater</h2>\n<p>To date, this is the largest coordinated effort between an outside party, the WordPress core and security teams, and plugin developers. According to Sucuri, affected plugin developers banded together for the common good. Pendergast confirmed that the auto updates only contain code needed to fix the security vulnerability. This should limit the possibility of auto updates breaking sites.</p>\n<p>The plugins listed above have already been patched and updates should be available to all users. Browse to <strong>Dashboard &#8211; Updates</strong> to check for and install any available updates.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 20 Apr 2015 17:19:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Jeff Chandler";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:46;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:107:"Post Status: Coordinated plugin updates to address security vulnerability in many popular WordPress plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"https://poststatus.com/?p=12357";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:118:"https://poststatus.com/coordinated-plugin-updates-to-address-security-vulnerability-in-many-popular-wordpress-plugins/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:10189:"<p>The common vulnerability that triggered a coordinated plugin update of many popular plugins this morning is caused by a lack of escaping of two WordPress functions, <code>add_query_arg()</code> and <code>remove_query_arg()</code>.</p>\n<p>It appears it was a common misunderstanding that the functions needed additional escaping when in use, and the WordPress Codex documentation for the functions did not show proper escaping in the example use cases for several years.</p>\n<p>The exact number of plugins affected is unknown, but a number of <a title="The most popular WordPress plugins" href="https://poststatus.com/popular-wordpress-plugins/">the most popular WordPress plugins</a> are affected.</p>\n<p>The vulnerability was originally disclosed to the team at Yoast by Johannes Schmitt of Scrutinizer CI. Joost de Valk took the issue to their security partner, Sucuri, and together they understood that the issue could affect far more than plugins than WordPress SEO and Google Analytics by Yoast.</p>\n<p>They worked with WordPress lead developer and WordPress.org plugin team member Dion Hulse to evaluate how many other top plugins may be vulnerable. Combined, Joost <a href="https://yoast.com/coordinated-security-release/">notes in his security notice post</a> that 44 people joined a dedicated WordPress Slack channel to work on the updates, which resulted in the coordinated release.</p>\n<h3>Millions of websites affected</h3>\n<p>Millions of websites are vulnerable due to this issue. Jetpack and Yoast&#8217;s WordPress SEO alone are active on well over a million websites.</p>\n<p><a href="https://blog.sucuri.net/2015/04/security-advisory-xss-vulnerability-affecting-multiple-wordpress-plugins">Sucuri has identified</a> a minimum of fifteen plugins affected, but they note they&#8217;ve only looked into the top &#8220;300-400&#8243; and others that were notable.</p>\n<p>In all likelihood, many more plugins than those listed will have similar vulnerabilities. <code>add_query_arg()</code> and <code>remove_query_arg()</code> are relatively common functions in advanced WordPress development.</p>\n<h3>Not always a high risk vulnerability</h3>\n<p>It&#8217;s hard to speak for exactly how high risk the mis-use of the functions could be, as they are used in different ways in different plugins; and even within a certain plugin codebase, they could be used many times and have different risk levels in each instance.</p>\n<p>Escaping is a fundamental development principal. One of my favorite coffee mugs (pictured above) is from WordPress.com VIP and says, &#8220;Sanitize early, escape late, and drink often.&#8221;</p>\n<p>It is therefore concerning that there was such broad misuse of a WordPress function for so long, and it went unchecked in the Codex.</p>\n<p>The Codex previously had examples without escaping, and it had no indication whether the return value was escaped or not. It simply stated that the return value as, &#8220;New URL query string.&#8221;</p>\n<p>This has been updated, both in the examples and the return value section, to note that it can potentially return unescaped data.</p>\n<blockquote><p>New URL query string. Note that this string may contain unescaped data not intended for a URL, especially if the data added comes from user input. The result should be passed through esc_url() before being output as HTML, in a link.</p></blockquote>\n<p>That said, of the developers I&#8217;ve spoken to, even with the vulnerabilities in place they say that the risk of exploitation is small, due to the privileges required of users to attack. Though it is important to note that <em>that is no guarantee</em>, and it is important to update your plugins if you have updates available.</p>\n<p>The Codex is a wiki. It&#8217;s not a fundamental issue of WordPress that this was poorly documented, however it does point to some of the problems that have been noted for some time in regard to the value of the Codex. In fact, just this morning the Codex page for <a href="https://developer.wordpress.org/reference/functions/add_query_arg/">add_query_arg()</a> was redirected to the new developer.wordpress.org page for the function instead.</p>\n<p>Eventually, the Codex will go away for most functions that can point to the <a href="https://developer.wordpress.org">new developer reference</a>.</p>\n<h3>Five plugins opting in to forced updates</h3>\n<p>Jetpack, Easy Digital Downloads, P3 Plugin Profiler, Download Monitor, and Related Posts for WordPress are all opting in to automated forced updates from WordPress.org. This means that these plugins have created new releases for each major branch of their plugins to be distributed and automatically updated by the WordPress.org team.</p>\n<p>Other plugins are not opting in. Notably, Yoast did not opt in for WordPress SEO or their Google Analytics plugin. Joost de Valk cites concerns that some site owners had their plugins deactivated during the <a href="https://yoast.com/wordpress-seo-security-release/">last forced upgrade process</a> they went through.</p>\n<p>Indeed, my own site has had plugins deactivate when forced updated each time it&#8217;s occurred. I took this issue to members of the WordPress.org update team, and was told that they believe it is an edge case occurrence, and that while they are monitoring new updates, there is not currently a plan to change practices for the updates. I will be very interested with the updates today how commonly this happens.</p>\n<h3>Other posts and resources</h3>\n<p>I will continue to collect plugin update posts, changelogs, and other resources for this update. If you run a WordPress website, these updates will likely affect you.</p>\n<p>There is no reason for panic or to be too concerned, but you should update your plugins as soon as you can to reduce your risk of vulnerability.</p>\n<ul>\n<li><a href="https://blog.sucuri.net/2015/04/security-advisory-xss-vulnerability-affecting-multiple-wordpress-plugins">Sucuri security notice</a></li>\n<li><a href="https://yoast.com/coordinated-security-release/">Yoast</a> post</li>\n<li><a href="http://jetpack.me/2015/04/20/jetpack-3-4-3-critical-security-update/">Jetpack</a> post</li>\n<li><a href="https://easydigitaldownloads.com/blog/security-fix-released/">Easy Digital Downloads</a> post</li>\n<li><a href="http://www.gravityhelp.com/gravity-forms-v1-9-6-released/">Gravity Forms</a> post</li>\n<li><a href="https://ninjaforms.com/security-release-v2-9-11/">Ninja Forms</a> post</li>\n<li><a href="https://wpecommerce.org/news/important-security-release-for-all-wp-ecommerce-users/">WP eCommerce</a> post</li>\n<li><a href="https://updraftplus.com/updraftplus-1-9-64-2-9-64/">UpdraftPlus</a> post</li>\n<li><a href="https://ithemes.com/2015/04/20/coordinated-wordpress-plugin-security-update/">iThemes Exchange</a> post</li>\n<li><a href="http://aesopstoryengine.com/releases/security-release-1-6-1/">Aesop Story Engine</a> post</li>\n<li><a href="https://wordpress.org/plugins/download-monitor/changelog/">Download Monitor</a> changelog</li>\n<li><a href="http://semperfiwebdesign.com/blog/all-in-one-seo-pack/all-in-one-seo-pack-release-history/">All In One SEO</a> changelog</li>\n<li><a href="https://www.joedolson.com/2015/04/important-security-fix-for-my-calendar/">My Calendar</a> post</li>\n<li><a href="https://github.com/WordImpress/Give/commit/b88fea00999534355e0a124d0b7c4d0cee164d39">Give</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/broken-link-checker/changelog/">Broken Link Checker</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/wptouch/changelog/">WPTouch</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/p3-profiler/changelog/">P3 Profiler</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/related-posts-for-wp/changelog/">Related Posts for WP</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/link-library/changelog/">Link Library</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/google-analytics-top-posts-widget/changelog/">Google Analytics Top Posts Widget</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/bilingual-linker/changelog/">Bilingual Linker</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/ultimate-member/changelog/">Ultimate Member</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/piklist/changelog/">Piklist</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/seriously-simple-podcasting/changelog/">Seriously Simple Podcasting</a> changelog</li>\n<li><a href="https://wordpress.org/plugins/cachify/changelog/">Cachify</a> changelog</li>\n<li><a href="https://bbpress.org/blog/2015/04/bbpress-2-5-7-security-release/">bbPress</a> post</li>\n<li><a href="https://buddypress.org/2015/04/buddypress-2-2-3-security-release/">BuddyPress</a> post</li>\n<li><a href="https://wordpress.org/plugins/buddydrive/changelog/">BuddyDrive</a> changelog</li>\n<li><a h