(131, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wp-turkiye/~3/0ly-Y2K3WE0/''>WordPress Türkçe 4.2.1</a> <span class="rss-date">28 Nisan 2015</span><div class="rssSummary">Merhaba arkadaşlar, WordPress Türkçe 4.2.1 şu an indirilebilir durumda. Önemli bir güvenlik açığını kapatan bu güvenlik sürümünü web sitenize bir an önce uygulamanız önerilmektedir. Bu güvenlik dağıtımında yorum alanındaki bir açık kullanılarak sızma gerçekleştirilmesine olanak sağlayan kritik güvenlik açığı kapatıldı. Otomatik güncelleme özelliği aktif olan sitelerde güncelleme otomatik olarak uygulanacaktır. WordPress.org üzerindeki resmi 4.2.1 duyurusuna [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://ma.tt/2015/04/changing-americas-mind/''>Matt: Changing America’s Mind</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/how-to-restore-the-link-title-attribute-removed-in-wordpress-4-2''>WPTavern: How to Restore the Link Title Attribute Removed in WordPress 4.2</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/toivo-a-bold-minimalist-wordpress-theme-for-blogs-and-businesses''>WPTavern: Toivo: A Bold Minimalist WordPress Theme for Blogs and Businesses</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Beğenilen eklentiler:</span> <a href=''https://wordpress.org/plugins/ml-slider/'' class=''dashboard-news-plugin-link''>Meta Slider</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=ml-slider&amp;_wpnonce=085b9d2e3d&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Meta Slider''>Kur</a>)</span></li></ul></div>', 'no'),
