(1, 1, '2015-05-01 18:26:44', '2015-05-01 15:26:44', 'WordPress&#8217;e hoş geldiniz. Bu sizin ilk yazınız. Bu yazıyı düzenleyin ya da silin. Sonra blog dünyasına adım atın!', 'Merhaba dünya!', '', 'trash', 'open', 'open', '', 'merhaba-dunya', '', '', '2015-05-01 18:52:24', '2015-05-01 15:52:24', '', 0, 'http://zeonnn.com/?p=1', 0, 'post', '', 1),
(2, 1, '2015-05-01 18:26:44', '2015-05-01 15:26:44', 'Bu örnek bir sayfadır. Bir blog yazısından farklıdır çünkü belirli bir yerde sabit olarak kalır ve temanızın dolaşım menüsünde başlığı görüntülenir(çoğu tema destekler). Bir çok insan potansiyel ziyaretçilerini karşılamak adına bir Hakkında sayfası kullanır. Şuna benzeyen bir sayfa:\n\n<blockquote>Merhaba! Gündüzleri bisikletli kurye, geceleri ise hevesli bir aktörüm, burası da benim blogum. İstanbul&#8217;da yaşıyorum, Bıdık isminde harika bir köpeğim var ve pi&#241;a colada içmeyi seviyorum. (Ve yağmura yakalanmayı.)</blockquote>\\n\n\n...ya da bunun gibi bir şeyler:\n\n<blockquote>XYZ firması 1971&#8217;de kurulmuştur ve kurulduğundan bu yana kaliteli şeyler üretmektedir. Gotham şehrinde konuşlanmış olan XYZ firması 2.000&#8217;in üzerinde çalışanı ile Gotham şehri için her şeyin en iyisini yapmaya çalışmaktadır.</blockquote>\n\nYeni bir WordPress kullanıcısı olarak öncelikle <a href="http://zeonnn.com/wp-admin/">başlangıç sayfasına</a> giderek bu sayfayı silip kendi sayfalarınızı oluşturmalısınız. İyi eğlenceler!', 'Örnek sayfa', '', 'publish', 'open', 'open', '', 'ornek-sayfa', '', '', '2015-05-01 18:26:44', '2015-05-01 15:26:44', '', 0, 'http://zeonnn.com/?page_id=2', 0, 'page', '', 0),
(3, 1, '2015-05-01 18:26:53', '0000-00-00 00:00:00', '', 'Otomatik taslak', '', 'auto-draft', 'open', 'open', '', '', '', '', '2015-05-01 18:26:53', '0000-00-00 00:00:00', '', 0, 'http://zeonnn.com/?p=3', 0, 'post', '', 0),
(5, 1, '2015-05-01 18:52:24', '2015-05-01 15:52:24', 'WordPress&#8217;e hoş geldiniz. Bu sizin ilk yazınız. Bu yazıyı düzenleyin ya da silin. Sonra blog dünyasına adım atın!', 'Merhaba dünya!', '', 'inherit', 'open', 'open', '', '1-revision-v1', '', '', '2015-05-01 18:52:24', '2015-05-01 15:52:24', '', 1, 'http://zeonnn.com/2015/05/01/1-revision-v1/', 0, 'revision', '', 0),
