(15, 1, '2015-05-01 19:26:26', '2015-05-01 16:26:26', 'Avrupa LCS, Kuzey Amerika LCS, LCK, LPL, LMS ve Wild Card şampiyonları. Bu takımların hepsi, <strong>7-10 Mayıs</strong> tarihleri arasında Amerika’nın Florida eyaletinde gerçekleşecek Sezon Ortası Özel Turnuvası, yani MSI’da mücadele edecek.\r\n\r\nTürkiye’de düzenlenen Uluslararası Wild Card Özel Turnuvası’nın şampiyonu <strong>Beşiktaş’ın da yer alacağı</strong> MSI için, <strong>Kore temsilcisi hariç tüm takımlar belirlendi</strong>. İşte bölgeler ve belirlenen takımlar:\r\n<ul>\r\n	<li><strong>Fnatic – Avrupa LCS</strong></li>\r\n	<li><strong>Team SoloMid – Kuzey Amerika LCS</strong></li>\r\n	<li><strong>SK Telecom T1/GE Tigers - Kore LCK</strong></li>\r\n	<li><strong>EDward Gaming – Çin LPL</strong></li>\r\n	<li><strong>AHQ eSports – Güneydoğu Asya LMS</strong></li>\r\n	<li><strong>Beşiktaş – Türkiye/IWCI</strong></li>\r\n</ul>\r\n2 Mayıs Cumartesi günü SKT ve GET arasında oynanacak ve <a href="http://www.twitch.tv/riotgamesturkish" target="_blank">LoL TV''den canlı yayınlanacak LCK Finali</a>’yle beraber son takımın da belirleneceği MSI’ın detayları ise yavaş yavaş açıklanıyor. 6 takımın tek grupta mücadeleye başlayacağı organizasyonda, her takım birbiriyle 1 maç oynadıktan sonra ilk 4 sırayı alanlar yarı finale yükselecek. 5 maç üzerinden gerçekleşecek yarı final ve final karşılaşmalarının ardından ise MSI şampiyonu belirlenecek.\r\n\r\nTürkiye’de düzenlenen Uluslararası Wild Card Özel Turnuvası’nda grup aşamasından sonra mükemmel bir performans sergileyen Beşiktaş’ın, dünyanın en iyilerine karşı hem Wild Card bölgelerini hem de ülkemizi temsil edeceği MSI, 7-10 Mayıs tarihleri arasında Florida’nın Tallahassee şehrinde yapılacak.\r\n\r\n<strong>Sezon ortası Özel Turnuvası’nın tüm karşılaşmaları LoL TV ekranlarından canlı olarak yayınlanacak. 7 Mayıs’ta başlayacak bu eşsiz heyecanı kaçırmayın! </strong>', 'Sezon Ortası Turnuvası 7 Mayısta Başlıyor !', '', 'publish', 'open', 'open', '', 'sezon-ortasi-turnuvasi-7-mayista-basliyor', '', '', '2015-05-01 19:28:33', '2015-05-01 16:28:33', '', 0, 'http://zeonnn.com/?p=15', 0, 'post', '', 0),
