', '', '2015-05-01 19:26:26', '2015-05-01 16:26:26', '', 15, 'http://zeonnn.com/15-revision-v1/', 0, 'revision', '', 0),
(18, 1, '2015-05-01 23:16:24', '2015-05-01 20:16:24', '<a href="http://zeonnn.com/wp-content/uploads/2015/05/rekkles-fnatic-750x422.jpg"><img class="alignnone size-medium wp-image-19" src="http://zeonnn.com/wp-content/uploads/2015/05/rekkles-fnatic-750x422-300x169.jpg" alt="rekkles-fnatic-750x422" width="300" height="169" /></a>\r\n\r\nGeçtiğimiz sezon öncesi, Avrupa LCS flaş transferler ile çalkalanmıştı. Fnatic takımının 4 veteran oyuncusu takımdan ayrıldıktan sonra yerleri çaylak oyuncularla doldurulmuştu ve kimse bir başarı beklemiyordu. Fakat Fnatic, Avrupa LCS Şampiyonu olarak bütün beklentilerin üzerine çıktı.<span id="more-7921"></span> Geçtiğimiz sezon takımdan ayrılan oyuncular arasında yıldız nişancı Rekkles da bulunmaktaydı. Görünen o ki Rekkles, aradığını Elements’de bulamadı ve eski yuvasına geri dönüyor.\r\n\r\nSezon başında Rekkles’ın Elements’e gitmesi tüm Fnatic hayranları tarafından “ihanet” olarak görülmüştü. Elements (önceki adı ile Alliance) sezonu şampiyon olarak bitirmişti ve Dünya Şampiyonası’ndaki kötü performansları onları kadrolarını değiştirmeye itmişti. Rekkles’ın takıma katılmasının hali hazırda “super team” olarak adlandırılan Elements’i daha da ileriye götüreceği düşünülse de, hiç de düşünüldüğü gibi olmadı.\r\n\r\nElements takımının karakteristik oyun stili olan pasif oyun, takımın en büyük baş belasıydı. Geçtiğimiz sezon kaybettikleri tüm maçları oyun tarzları yüzünden kaybeden takımın en agresif oyuncusu Tabbz’dı ve oyuncuyu Rekkles ile değiştirmeleri Elements’i daha da pasif bir konuma sürükledi. Önce üst koridor oyuncuları Wickd gitti, ardından takımın destek oyuncusu Nyph. Playofflara dahi kalmayı başaramayan Elements takımı için 2015 Kış Sezonu hayal kırıklığı ile sonuçlanırken Rekkles’ın mutsuzluğu yüzünden okunabilirdi.\r\n\r\nTüm bunlar olurken, Fnatic, takıma 2 Koreli transfer etmiş, H2K Gaming’in yıldız orta koridoru Febiven’i ve soloq’nun yıldız oyuncularından Steelback’i takıma katmış, inanılmaz bir sinerji yakalamıştı. Sezonun açılış maçında Elements’i ezici bir üstünlükle yenen Fnatic, potansiyellerini yavaş yavaş ortaya koyacaklarını ve şampiyonluk için önemli bir aday olduklarını daha ilk maçtan belirtmişlerdi. Fnatic, maçlar ilerledikçe daha fazla takım olmaya başladı ve finallerde UOL’u geçerek şampiyon olmayı başardı. Fnatic şampiyon olunca Rekkles’ın şampiyon takımdan ayrıldığı için büyük bir pişmanlık duyduğunu varsayabiliriz.\r\n\r\nElements’in kaybettiği her maçta Rekkles’ın takımdan ayrılacağı haberleri artmaya başladı ve spekülasyonların gerçekliği daha da sorgulandı. Sezon arası yaşanırken, Rekkles’ın Fnatic’e transferi neredeyse kesin gibi gözükmekte. En azından Rekkles’ın Elements ile devam etmeyeceğini büyük ölçüde söyleyebiliriz.\r\n\r\n<strong>Peki Rekkles’ın Fnatic’e transferi, Fnatic için gerçekten de gerekli bir transfer mi?</strong>\r\n\r\nBu noktada Steelback’in performansını incelememiz ve Rekkles ile karşılaştırmamız gerekir. Steelback, takımdaki 3. hasar veren oyuncu. Bunların başında Huni ve Febiven gelmekte. Bu istatistik aslında Steelback’i yetersiz bir oyuncu olarak göstermekte fakat işin iç yüzü çok farklı. Huni’nin 1. hasar tehditi olmasının altındaki en büyük neden ReignOver. Ormancı baskısından en çok payını alan koridor üst koridor ve Huni’nin takımı taşıması/çok fazla hasar vermesi oldukça doğal bir durum. Febiven’in sıralaması ise oyuncunun orta koridor oyuncusu olması ve destek oyuncusu baskınlarının çoğuna sahip olması. Steelback ise bana kalırsa tüm bu etmenlerin dışında oldukça iyi bir performans sergiledi. Oyunun başının büyük bir kısmında koridorunda yalnız kalması ve ormancı baskısını belki de en az alan koridorda oynaması, onun iyi bir performans sergilemesine engel olmadı. Ayrıca bir nişancı için destek oyuncusunun koridorda bulunmasının ne kadar önemli olduğunu SK takımının alt koridorunun ne kadar etkili olduğuna bakarak da anlayabiliriz.\r\n\r\nSteelback’in aksine Rekkles çok da iyi bir sezon geçirmedi. Rekkles’ın muazzam bir yeteneği ve oyun sezgileri bulunmakta. Oyun stilinin ise Steelback ile benzeştiğini söyleyebiliriz. Bu noktada Fnatic’in vermesi gereken karar ise; yeni bir yeteneğin büyümesine izin mi verecekler yoksa daha önceden yetiştirdikleri oyuncuyu mu seçecekler?\r\n\r\nElbette hala Rekkles’ın Fnatic takımına transfer olacağı konusu resmi değil. Yani tüm bunlar hala bir dedikodudan ibaret. Bildiğimiz şey ise MSI Turnuvası’nda Fnatic’in Steelback ile maçlara çıkacağı. Spekülasyonlara göre de MSI bittikten sonra Rekkles’ın takıma katılışının resmileşeceği yönünde. Eğer spekülasyonlar doğru ise, MSI, Steelback için kendini kanıtlama turnuvası olabilir.', 'Rekkles Fnatic’e geri dönüyor !', '', 'publish', 'open', 'open', '', 'rekkles-fnatice-geri-donuyor', '', '', '2015-05-01 23:16:59', '2015-05-01 20:16:59', '', 0, 'http://zeonnn.com/?p=18', 0, 'post', '', 0),
