(21, 1, '2015-05-01 23:18:11', '2015-05-01 20:18:11', '<a href="http://zeonnn.com/wp-content/uploads/2015/05/msi_client_header_1920x1080-750x422.jpg"><img class="alignnone size-medium wp-image-22" src="http://zeonnn.com/wp-content/uploads/2015/05/msi_client_header_1920x1080-750x422-300x169.jpg" alt="msi_client_header_1920x1080-750x422" width="300" height="169" /></a>\r\n\r\nLeague of Legends severlerinin merakla beklediği Sezon Ortası Özel Turnuva (Mid-Season Invitational) takvimi açıklandı.<span id="more-7892"></span>Temsilcimiz Beşiktaş’ın birbirinden dişli rakiplerle karşılaşacağı turnuva, bu sezon için bir ilk olacak. Daha önce sadece Dünya Şampiyonası’nda karşı karşıya gelen ekipler, Riot Games’in yeni uygulamaya koyduğu bu turnuvayla beraber sezon ortasında da karşılaşmak ve güçlerini test etme imkanı bulacaklar. Daha önce MSI Turnuvası ile ilgili tüm bilgileri <a href="http://5mid.com/lol/msi-turnuvasi-hakkinda-her-sey/" target="_blank">bu rehberimizde</a> düzenlemiş, Beşiktaş’ın bu turnuvaya katılmasının takım ve Türkiye’de e-Spor için ne anlam ifade ettiğini de<a href="http://5mid.com/lol/besiktas-msi-esporun-gelecegi/" target="_blank">burada</a> yazmıştık.\r\n\r\nBirbirinden heyecanlı ve zevkli karşılaşmaların bizi beklediği MSI takvimi ise şöyle:\r\n\r\n<strong>7 Mayıs 2015</strong>\r\n\r\n11:00 Fnatic – Team SoloMid\r\n\r\n12:00 Beşiktaş – Kore Şampiyonu (şampiyon 2 Mayıs’ta belli olacak)\r\n\r\n13:00 Edward Gaming – AHQ E-Sports Clup\r\n\r\n14:00 Beşiktaş – Team SoloMid\r\n\r\n15:00 Fnatic – AHQ E-Sports Clup\r\n\r\n16:00 Kore şampiyonu – Edward Gaming\r\n\r\n17:00 AHQ E-Sports Clup – Beşiktaş\r\n\r\n18:00 Kore şampiyonu – Team SoloMid\r\n\r\n<strong>8 Mayıs 2015</strong>\r\n\r\n11:00 Edward Gaming – Fnatic\r\n\r\n12:00 Team SoloMid – AHQ E-Sports Clup\r\n\r\n13:00 Edward Gaming- Beşiktaş\r\n\r\n14:00 Kore şampiyonu – Fnatic\r\n\r\n15:00 Team SoloMid – Beşiktaş\r\n\r\n16:00 Fnatic – Beşiktaş\r\n\r\n17:00 AHQ E-Sports Clup – Kore Şampiyonu\r\n\r\n<strong>9 Mayıs 2015</strong>\r\n\r\n**Yarı Finaller\r\n\r\n<strong>10 Mayıs 2015</strong>\r\n\r\n**Final', 'Sonunda MSI Takvimi Açıklandı', '', 'publish', 'open', 'open', '', 'sonunda-msi-takvimi-aciklandi', '', '\nhttp://5mid.com/lol/msi-turnuvasi-hakkinda-her-sey/', '2015-05-01 23:18:11', '2015-05-01 20:18:11', '', 0, 'http://zeonnn.com/?p=21', 0, 'post', '', 0),
